(1, 'О компании по международным грузоперевозкам', '2012-03-02-10-09-38', '', '<p><strong>Международная транспортная экспедиторская компания \"Транспорт Юнион\" из Молдавии,</strong> <strong>с офисами в Приднестровье и Украине </strong>, работает на рынке транспортных логистических услуг уже более 5 лет. Мы начинали с организации грузоперевозок по России, потом вышли на рынок международных перевозок – стали осуществлять международные автомобильные перевозки из Европы в Россию и из России в Европу. Через некоторое время наши услуги стали включать международные воздушные перевозки, морские и железнодорожные, а также консолидацией и перевозкой сборных, мелких ,частичных грузов. Мы стали заниматься экспедированием и перевозкой грузов из самых отдаленных уголков планеты.<br /><strong> </strong></p>\r\n<p><strong>Транспортные и экспедиторские услуги</strong>.<br />В настоящее время спектр наших услуг включает в себя полный комплекс услуг по транспортировке товаров и всех типов грузов из  России, Европы, Германии, Польши, Италии, Франции, стран СНГ, Казахстана,Турции, Греции , Балканских стран, и стран Прибалтики,  перевозки грузов  из за рубежа в Россию, включая международное экспедирование грузов, оформление всей необходимой документации, страхование грузов. Перевозка международных грузов, таможенное оформление грузов, международные перевозки от двери до двери и полный спектр транспортных услуг по перевозкам грузов по России «под ключ» и т. д. Если<span style=\"color: #993300;\"> </span><span style=\"color: #993300;\"><span style=\"text-decoration: underline;\"><span style=\"color: #993300;\"><a href=\"ru/contacts.html\">Вы в поиске организатора международной перевозки</a></span></span> <span style=\"color: #000000;\">и вам требуется перевезти груз, вы ищите транспортную компанию, вам необходимо просчитать стоимость доставки груза?</span></span> Мы предоставим вам полный комплекс транспортных услуг, независимо от направления перевозки, типа транспорта и наименования груза. Оцените качество наших услуг. <span style=\"font-size: small;\"><strong> </strong></span></p>\r\n<p> </p>\r\n<p><span style=\"font-size: small;\"><strong>Основные типы перевозок и транспортировки грузов:</strong></span><br />Транспорт еврофуры тентованные с прицепами  до 120 куб. до 22т.<br />Тентованные грузовики грузоподъёмностью до 45 куб. 5тон.<br />Рефрижераторные фуры до 20т.86куб. с холодильными установками.<br />Грузовики рефрижераторные до 5тон. С температурным режимом.<br />Перевозка автомобилей автовозами из Европы и по России.</p>\r\n<p>Перевозки грузов железнодорожным транспортом.</p>\r\n<p>Транспортировка спец.техники, и сельскохозяйственных машин.<br />Перевозка зерновозами по России, и международная доставка.<br />Контейнеровозы по доставке морских контейнеров.<br />Перевозка крупногабаритных грузов по России и из Европы.<br />Организация морских перевозок из портов Украины и России.<br />Доставка небольших партий грузов, сборных и частичных.</p>\r\n<p>Перевозка жидких грузов автоцистернами.<br />Грузоперевозка опасных грузов ADR .</p>\r\n<p> </p>\r\n<p><span style=\"font-size: medium;\"><span style=\"color: #000000;\"><strong>Закажите перевозку за 5 минут, заполнив форму заявки.</strong></span></span></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Стоимость грузоперевозок и доставки грузов.</strong><br />Каждая перевозка индивидуальна по стоимости и сложности, в зависимости от характера груза, от веса и объёма перевозимого груза. Стоимость перевозки зависит от расстояния перевозимого груза и типа транспорта. Стоимость доставки груза определяется на момент заказа перевозки и нужного транспорта, индивидуально под груз. На стоимость перевозки также влияют дополнительные документы по которым будет доставляться груз к примеру при международной перевозки по TIRу, CMR страхование, страхование груза, и дополнительные транспортные разрешения. Стоимость перевозки также зависит, от стоимости перевозимого груза.</p>\r\n<p><strong>Стоимость перевозки согласовывается с грузовладельцем исходя из конкретно перевозимого груза,</strong> учитывая подачу необходимого транспорта, нужного размера и типа. Стоимость доставки может быть выше, если груз необходимо застраховать , или перевозить груз с температурным режимом как скоропортящийся товар или требующий соблюдения нужной температуры. <strong>Также на стоимость влияет сложность грузоперевозки,</strong> к примеру: перевозка спецтехники или негабаритного груза, или  грузов небольшого размера применяя разные типы транспорта: авиа, авто, или как сборный груз. Перевозка опасного груза, в зависимости от класса опасности также поднимет стоимость фрахта. Срочность перевозки, стоимость груза, индивидуальная схема доставки , всё это отразится на стоимости грузоперевозки. <span style=\"color: #993300;\"><strong>Для быстрого определения стоимости грузоперевозки</strong> <span style=\"text-decoration: underline;\"><a href=\"ru/cform.html\">необходимо направить заявку On-Line</a>,</span> <span style=\"color: #000000;\">размещённую на сайте, или в разделе контакты.</span><br /></span></p>\r\n<p><strong>Организация международных перевозок грузов</strong> – это сложная логистическая цепь доставки товара в различные города и страны, в котором участвуют не только компания – отправитель, компания – получатель товара и транспортная компания, осуществляющая международные перевозки грузов, но и необходимые человеческие единицы такие как: водители – экспедиторы, авиа диспетчера, портовые работники, ж.д.диспетчера, грузчики, и другие необходимые кадры. Таким образом, целью Международной транспортной компании является организация международных транспортных перевозок и перевозок грузов по России по тщательно отработанным логистическим схемам с организацией слаженной работы всех вышеперечисленных кадров, жестким контролем всех звеньев цепи и оперативным решением форс – мажорных ситуаций. Все международные дорожные перевозки и перевозки по России осуществляются на высоконадежных транспортных средствах таких марок как Камаз, Маз, Iveco (Ивеко). Автопоезда от 90-до 120 куб.м.: Scania (Скания), Renault (Рено), Volvo (Вольво), Man (Ман), Mercedes.<span style=\"text-decoration: underline;\"><br /></span></p>\r\n<p> </p>\r\n<p><strong>Международные грузоперевозки по направлениям: </strong>из России в страны Европы, Скандинавские страны, Казахстан, Турция, Греция . Грузоперевозки из стран Прибалтики: Литвы, Латвии , из Эстонии. Доставка грузов из России в Молдову и Румынию, Болгарию, Сербию, Хорватию. Перевозки грузов из Китая, Арабских эмират, автоперевозки из России в Туркменистан, Узбекистан, Азербайджан всеми видами транспорта и любых наименований грузов.</p>', '', 1, 0, 0, 0, '2012-03-02 10:08:27', 62, '', '2013-08-18 19:13:56', 62, 0, '0000-00-00 00:00:00', '2012-03-02 10:08:27', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 118, 0, 59, 'Международная транспортная компания: международное экспедирование грузов, международные автомобильные перевозки из Европы в Россию и из России в Европу воздушные перевозки, морские и железнодорожные перевозки по России, по всему миру, оформление всей необходимой документации, страхование грузов, сопровождение международных грузов, таможенное оформление грузов, международные перевозки от двери до двери и полный спектр услуг по перевозкам по России под ключ, рынок логистических услуг, организации грузоперевозок по России, международных перевозок, экспедированием и перевозкой грузов по всему миру, рынок международных перевозок, организация грузоперевозок по России, транспортировка товара в России и за рубежом, транспортная компания, осуществляющая международные перевозки грузов, контейнерные перевозки  международные перевозки контейнеров, российские контейнерные перевозки, международные железнодорожные грузоперевозки зарубежные и по России, перевозки грузов в международном сообщении.', 'Международная транспортная компания: международное экспедирование грузов, международные автомобильные перевозки из Европы в Россию и из России в Европу воздушные перевозки, морские и железнодорожные перевозки по России, по всему миру, оформление всей необходимой документации, страхование грузов, сопровождение международных грузов, таможенное оформление грузов, международные перевозки от двери до двери и полный спектр услуг по перевозкам по России под ключ', 0, 1011, 'robots=\nauthor='),
(2, 'Услуги международной доставки грузов.', '2012-03-02-10-40-54', '', '<p><strong>Транспортные услуги которые можно заказать в нашей компании в режиме on-line, отправив заявку.</strong></p>\r\n<p><a href=\"zheleznodorozhnye-gruzoperevozki.html\"><span style=\"line-height: 1.3em;\">Железнодорожные грузоперевозки</span></a></p>\r\n<p><a href=\"avtoshema.html\">Схема осуществления международных перевозок грузов автомобильным транспортом</a></p>\r\n<p><a href=\"avtotransport.html\">Виды грузового автомобильного транспорта</a></p>\r\n<p><a href=\"avtocontainer.html\">Автомобильные контейнерные перевозки</a></p>\r\n<p><a href=\"seacontainer.html\">Контейнерные морские перевозки грузов</a></p>\r\n<p><a href=\"cargo_navalochnie_by_sea.html\">Навалочные морские перевозки грузов</a></p>\r\n<p><a href=\"cargo_roro_by_sea.html\">Ро-ро перевозки (ролкерные перевозки)</a></p>\r\n<p><a href=\"seashema.html\">Схема осуществления международной морской перевозки на примере контейнерной перевозки</a></p>\r\n<p><a href=\"seatransport.html\">Виды морского транспорта</a></p>\r\n<p><a href=\"seacontainer.html\">Морские контейнерные перевозки</a></p>\r\n<p><a href=\"aviashema.html\">Схема осуществления международной авиа перевозки грузов</a></p>\r\n<p><a href=\"railshema.html\">Схема осуществления железнодорожной перевозки грузов</a></p>\r\n<p><strong><a href=\"customs_services.html\">Услуги по  таможенной очистке</a></strong></p>\r\n<p><strong><a href=\"customs_cargo.html\">Грузоперевозки и таможенные услуги</a></strong></p>\r\n<p> </p>\r\n<p><span style=\"line-height: 1.3em;\"><strong><strong>Заказ перевозки производится через заявку или по телефону</strong>.</strong></span></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-02 10:40:21', 62, '', '2013-12-16 18:09:48', 62, 62, '2014-02-27 13:03:07', '2012-03-02 10:40:21', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_c