(3, 'Контакты отдела перевозок, заказ машин, международные грузоперевозки', '2012-03-02-11-14-06', '', '<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>Вопросы по международным грузоперевозкам, в направлениях России, Европы, стран СНГ, Сербии , Болгарии. Заказ перевозки из Румынии, Молдавии, Турции, Греции, Казахстан и другие страны.</strong> </span></p>\r\n<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><br /></span></p>\r\n<p><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+373 680 13 888   <span style=\"color: #800000;\"> <span style=\"font-size: small;\">Менеджер по международным перевозкам <strong> </strong>Кристина</span></span></span></p>\r\n<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><span style=\"color: #800000;\">Направление</span>:<strong> </strong><span style=\"font-family: verdana,geneva;\">Европа, Прибалтика, Россия, Казахстан</span><br /></span></p>\r\n<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><br /></span></p>\r\n<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"> </span></p>\r\n<p><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: verdana,geneva;\">+373 685 27 444   <strong> </strong><span style=\"font-size: small;\"><span style=\"color: #800000;\">Менеджер по перевозкам<strong> </strong>Кристина</span></span></span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"><span style=\"color: #800000;\">Направление:</span> Молдова, Европа, Россия, Греция, Беларусь<br /></span></p>\r\n<p> </p>\r\n<p><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: verdana,geneva;\">+373 686 94 443<strong> </strong><span style=\"color: #800000;\">Менеджер по заказу транспорта<strong> </strong>Владимир</span></span></p>\r\n