p><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: 12pt;\"><span style=\"font-size: 10pt;\"><span style=\"color: #800000;\">Направление</span>: Европа, Россия, Прибалтика, Скандинавия, ПМР.<br /></span></span></span></p>\r\n<p> </p>\r\n<p><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: 12pt;\"><span style=\"font-size: 10pt;\"><strong><span style=\"font-size: 12pt;\"><span style=\"font-size: 10pt;\"><strong><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /></strong></span></span></strong><span style=\"font-size: 12pt;\"><span style=\"font-size: 10pt;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+373 686 94 453</span> <span style=\"color: #800000;\">Иван  Международные грузоперевозки по  странам<br /></span></span></span></span></span></span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: 12pt;\"><span style=\"font-size: 10pt;\"><span style=\"font-size: 12pt;\"><span style=\"font-size: 10pt;\"><span style=\"color: #800000;\">Направления: <span style=\"color: #000000;\">Россия, Украина,Турция, Греция, Приднестровье</span><br /></span></span></span></span></span></span></p>\r\n<p> </p>\r\n<p><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: verdana,geneva;\">+373 684 99001</span> <span style=\"color: #800000;\">Кристина Менеджер  международные перевозки<br /></span></p>\r\n<p><span style=\"color: #800000;\">Направления</span>: Европа, Россия, Казахстан, Украина, Прибалтика, Румыния</p>\r\n<p> </p>\r\n<p><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: verdana,geneva;\">+373 686 944 42</span> <span style=\"color: #800000;\">Наталья  менеджер,  международные направления</span></p>\r\n<p><span style=\"color: #800000;\">Направления</span>:  Европа, Россия, Казахстан, Украина, Румыния, ПМР.</p>\r\n<p> </p>\r\n<p><strong>Заказ Авто и морских контейнерных перевозок</strong></p>\r\n<p><span style=\"color: #800000;\">Направления</span>: СНГ,Европа, Турция, Украина ,Молдова,Приднестровье.<br /><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+373 684 99009</span> Артём.</p>\r\n<p> </p>\r\n<p><strong>Консультанты по международным грузоперевозкам</strong></p>\r\n<p><span style=\"color: #000080;\"> </span><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+373  686 777 32 Алина. </span> Консультации, международное  направление.</p>\r\n<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+ 373 686 777 36 Ирина.</span> Консультации, международное  направление.</p>\r\n<p><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+373 686 777 12 отдел общих вопросов по перевозкам<br /></span></p>\r\n<p><img src=\"http://movers-auto.md/images/phone.gif\" border=\"0\" style=\"margin: 0pt;\" /> <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+373 777 88 958  направление: Россия-Приднестровье Тирасполь</span></p>\r\n<p><br /><a target=\"_blank\">E-mail - mtperevozki@gmail.com </a></p>\r\n<p><span style=\"color: #993300;\"><br /></span></p>\r\n<p><span style=\"color: #993300;\"> </span></p>\r\n<p><span style=\"color: #993300;\"><strong>Заказать перевозку можно on-line, заполнив поля заявки .</strong></span><br />{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-02 11:13:33', 62, '', '2017-09-27 15:27:53', 62, 0, '0000-00-00 00:00:00', '2012-03-02 11:13:33', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 158, 0, 57, 'перевозки, доставка грузов, международная транспортная компания, автоперевозки по России, транспортные перевозки Греция, Турция, Молдова', 'Отдел перевозок, Заказ транспорта , Транспортная компания , международные грузоперевозки, авто перевозки, грузоперевозки из России ', 0, 153206, 'robots=\nauthor='),
(4, 'Авиаперевозки грузов, грузовые авиаперевозки.', 'avia', '', '<p>Грузовые авиа перевозки, авиа транспорт для доставки срочных грузов, авиа экспресс доставка</p>\r\n', '\r\n<p align=\"justify\">Бурное  развитие международных экономических взаимоотношений влияет на рост  экспортно-импортных операций между российскими и зарубежными компаниями, что  влечет за собой рост  рынка  международных  грузоперевозок, в  частности рынка <strong>международных авиа перевозок.</strong></p>\r\n<p align=\"justify\"><br /> <strong>Международные авиа перевозки грузов</strong> – это наиболее быстрый способ доставки  международного груза поэтому <strong>авиа грузоперевозки</strong> пользуются большой популярностью, но это не является единственным преимуществом  авиа грузоперевозок.<strong> Воздушные  грузоперевозки </strong>имеют обширную географию доставки товара (<strong>авиа доставка грузов</strong> осуществляется  практически из\\в любой точки земного шара) Кроме того, воздушные грузоперевозки  отличаются высокой надежностью и безопасностью перевозки товаров.</p>\r\n<p align=\"justify\"><br /> Несмотря на то, что стоимость <strong>авиа грузоперевозок  воздушным транспортом</strong> немного выше других способов доставки груза,<strong> </strong>грузовые авиационные перевозки грузов<strong> </strong>просто незаменимы при перевозке  срочных  и ценных грузов, скоропортящихся  продуктов или при доставке груза в труднодоступную точку земного шара. При <strong>авиа доставке товара</strong>, который не  является габаритным, например крупногабаритная техника, тяжеловесное  оборудование и т.п. в нашем распоряжении авиа – тяжеловесы, которые доставят  негабарит в \\ из любой точки мира. Грузовые самолеты – тяжеловесы также  используются при <strong>перевозке самолетом  авиа контейнеров. </strong>При<strong> воздушной  перевозке контейнеров</strong> необходимо четкое соблюдение всех нормативов, потому  что <strong>контейнерная воздушная перевозка, </strong>в  частности и целостность перевозимого<strong> </strong>воздушного  груза подразумевает быстрый взлет и посадку, возможную турбулентность, поэтому  перевозимые самолетом контейнеры и перевозимый груз должны быть тщательно  закреплены .<strong> Грузоперевозки  авиатранспортом </strong>просто незаменимы для перевозки грузов через океан, <strong>перевозка грузов самолетом</strong> через океан  может занять 1 день с выполнением всех необходимых формальностей, в то время  как доставка товара через океан на корабле может занять недели.</p>\r\n<p align=\"justify\"><br /> Наша  компания занимается <strong>международными  воздушными перевозками грузов </strong>уже много лет, за которые наши сотрудники  накопили обширный опыт <strong>авиа экспедирования  грузов, </strong>и<strong> </strong>что позволило нашей  организации стать достойным и профессиональным участником <strong>рынка</strong> <strong>международных  авиа перевозок. </strong>Мы сотрудничаем с крупнейшими авиакомпаниями разных стран и  предоставляем услуги по международным перевозкам грузов<strong> </strong>по всему миру<strong>. </strong>Наши  клиенты работают с нами на долгосрочной основе, потому что мы предоставляем  качественные услуги по авиа доставке товара быстро и в срок, с соблюдением всех  договорных обязательств, что является немаловажным фактором для наших  клиентов  при планировании бизнес  деятельности и установлении долгосрочных деловых связей с партнерами из-за  рубежа.</p>\r\n<p align=\"justify\"><br /> Количество  компаний, занимающихся авиа экспедированием грузов, растет год от года и в  условиях жесткой конкуренции выживают многопрофильные фирмы, которые предлагают  услуги по доставке авиа груза в комплексе услуг. Поэтому наша компания  предлагает не только услуги по международным воздушным перевозкам грузов, но также  услуги по страхованию авиа грузов, сопровождению VIP – грузов, перевозимых воздушным  транспортом.</p>\r\n<p align=\"justify\"><br /> <strong>Тарифы на грузовые авиа перевозки</strong> зависят от характера, веса и объема  перевозимого груза, расстояния между пунктом отправки и пунктом назначения, и  др. факторов, поэтому ставка на авиа перевозку рассчитывается индивидуально для  каждого вида перевозимого груза. Для Вашего удобства мы создали форму расчета  стоимости в разделе стоимость международной перевозки. Вам достаточно выбрать  необходимые параметры в предлагаемой форме письма и отправить нам. Наши  менеджеры рассчитают стоимость авиа перевозки и свяжутся с Вами в течение  кратчайшего промежутка времени.</p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"aviashema.html\">Схема осуществления международной авиа перевозки грузов</a></p>\r\n<p> </p>\r\n<p><strong>Для авиа доставки вашего груза, заполните заявку.</strong></p>\r\n<p>{mtpform}</p>', 1, 0, 0, 0, '2012-03-02 15:06:40', 62, '', '2014-11-19 16:49:59', 62, 0, '0000-00-00 00:00:00', '2012-03-02 15:06:40', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 13, 0, 56, 'Международные авиаперевозки грузов, авиагрузоперевозки, доставка международного груза, воздушные грузоперевозки, авиа доставка грузов, международными воздушными перевозками грузов, авиаэкспедирования грузов, рынка международных авиаперевозок, грузоперевозки воздушным транспортом, грузовые авиационные перевозки грузов, авиагруз, авиа доставка товара, авиадоставка товара, грузоперевозки авиатранспортом, перевозке самолетом авиа контейнеров, контейнерная, воздушная перевозка, воздушная перевозка контейнеров, перевозка грузов самолетом, тарифы на грузовые авиаперевозки, ставка на авиаперевозку', 'Международная транспортная компания предлагает: международные авиаперевозки грузов авиагрузоперевозки авиа доставка международного груза  товара авиадоставка воздушные грузоперевозки воздушным транспортом международные воздушные перевозки грузов авиаэкспедирования рынок международных авиаперевозок грузовые авиационные перевозки грузов авиагруз грузоперевозки авиатранспортом перевозка самолетом грузов авиа контейнеров контейнерная воздушная перевозка контейнеров тарифы на грузовые авиаперевозки ставка', 0, 10472, 'robots=\nauthor='),
(5, 'Морские грузоперевозки из Китая, перевозки морскими контейнерами из Турции, морская доставка грузов из Арабских Эмират.', 'sea', '', '<p>Морские контейнерные грузоперевозки, доставка грузов контейнерами морским путём</p>\r\n', '\r\n<p align=\"justify\"><strong>Морские грузоперевозки </strong>являются наиболее<strong> </strong>экономичным видом международной  перевозки товаров.  <strong>Международные морские грузоперевозки</strong> позволяют транспортировать груз на большие расстояния,  с грузоподъемностью в сотни тонн. Таким образом, основными преимуществами <strong>доставки грузов морским транспортом</strong> является сравнительная конкурентная стоимость морских перевозок по сравнению с  автомобильным или авиационным транспортом,   большая грузоподъемность судов, а к недостаткам относятся наличие  портов, терминалов не во всех городах назначения, невысокая скорость <strong>доставки грузов морем. </strong>Тем не менее,<strong> международные морские грузоперевозки, – </strong>это  один из наиболее стабильных видов грузовых перевозок, суда (корабли)  отправляются по расписанию, система <strong>перевозок  грузов по морю </strong>четко отлажена. <strong>Международные  перевозки морем</strong> позволяют экспедиторам беспрепятственно обеспечить <strong>транспортировку морских грузов </strong>без  утомительного прохождения наземных транзитных таможенных постов с последующим  оформлением морских грузов по прибытию в порт.<strong> </strong><br /> Рынок  морских грузоперевозок<strong> </strong>довольно  объемный благодаря большому разнообразию перевозимых грузов. <strong>Перевозки грузов морскими видами транспорта </strong>подразделяются на следующие виды <strong>транспортировки  грузов морем</strong>: <br /> <br /> <a class=\"style3\" href=\"seacontainer.html\">Контейнерные морские перевозки грузов</a><br /> <a class=\"style3\" href=\"cargo_navalochnie_by_sea.html\">Навалочные морские перевозки грузов</a><br /> <a class=\"style1 style3\" href=\"cargo_roro_by_sea.html\">Ро-ро перевозки (ролкерные перевозки)</a><br /> <br /> <strong>Навалочные морские перевозки грузов</strong> – это система транспортировки  насыпных (сыпучих) грузов. <strong>Ро-ро  перевозки (ролкерные перевозки) – </strong>это система<strong> </strong>транспортировки тяжеловесных грузов, самоходной техники на судах с  горизонтальной погрузкой. Вышеперечисленные виды транспортировки грузов морем  занимают небольшую долю рынка морских грузоперевозок, наиболее популярным видом  доставки грузов морем являются контейнерные морские перевозки грузов.<br /> Нельзя не  отметить, что<strong> </strong>национальные перевозки  грузов включают в себя не только доставку грузов морским транспортом, но и  международные речные перевозки, которые распространены на территориях, покрытых  сетью водоканалов и речных путей. Благодаря рекам, многие города имеют прямое  транспортное сообщение с морями и океанами, что делает возможным международную  перевозку товаров непосредственно до пункта назначения водными видами  транспорта.<br /> <strong>Тарифы на международные морские грузоперевозки (морской  фрахт)</strong> зависят от характера, веса и объема перевозимого груза, расстояния между  пунктом отправки и пунктом назначения, и др. факторов, поэтому ставка на международную  морскую перевозку груза рассчитывается индивидуально для каждого вида  перевозимого груза. Для Вашего удобства мы создали форму расчета стоимости в разделе <strong> стоимость международной перевозки.</strong> Вам достаточно выбрать необходимые параметры  в предлагаемой форме письма и отправить нам. Наши менеджеры рассчитают  стоимость морской перевозки и свяжутся с Вами в течение кратчайшего промежутка времени.<br /> Наша компания существует на рынке  грузоперевозок уже много лет, за это время наша организация накопила большой  опыт международных морских перевозок и зарекомендовала себя в качестве  надежного и ответственного партнера. С нами сотрудничают крупнейшие  контейнерные линии, океанские и фидерные перевозчики, такие как MAERSK, Hapag Lloyd, CMA CGM, China Shipping, Canada Maritime Ltd. (Canmar),  Ocean World Lines, Pacific International  Lines, Containerships<br /> OY Ltd, Delta  Shipping Lines, и многие другие<strong>.</strong></p>\r\n<p align=\"justify\"><strong><br /></strong></p>\r\n<p><a class=\"style3\" href=\"seashema.html\">Схема осуществления международной морской перевозки на примере контейнерной перевозки</a></p>\r\n<p><a class=\"style3\" href=\"seatransport.html\">Виды морского транспорта</a></p>\r\n<p><a class=\"style3\" href=\"seacontainer.html\">Морские контейнерные перевозки</a></p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость морской грузоперевозки</strong></p>\r\n<p>{mtpform}</p>', 1, 0, 0, 0, '2012-03-02 15:19:12', 62, '', '2013-11-27 18:14:00', 62, 0, '0000-00-00 00:00:00', '2012-03-02 15:19:12', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 22, 0, 55, 'Морские грузоперевозки, международная перевозка товаров, Международные морские грузоперевозки, международная морская перевозка грузов, доставка грузов морским транспортом, доставки грузов морем, перевозок грузов по морю, международные перевозки морем, транспортировка морских грузов, рынок морских грузоперевозок, перевозки грузов морскими видами транспорта, транспортировки грузов морем, контейнерные морские перевозки грузов, национальные перевозки грузов, международные речные перевозки', 'Международная транспортная компания предлагает: Морские грузоперевозки перевозка товаров международная морские грузоперевозки морем доставка грузов морским транспортом перевозки грузов по морю морем международная морская перевозка грузов морем транспортировка морских грузов рынок контейнерные морские перевозки грузов национальные перевозки грузов международные речные перевозки', 0, 10584, 'robots=\nauthor='),
(6, 'Автотранспортные  грузоперевозки, международные грузовые автоперевозки.Заказ автотранспорта.', 'avto', '', '<p>Международные авто грузоперевозки, транспорт для перевозок всех грузов.</p>\r\n', '\r\n<p align=\"justify\">Рост рейтинга России в мировом сообществе,  наблюдаемый в последние годы не может не повлиять на качество и количество  экспортно-импортных операций. Экспортные и импортные доставки грузов (поставки  товара) чаще всего осуществляются посредством <strong>международных автомобильных перевозок грузов.</strong></p>\r\n<p align=\"justify\"><br /> Одной из основных услуг нашей транспортной компании  являются <strong>международные перевозки  автотранспортом</strong>. <strong>Авто грузоперевозки</strong> являются одним из самых удобных и наиболее экономичных видов <strong>доставки международных грузов</strong>.  Преимуществами <strong>авто грузоперевозок</strong> являются сравнительно небольшие сроки доставки товара, мобильность и  маневренность автомобильного транспортного средства: международное транспортное  средство подается практически в любое удобное время, груз доставляется по  максимально удобному и кратчайшему маршруту. <strong>Международные автомобильные перевозки грузов</strong> позволяют доставить  товар из\\в зарубежные страны «под ключ», «от двери до двери<strong>»,</strong> то есть, благодаря услуге <strong>международных  автогрузовых перевозок</strong>, доставка грузов производится автотранспортом с  завода производителя транспортируемой продукции до склада покупателя. Такая  возможность доставки груза к непосредственному месту назначения не всегда  является возможной для альтернативных видов <strong>международной транспортной доставки</strong>. Преимуществом <strong>международных перевозок автотранспортом </strong>также  является возможность отслеживания местонахождения водителя – экспедитора (автоперевозчика  грузов).<br /> Рынок международных автоперевозок пестрит  предложениями о<strong> доставке грузов  автотранспортом, </strong>но прежде чем доверить свой груз <strong>компании по автотранспортным перевозкам</strong> необходимо убедиться в  качестве предоставляемых услуг. Мы занимаемся <strong>автотранспортными перевозками грузов</strong> более 12 лет. Вы можете  доверить нам Ваш груз.</p>\r\n<p align=\"justify\"><br /> Все наши  водители – экспедиторы имеют обширный опыт <strong>экспедирования  и перевозок грузов</strong>. Все <strong>автотранспортные  перевозки грузов</strong> осуществляются на высоконадежных автотранспортных  средствах таких марок как Iveco, Scania, Renault, Volvo, Man. В распоряжении компании находятся автотранспортные средства (см. виды  грузового автотранспорта) с различной грузоподъемностью и объемом  вышеперечисленных марок для международной транспортной доставки всех видов  грузов. Наши менеджеры тщательно отслеживают путь и местоположение автоперевозчика  грузов<strong> </strong>в режиме реального времени. <strong>Доставка международных грузов</strong> также  осуществляется  посредством <strong>автотранспортных</strong> <strong>грузоперевозок</strong> в составе сборных грузов (см. перевозка сборных грузов).  Тарифы на международные автомобильные перевозки зависят от характера, веса и  объема перевозимого груза, расстояния между пунктом отправки и пунктом  назначения, и др. факторов, поэтому ставка на международную автоперевозку рассчитывается  индивидуально для каждого вида перевозимого груза. Для Вашего удобства мы  создали форму расчета стоимости доставки в разделе стоимость международной  перевозки. Вам достаточно выбрать необходимые параметры в предлагаемой форме  письма и отправить нам. Наши менеджеры рассчитают стоимость перевозки и  свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtoshema.html\">Схема осуществления международных перевозок грузов автомобильным транспортом</a></p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtotransport.html\">Виды грузового автомобильного транспорта</a></p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtocontainer.html\">Автомобильные контейнерные перевозки</a></p>\r\n<p> </p>\r\n<p><strong>Заполнить заявку на перевозку автомобильным транспортом.</strong></p>\r\n<p>{mtpform}</p>', 1, 0, 0, 0, '2012-03-02 15:20:48', 62, '', '2013-09-15 13:08:41', 62, 0, '0000-00-00 00:00:00', '2012-03-02 15:20:48', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 30, 0, 54, 'международные автомобильные грузоперевозки, доставка грузов, международные автомобильные перевозки грузов, авто грузоперевозки, автогрузовые перевозки, «под ключ», «от двери до двери»  международная транспортная доставка грузов автотранспортом- международные перевозки автоперевозчик грузов, рынок международных автоперевозок, автотранспортные перевозки грузов, экспедирование и перевозки грузов, автотранспортные грузоперевозки, компания по автотранспортным перевозкам, стоимость, ставка, тариф', 'Международная транспортная компания предлагает: международные автомобильные грузоперевозки доставка грузов международные автомобильные перевозки грузов авто грузоперевозки автогрузовые перевозки «под ключ» «от двери до двери»  международная транспортная доставка грузов автотранспортом международные перевозки автоперевозчик грузов рынок международных автоперевозок грузоперевозки автотранспортные перевозки грузов экспедирование и перевозки компания по автотранспортным перевозкам стоимость ставка тариф', 0, 17281, 'robots=\nauthor='),
(7, 'Железнодорожные грузоперевозки.Ж.Д. перевозки груза грузовыми ж.д. вагонами.', 'rail', '', '<p>Перевозка грузов ж.д вагонами,железнодорожные грузоперевозки вагонами и контейнерами</p>\r\n', '\r\n<p align=\"justify\">Железнодорожная сеть охватывает огромные территории  на всех континентах. Товарные составы путешествуют из самых удаленных точек  континентов, перевозя самые различные железнодорожные грузы. Причем благодаря  услугам ОАО РЖД по международным перевозкам, товар может быть доставлен  заграницу (или из зарубежных стран в Россию) практически из любого города.</p>\r\n<p align=\"justify\"><br /> <strong>Международные железнодорожные перевозки грузов - </strong>это сложный процесс<strong>, </strong>который включает в себя<strong> </strong>бронирование  вагонов,<strong> </strong>формирование товарных  составов, транспортировку грузов железной дорогой,<strong> </strong>переформирование товарного поезда<strong> </strong>на транзитных станциях, смена колесных пар и т.п.<strong> </strong>При отсутствии необходимых навыков и  знаний по <strong>доставке груза железнодорожным  (жд) транспортом, </strong>бывают ситуации, когда<strong> транспортировка груза железной дорогой</strong> конечного пункта назначения  затруднена непредвиденными обстоятельствами или какими – либо внешними  факторами, такими как отсутствие какого- либо документа или разрешения, необходимого  оборудования для проведения погрузочно – разгрузочных работ, все эти факторы  могут повлиять на сроки доставки, поэтому при <strong>жд транспортировке грузов, </strong>необходимо обращаться к профессионалам,  таким как наша компания, которые благодаря обширному опыту<strong> международных жд грузоперевозок, </strong>могут предвидеть и предотвратить  проблемы с<strong> </strong>поставкой товара железной  дорогой.<strong> </strong>Тем более, что рынок  железнодорожных (жд) грузоперевозок пестрит предложениями от многих компаний,  занимающихся экспедированием грузов, железнодорожными перевозками в частности.  Наши клиенты неоднократно осуществляют <strong>заказ  железнодорожного (жд) контейнера</strong> или перевозки грузов поездом и работают с  нами на долгосрочной основе.</p>\r\n<p align=\"justify\"><br /> Несмотря на не самые короткие<strong> </strong>сроки доставки груза железнодорожным  (жд) транспортом, международные жд грузоперевозки пользуются огромным спросом<strong>, </strong>благодаря высокой степени  безопасности<strong> </strong>жд транспортировки  грузов и<strong> </strong>относительно низкой  стоимости перевозки. <strong>Международная  перевозка железнодорожным транспортом</strong> осуществляется при доставке больших  объемов товаров, в этом случае можно заказать целый состав.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\"><strong>Перевозка грузов поездом </strong>позволяет  перевозить самые различные виды грузов от насыпных и наливных до тяжеловесной  негабаритной техники, которая перевозится на специальных платформах, с использованием  специальных креплений, поэтому при международной перевозке жд транспортом  используются<strong> </strong>самые различные виды  вагонов, а также<strong> </strong>жд контейнеры. <strong>Международные перевозки в вагонах </strong>осуществляются  в крытых вагонах, полувагонах, на специальных платформах, вагонах – термосах, вагонах  – рефрижераторах (если речь идет о скоропортящихся грузах или грузах, требующих  соблюдения температурного режима) и т.п.  <strong>Железнодорожные контейнерные перевозки грузов </strong>осуществляется в  стандартных и специализированных жд контейнерах.</p>\r\n<p align=\"justify\"><br /> Тарифы на международные железнодорожные (жд)  перевозки зависят от характера, веса и объема перевозимого груза, расстояния  между пунктом отправки и пунктом назначения, и др. факторов, поэтому ставка на железнодорожную  (жд) перевозку рассчитывается индивидуально для каждого вида перевозимого  груза. Для Вашего удобства мы создали форму расчета стоимости в разделе стоимость  международной перевозки. Для того, чтобы <strong>заказать  железнодорожный (жд) контейнер </strong>или<strong> </strong>международную  перевозку в вагоне вам достаточно выбрать необходимые параметры в предлагаемой  форме письма и отправить нам. Наши менеджеры рассчитают стоимость перевозки и  свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p align=\"justify\"> </p>\r\n<p><a class=\"style3\" href=\"railshema.html\">Схема осуществления железнодорожной перевозки грузов</a></p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость железнодорожной перевозки.</strong></p>\r\n<p>{mtpform}</p>', 1, 0, 0, 0, '2012-03-02 15:23:05', 62, '', '2013-09-15 16:03:25', 62, 62, '2013-12-16 18:15:43', '2012-03-02 15:23:05', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 14, 0, 53, '', '', 0, 22851, 'robots=\nauthor='),
(8, 'Заявка на Международные и внутренние перевозки. Перевозка объёмных и сборных грузов от 100кг.', 'zayavka-na-perevozki-gruzov', '', '<p>Пожалуйста, заполните все поля предлагаемой формы заявки на перевозку. <strong>Наши менеджеры рассчитают стоимость перевозки</strong> и свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-05 13:40:48', 62, '', '2015-07-24 17:36:18', 62, 0, '0000-00-00 00:00:00', '2012-03-05 13:40:48', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 17, 0, 52, 'перевозки, транспорт, доставка грузов в Молдову, перевозка рефрижераторами из Греции, Турции . Сербии, Румынии . Молдовы', 'заказ перевозки груза из Европы, найти транспорт для перевозок, заказ перевозки, авто транспортные грузоперевозки из России , Казахстан, Европы в Молдову и Румынию', 0, 28750, 'robots=\nauthor='),
(9, 'Схема осуществления железнодорожной перевозки грузов, правила перевозки грузов железнодорожным транспортом,ж.д .перевозки.', 'railshema', '', '<p align=\"justify\">1. Составление заявки на международную перевозку грузов железнодорожным транспортом (например, на международную перевозку грузов в жд контейнере) продавцом или покупателем товара (в зависимости от того, является ли поставка экспортной или импортной.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">2. Подписание договора транспортной экспедиции (в данном случае, договора на осуществление перевозки контейнера жд транспортом) между заказчиком (продавцом или покупателем товара) и компании по международным железнодорожным (жд) перевозкам</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">3. Поставка товара (груза) железнодорожным (жд) транспортом часто подразумевает не только отгрузку товара на станции отправления, но и отгрузку товара на складе продавца (при отправке жд контейнеров отгрузка также производится на складе покупателя, где товар тщательно закрепляется внутри контейнера), погрузочно-разгрузочные работы с использованием специальной техники, пломбирование вагонов (пломбирование контейнеров, при перевозке грузов жд контейнерами).</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">4. Ж.Д. экспедирование включает также оформление всех необходимых документов для международной перевозки железной дорогой и информирование заказчика о местонахождении товара и завершении перевозки, оплату различных сборов, своевременное внесение провозных плат, в том числе станционных и т.п.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">5. При международной перевозке грузов железнодорожным транспортом, поставка товара (груза) железнодорожным (жд) транспортом осуществляется под присмотром проводников, сопровождающих лиц и охраны, это значительно повышает степень безопасности железнодорожной транспортировки грузов. Также, мы всегда советуем нашим клиентам застраховать свой груз от форс – мажорных обстоятельств. (страхование грузов)</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">6. При международной жд перевозке грузов также происходит раскредитовка вагонов и контейнеров (при перевозке контейнеров по железной дороге), таможенное оформление товара, доставка товара непосредственно на склад получателя.</p>\r\n<p> </p>\r\n<p><strong>Отправьте данные для заказа  международной ж.д перевозки</strong>.</p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 09:07:38', 62, '', '2013-09-15 13:00:59', 62, 0, '0000-00-00 00:00:00', '2012-03-09 09:07:38', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 51, 'Международная перевозка грузов железнодорожным транспортом, международную перевозку грузов в жд контейнере, перевозки контейнера жд транспортом, компания по международным, железнодорожным (жд) перевозкам, поставка товара (груза) железнодорожным (жд) транспортом, отправка жд контейнеров, перевозка грузов жд контейнерами, международная перевозка железной дорогой, международной жд перевозке грузов, железнодорожной транспортировки грузов, перевозке контейнеров по железной дороге', 'Международная транспортная компания предлагает: компания по международным железнодорожным (жд) перевозкам международная перевозка грузов железнодорожным жд транспортом поставка товара груза перевозка грузов в жд контейнере жд транспортом отправка жд контейнеров перевозка грузов международная перевозка железной дорогой перевозка контейнеров железнодорожная транспортировка грузов', 0, 9925, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(10, 'Схема осуществления международных перевозок грузов автомобильным транспортом,как заказать транспорт для автоперевозки', 'avtoshema', '', '<p align=\"justify\">1.Составление заявки на <strong>международную перевозку(доставку) груза</strong> продавцом или покупателем товара (в зависимости от того, является ли поставка  экспортной или импортной.</p>\r\n<div><ol>\r\n<li>2.Подписание договора транспортной  экспедиции (в данном случае, договора на осуществление международной  автоперевозки) между заказчиком (продавцом или покупателем товара) и компании  по международным перевозкам<strong> (</strong><strong>международной  автотранспортной организацией</strong>)<strong> </strong></li>\r\n<li>3.Отгрузка товара на заводе (складе) производителя  и приемка товара водителем – экспедитором данной международной авто  грузоперевозки.<strong> </strong></li>\r\n<li>4.Водитель (международный автоперевозчик грузов) отправляется  в путь с комплектом следующих документов:<strong> </strong></li>\r\n</ol></div>\r\n<p align=\"justify\">1)Товарно-транспортная накладная  (накладная CMR) <br /> (с фр. Convention relative an contract de transport internatioal de mercandises  par route) <br /> При приеме груза водитель – экспедитор  проверяет правильность заполнения всех документов, сопровождающих <strong>международные авто грузоперевозки</strong>. В  накладной CMR должно быть указано конкретное место доставки груза (название  таможенного поста, название таможенного склада (ТС) или склада временного  хранения (СВХ), его полный адрес, N лицензии и дата ее выдачи).<br /> 2) Отгрузочная спецификация на товар<br /> 3) Упаковочный лист<br /> 4) Счет-фактура контрактной стоимости товара<br /> 5) Сертификаты качества и происхождения,  в случае необходимости карантинный и ветеринарный сертификаты<br /> 6) Книжка МДП (Carnet TIR). <br /> При прохождении пограничных таможенных  постов при водитель – экспедитор проверяет наличие всех печатей и штампов на корешке  МДП (Carnet TIR) при  осуществлении международных перевозок.<br /> TIR (книжка МДП) (фр. Transports International  Routiers, «Международные дорожные перевозки»)  — это таможенный грузопроводительный  документ, дающий право перевозить грузы через границы государств в  опломбированных таможней кузовах автомобилей или контейнерах с упрощением таможенных процедур.<br /> 7)  Копия страхового полиса<br /> Практика <strong>экспедирования автомобильных грузов</strong> при экспортно - импортных  поставках товара показывает, что <strong>международные  дорожные перевозки</strong> – это довольно безопасный способ экспортно-импортной  поставки товара, но мы советуем нашим клиентам все же застраховать свой груз от  непредвиденных обстоятельств в пути.</p>\r\n<p align=\"justify\">По прибытии в таможню назначения  водитель – экспедитор помещает транспортное средство в зону таможенного  контроля на таможенном складе или складе временного хранения СВХ, вручает  документы таможенному органу и получает письменное Подтверждение о принятии  документов и въезде машины на территорию склада и ожидает окончания таможенного  оформления груза, чтобы доставить товар непосредственно на склад покупателя,  либо выгружает груз на СВХ, в зависимости от договоренности.</p>\r\n<p align=\"justify\"><strong> </strong></p>\r\n<p align=\"justify\">При экспедировании автомобильных  грузов международный автоперевозчик<strong> </strong>должен  иметь следующие документы:<strong> </strong></p>\r\n<p align=\"justify\"><br /> 1.	Документы на автомобиль.<br /> - Свидетельство о регистрации транспортного средства в ГАИ.<br /> - Свидетельство о пригодности автотранспортного средства к перевозке международных грузов под таможенными печатями и пломбами.<br /> - Сертификат о прохождении автомобилем техосмотра.<br /> - Документы о страховании гражданской ответственности владельца автотранспортного средства. <br /> - Разрешение на выполнение автомобильной перевозки по иностранной территории. <br /> - Свидетельство о допущении автотранспортного средства к перевозкам скоропортящихся продуктов или опасных грузов (только при перевозке этих грузов). <br /> - Защитный комплект спец. одежды и принадлежностей (только при перевозке опасных грузов).<br /> - Лицензионная карточка. <br /> - Путевой лист. <br /> 2. Документы водителя <br /> - Заграничный паспорт. <br /> - Водительское удостоверение международного образца. <br /> - Медицинский страховой полис водителя транспортного средства.<br /> - Свидетельство ДОПОГ о допуске водителя к перевозке опасных грузов (только при перевозке опасных грузов).</p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtotransport.html\">Виды грузового автомобильного транспорта</a></p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtocontainer.html\">Автомобильные контейнерные перевозки</a></p>\r\n<p> </p>\r\n<p><strong>Отправить заказ на перевозку груза автотранспортом, грузовиками разной грузоподъёмностью</strong></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 09:23:39', 62, '', '2013-09-15 12:55:10', 62, 0, '0000-00-00 00:00:00', '2012-03-09 09:23:39', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 50, 'Международные авто грузоперевозки, международные перевозки грузов автомобильным транспортом, международный автоперевозчик грузов, международная автотранспортная организация, экспедирование автомобильных грузов, международные дорожные перевозки, международные перевозки tir, договор международные автоперевозки, компании по международным перевозкам, международные перевозки доставка грузов, экспортная поставка товара, импортная поставка товара', 'Международная транспортная компания предлагает: авто грузоперевозки международные перевозки грузов автомобильным транспортом автоперевозчик грузов международная автотранспортная организация экспедирование автомобильных грузов дорожные перевозки международные перевозки tir договор автоперевозки компании по международным перевозкам доставка грузов экспортная поставка товара импортная', 0, 6796, 'robots=\nauthor='),
(11, 'Виды грузового автотранспорта', 'avtotransport', '', '<p align=\"justify\">Организация международных  автомобильных грузовых перевозок –<strong> </strong>это  довольно сложный процесс<strong> международной  доставки товара </strong>в котором участвуют<strong> международная автотранспортная организация, </strong>осуществляющая<strong> экспортные и импортные грузоперевозки, </strong>заказчик  перевозки груза, получатель или отправитель товара, различные таможенные  структуры ( на границах транзитных государств, таможенные посты на территории  РФ) и т.д.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\"><strong> </strong>Для осуществления <strong>международных  автотранспортных перевозок грузов</strong> необходимо наличие надежного  транспортного средства и опытного водителя с полным перечнем необходимых  документов и лицензий. Рынок международных автоперевозок  делится на компании, осуществляющие автотранспортные  перевозки <strong>(международные логистические  компании)</strong> с собственным автопарком и компании – экспедиторы, которые ведут  посредническую деятельность, поэтому рынок международных автоперевозок является  довольно сложным и объемным.</p>\r\n<p align=\"justify\"><br /> Для осуществления экспортных или импортных грузоперевозок  в зависимости от типа, веса и объема перевозимого товара используются тенты,  рефрижераторы, изотермы</p>\r\n<p align=\"justify\"><br /> При <strong>транспортировки и экспедировании автоперевозок </strong>наибольшей  популярностью пользуются евротенты (еврофуры) объемом <span style=\"font-family: verdana,geneva;\">82 м3 ( длина 13.6 х  ширина 2.45 х высота 2.45, грузоподъемность 20-22 тонны). </span>Тент (еврофура) - это  полуприцеп с возможностью боковой или верхней загрузки, так как тент убирается  сбоку или сверху или убирается совсем для перевозки груза на открытой площадке  с высотой бортов до 50 см. Выполняя <strong>международные  автоперевозки грузов</strong> мы используем не только тентованные, но и  цельнометаллические автомобили.</p>\r\n<p align=\"justify\"><br /> Существует большое количество модификаций грузовых автомобилей используемых для <strong>международных автотранспортных перевозок грузов. </strong>Рефрижераторы, изотермы - термофургоны.<strong> </strong>Все они имеют различные функции,  например рефрижератор (рефрижераторный полуприцеп) поддерживает температуру от  -12 до +10 , что обеспечивается автономной холодильной установкой, и  используется для перевозки скоропортящихся продуктов или товаров, требующих  сохранения особого температурного режима. Изотермы (изотермический полуприцеп) с  грузовым отсеком типа термофургон – это полуприцеп типа «термоса». Они  предназначены для сохранения температуры загрузки товара в течении длительного  времени (до 20 часов) или с системой подогрева отсека, что позволяет сохранить  заданную температуру в течение длительного периода.</p>\r\n<p align=\"justify\"><br /> Наиболее популярными размерами  полуприцепов при осуществлении международной доставки товара, как уже  отмечалось выше является размер <span style=\"font-family: verdana,geneva;\">82 м3 ( длина  13.6 х ширина 2.45 х высота 2.45, грузоподъемность 20-22 тонны)</span> это касается и  тентов и рефрижераторов и изотермов. Но есть и альтернативные размеры:  полуприцеп объемом 76-68 м3 имеет длину 12.5 – 13м. Для организации международных автомобильных грузовых  перевозок используются полуприцепы и с большей длиной <span style=\"font-family: verdana,geneva;\">(13.6м) и высотой (2.7м)  и шириной (2.5м).</span> Международные логистические компании осуществляют свой выбор  в зависимости от типа товара, количества загружаемых паллет, необходимости соблюдения  температурного режима и т.п.</p>\r\n<p align=\"justify\"><strong>Для осуществления международных  автоперевозок грузов</strong> в нашем распоряжении находятся следующие виды грузового  автотранспорта: автопоезда<span style=\"font-family: verdana,geneva;\"> 86 м3, 96 м3 и 100 м3 (jumbo),  110 м3, 120 м3</span>, тяжеловозы, низкорамные прицепы и полуприцепы для перевозки  негабаритных грузов, автоцистерны для перевозки насыпных и наливных грузов (см.  перевозка негабарита), контейнеровозы (см. автомобильные контейнерные перевозки).  Как уже отмечалось ранее, мы используем надежный грузовой автотранспорт  следующих марок: Iveco, Scania,  Renault, Volvo, Man,  поэтому при <strong>экспедировании автоперевозок</strong> мы всегда уверены в сохранности перевозимых грузов.</p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtoshema.html\">Схема осуществления международных перевозок грузов автомобильным транспортом</a></p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtocontainer.html\">Автомобильные контейнерные перевозки</a></p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 09:28:29', 62, '', '2013-07-31 08:53:12', 62, 0, '0000-00-00 00:00:00', '2012-03-09 09:28:29', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 49, 'международные автотранспортные перевозки грузов, рынок международных автоперевозок, компании автотранспортные перевозки, организация международных автомобильных грузовых перевозок, международные логистические компании, международная автотранспортная организация, международной доставки товара, экспортные грузоперевозки, импортные грузоперевозки, международные автоперевозки грузов, виды грузового автотранспорта, экспедирование автоперевозок, тенты (еврофуры), рефрижераторы, изотермы, автопоезда', 'Международная транспортная компания предлагает: международные автотранспортные перевозки грузов организация международных автомобильных грузовых перевозок  автотранспортная организация международные логистические компании автотранспортные перевозки международная доставка товара экспортные грузоперевозки импортные экспедирование автоперевозки грузов рынок международных автоперевозок тенты (еврофуры) рефрижераторы изотермы автопоезда', 0, 5600, 'robots=\nauthor='),
(12, 'Автомобильные контейнерные перевозки', 'avtocontainer', '', '<p align=\"justify\"><strong>Автомобильные  контейнерные перевозки</strong> осуществляются с  помощью <strong>автомобильных контейнеровозов</strong>,  при этом услуги контейнеровоза при перевозке на большие расстояния являются  немного менее экономичными, чем при <strong>доставке  контейнеров морем или жд транспортом. </strong>Но основным преимуществом<strong> </strong>авто контейнерных перевозок<strong> </strong>является скорость доставки товара до  пункта разгрузки, при этом перевозки контейнеровозом не зависят от расписания  движения поездов или следования судов. Поэтому автомобильные контейнеровозы<strong> </strong>чаще всего используются при <strong>мультимодальных (комбинированных)  перевозках грузов</strong> (подробнее см. мультимодальные перевозки). Например,  контейнер с грузом отгружается в порту А. на речной или океанский контейнеровоз  (судно), прибывает в порт назначения Б. и перегружается на <strong>контейнеровоз автомобиль. </strong>Далее осуществляется перевозка груза <strong>контейнеровозом автомобилем </strong>непосредственно  до пункта назначения (от двери до двери). <strong>Авто  контейнерные перевозки</strong> зачастую являются единственным возможным способом  доставки товара в случае отсутствия вблизи от пункта назначения морских портов  (где располагаются контейнерные площадки, терминалы), речных путей или  железнодорожных путей, то есть при отсутствии возможности <strong>доставки контейнеров морем или жд транспортом</strong>.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">В распоряжении нашей  компании достаточно большой <strong>парк  контейнеровозов, </strong>который включает в себя низкорамные контейнеровозы (прицепы  контейнеровозы) для перевозки <strong>20-40  футовых контейнеров (20-40 футовые контейнеровозы) . </strong>При перевозки особых  грузов существуют специальные контейнеры, оснащенные например холодильным  оборудованием, специальными маркировками для хрупкого товара, дополнительными  креплениями и т.п. Все водители – экспедиторы контейнеровозов имеют большой  опыт вождения и все необходимые документы для осуществления международной  перевозки контейнерных грузов. Стоимость (тарифы) контейнерных перевозок  автомобильным транспортом рассчитывается индивидуально для каждого вида  груза,  так как ставка зависит от  множества факторов, таких как наименование перевозимого товара, место загрузки,  пункт назначения и т.п. (см. стоимость международной перевозки). <strong>Перевозка контейнеров автомобильным  транспортом </strong>гарантирует высокую степень сохранности груза, во – первых,  благодаря прочности материалов, из которых изготовлен контейнер, его достаточно  сложно вскрыть, во-вторых, транспортные средства, предназначенные для <strong>международной транспортировки грузов, </strong>обычно  пломбируются на границе. Кроме того, мы всегда рекомендуем нашим клиентам  застраховать свой груз от форс-мажорных обстоятельств, и предлагаем услугу страхования  международных грузов в комплексе (см. страхование международных грузов) <strong> </strong></p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtoshema.html\">Схема осуществления международных перевозок грузов автомобильным транспортом</a></p>\r\n<p> </p>\r\n<p><a class=\"style3\" href=\"avtotransport.html\">Виды грузового автомобильного транспорта</a></p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 09:31:43', 62, '', '2013-09-15 12:33:43', 62, 0, '0000-00-00 00:00:00', '2012-03-09 09:31:43', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 48, 'Автомобильные контейнерные перевозки, автомобильные контейнеровозы, услуги контейнеровоза, доставка контейнеров морем, доставка контейнеров жд транспортом, речной контейнеровоз, океанский контейнеровоз, контейнеровоз судно, контейнеровоз автомобиль, перевозка контейнеровозом, авто контейнерные перевозки, парк контейнеровозов, низкорамные контейнеровозы, прицепы контейнеровозы, 20-40 футовые контейнеровозы, контейнерные перевозки автомобильным транспортом, стоимость, тарифы, перевозка контейнеров автомобильным транспортом, международная транспортировка грузов', 'Международная транспортная компания предлагает: контейнеровозы автомобильные контейнерные перевозки доставка контейнеров морем жд транспортом речной контейнеровоз океанский услуги контейнеровоз судно перевозка контейнеровозом автомобиль авто автомобильным транспортом контейнерные перевозки парк контейнеровозов низкорамные прицепы контейнеровозы 20-40 футовые стоимость тарифы перевозка контейнеров автомобильным транспортом международная транспортировка грузов', 0, 8615, 'robots=\nauthor='),
(13, 'Контейнерные морские перевозки', 'seacontainer', '', '<p align=\"justify\"><strong>Мировые контейнерные перевозки </strong>обеспечивают постоянный поток  транспортировки контейнеров с грузами на межконтинентальные расстояния через  океаны (атлантические, тихоокеанские и другие перевозки). Океанские перевозки  контейнеров широко используются там, где единственно возможным способом  доставки товаров является <strong>перевозка  грузов</strong> <strong>водными видами транспорта. </strong>Специализированные  суда (корабли)<strong> – морские контейнеровозы </strong>предназначены  для единовременной перевозки большого количества<strong> </strong>контейнеров, что нельзя сравнить с возможностями автодорожных  перевозок.<strong> Корабль – контейнеровоз </strong>отправляется  исключительно по расписанию и прибывает по расписанию, за исключением случаев  форс-мажорных обстоятельств (например, плохие погодные условия).</p>\r\n<p align=\"justify\"><br /> Преимуществами контейнерных перевозок являются относительно низкая стоимость, сохранность  груза при перевозке, отлаженная система <strong>мировых  контейнерных перевозок</strong>. Благодаря постоянному потоку <strong>контейнерных перевозок товаров </strong>наблюдается устойчивый рост<strong> </strong>рынка  контейнерных перевозок.<strong> </strong>Цены на  контейнерные перевозки сильно варьируются и решающим фактором при выборе  организации по контейнерным перевозкам становятся качество обслуживания, грамотное  документальное сопровождение, опыт решения нестандартных ситуаций и т.д. Вы  можете спокойно доверить ваш груз нашей компании, обратившись к нам, Вы  получите надежную качественную перевозку Вашего товара и сервис высокого  уровня, так как мы профессионалы своего дела с многолетним опытом <strong>экспедирования контейнеров и  транспортировки морских грузов, </strong>так же как и других видов транспортной  логистики.</p>\r\n<p align=\"justify\"><br /> Тарифы на международные контейнерные перевозки (морской  фрахт) зависят от характера, веса и объема перевозимого груза, расстояния между  пунктом отправки и пунктом назначения, и др. факторов, поэтому ставка на контейнерную  перевозку рассчитывается индивидуально для каждого вида перевозимого груза. Для  Вашего удобства мы создали форму расчета стоимости в разделе стоимость  международной перевозки. Вам достаточно выбрать необходимые параметры в  предлагаемой форме письма и отправить нам. Наши менеджеры рассчитают стоимость  перевозки и свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 09:40:45', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-03-09 09:40:45', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 47, 'Морские грузоперевозки, международная перевозка товаров, Международные морские грузоперевозки, международная морская перевозка грузов, доставка грузов морским транспортом, доставки грузов морем, перевозок грузов по морю, международные перевозки морем, транспортировка морских грузов, рынок морских грузоперевозок, перевозки грузов морскими видами транспорта, транспортировки грузов морем, контейнерные морские перевозки грузов, национальные перевозки грузов, международные речные перевозки', 'Международная транспортная компания предлагает: Морские грузоперевозки перевозка товаров международная морские грузоперевозки морем доставка грузов морским транспортом перевозки грузов по морю морем международная морская перевозка грузов морем транспортировка морских грузов рынок контейнерные морские перевозки грузов национальные перевозки грузов международные речные перевозки', 0, 914, 'robots=\nauthor='),
(14, 'Навалочные (насыпные) и наливные перевозки грузов морем', 'cargonavalochniebysea', '', '<p align=\"justify\">Навалочные, насыпные грузы – это грузы, которые размещаются в  кузове автомобиля, в специальном контейнере или на борту судна без  специализированной упаковки, и характеризуются своей сыпучестью. При погрузке навалочных  (насыпных) грузов на транспортное средство не требуется специальных креплений.  Если рассматривать <strong>перевозку навалочных  насыпных грузов морем</strong>, для их перевозки используются специализированные  суда – балкеры, которые имеют большие <strong>трюмы.  Наливные грузы</strong> имеют жидкую форму, поэтому <strong>доставка наливных грузов</strong> производится в железнодорожных  (автомобильных) цистернах, в случае перевозки наливных грузов морем – <strong>транспортировка наливных грузов </strong>производится  на специализированных наливных судах – танкерах.<br /> (Подробнее см.<a class=\"style3\" href=\"cargo_gabarit.html\"> виды грузов</a>)</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 09:43:56', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-03-09 09:43:56', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 46, 'Навалочные (насыпные) грузы морем, перевозка навалочных насыпных грузов, доставка наливных грузов, перевозка наливных грузов, наливные грузы морем', 'Международная транспортная компания предлагает: навалочные (насыпные) грузы морем, перевозка навалочных насыпных грузов, доставка наливных грузов, перевозка наливных грузов, наливные грузы морем', 0, 8674, 'robots=\nauthor='),
(15, 'Виды грузов: Перевозки габаритных грузов', 'cargogabarit', '', '<p align=\"justify\">В зависимости от вида груза и типа грузового транспорта перевозки подразделяются на: <br /> <a class=\"style3\" href=\"cargo_gabarit.html\">перевозки габаритных грузов</a>, <br /> <a class=\"style3\" href=\"cargo_negabarit.html\">перевозки негабаритных и тяжеловесных грузов</a>, <br /> <a class=\"style3\" href=\"cargo_nalivnie.html\">перевозки наливных и насыпных грузов</a>, <br /> <a class=\"style3\" href=\"cargo_refrigerator.html\">перевозки рефрижераторных грузов</a> и др. <br /> Наша компания занимается международными перевозками и перевозками по России практически всех видов грузов, поэтому среди наших постоянных клиентов находятся крупные компании и холдинги самых разных направлений.</p>\r\n<p align=\"justify\"><br /> <strong>Доставка габаритных грузов из России</strong> – это перевозка товарно-штучных грузов с использованием стандартных видов транспорта. <strong>Перевозка габаритных грузов из России в страны СНГ, Европу, Румынию, Молдову, Турцию </strong>осуществляется с помощью практически любого вида транспорта: это может быть стандартная фура, стандартный контейнер для перевозки автомобилем или морем, доставка габарита осуществляется с помощью авиа и жд перевозок, авто и в составе сборных грузов. Таким образом, международная перевозка габаритных грузов, также как и перевозка габаритных грузов по России не вызывает никаких проблем. К грузоперевозкам габарита относятся различные российские и международные перевозки пищевых и непищевых грузов (контейнерные, автомобильные, морские, авиа, жд перевозки габарита) мебели, техники, продуктов питания, оборудования (медицинского, полиграфического, торгового и т.п.), запасных частей, одежды, медикаментов, бытовой химии и т.д. Также мы занимаемся перевозками особенных грузов, требующих специальной дополнительной упаковки (для перевозки стекла, тары, хрусталя), специальных условий (для перевозки животных, птиц, рогатого скота). Сложно представить весь перечень товаров, с которыми наши менеджеры имели дело, несмотря на то, что стандартность перевозки,  независимо от вида груза мы внимательно следим за тем, чтобы товары были тщательно упакованы, закреплены и промаркированы.</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 10:23:07', 62, '', '2013-07-31 08:57:47', 62, 0, '0000-00-00 00:00:00', '2012-03-09 10:23:07', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 4, 0, 45, 'Перевозки габаритных грузов, доставка габаритных грузов, грузоперевозка габарита, международная перевозка габаритных грузов, перевозка габаритных грузов по России, перевозка оборудованияконтейнерные перевозки габарита, авиаперевозка габарита, жд перевозка габарита, автомобильные перевозки габарита, морские перевозки габарита, контейнерные перевозки габаритаперевозка пищевых и непищевых грузов, российские и международные перевозки (контейнерные, автомобильные, морские, авиа, жд перевозки габарита) мебели, техники, продуктов питания, оборудования (медицинского, полиграфического, торгового и т.п.), запасных частей, одежды, медикаментов, бытовой химии', 'Международная транспортная компания предлагает: перевозки габаритных грузов доставка грузоперевозка габарита международная перевозка габаритных грузов по России контейнерные перевозки габарита авиаперевозка жд автомобильные перевозки габарита морская перевозка пищевых и непищевых грузов контейнерные автомобильные морские авиа жд перевозки габарита мебели техники продуктов питания оборудования запасных частей одежды медикаментов бытовой химии', 0, 12188, 'robots=\nauthor='),
(16, 'Перевозки негабаритных и тяжеловесных грузов', 'cargonegabarit', '', '<p align=\"justify\"><strong>Транспорт для перевозки негабаритных, тяжеловесных (крупногабаритных) грузов</strong> используется специальный: при автомобильной перевозке негабаритного груза используются фуры с большим объемом, специальные автомобильные платформы. При железнодорожных (жд) перевозках негабаритных (тяжеловесных) грузов доставка крупногабаритного груза осуществляется в специальных контейнерах и в открытых вагонах. Морская перевозка негабаритных (тяжеловесных) грузов подразумевает доставку негабаритных грузов в специальных морских контейнерах или грузятся прямо в судно (на корабль).</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\"><strong>Перевозка грузов негабаритных размеров из и в Россию,</strong> это сложный процесс перемещения груза, где особое внимание уделяется методам крепления груза на транспортное средство, не зависимо от того, является ли перевозка негабаритных грузов международной или осуществляется по России. Мы занимаемся международными грузоперевозками негабарита (контейнерные, автомобильные, морские, авиа, жд перевозки негабаритных грузов) - это перевозки леса (лесоматериалов), строительных материалов, стальных профилей, труб, спецтехники, крупногабаритных промышленных и сельскохозяйственных материалов, дорожно-строительной и сельскохозяйственной техники, различных крупногабаритных установок, например буровых, заводских линий. Для перевозки машин, автомобилей, мы используем специальную технику с усиленными креплениями и увеличенной степенью защиты. Сложно представить весь перечень товаров, с которыми наши менеджеры имели дело, Мы относимся к каждой перевозке с огромной ответственностью и  независимо от вида груза мы внимательно следим за тем, чтобы грузы были тщательно упакованы в случае необходимости, закреплены и промаркированы.Негабаритные перевозки из России или в Россию из стран Европы, Украины, <strong>перевозки негабаритного груза из России в Молдову, Румынию, и другие страны можно заказать прямо на сайте</strong>.</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 10:55:00', 62, '', '2013-07-14 17:52:56', 62, 0, '0000-00-00 00:00:00', '2012-03-09 10:55:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 44, 'Перевозки негабаритных и тяжеловесных грузов, транспорт для перевозки негабаритных, тяжеловесных (крупногабаритных) грузов, автомобильной перевозке негабаритного груза, железнодорожных (жд) перевозках негабаритных грузов, доставка крупногабаритного груза, морская перевозка негабаритных (тяжеловесных) грузов, доставку негабаритных грузов, перевозка грузов – негабарита, перевозка негабаритных грузов международной, контейнерные перевозки негабарита (негабаритных грузов), авиаперевозка негабарита, жд перевозка негабарита, автомобильные перевозки негабарита, морские перевозки негабарита, к грузоперевозкам негабарита относятся различные российские и международные перевозки (контейнерные, автомобильные, морские, авиа, жд перевозки негабаритных грузов) леса (лесоматериалов), строительных материалов, стальных профилей, труб, спецтехники, крупногабаритных промышленных и сельскохозяйственных материалов, различных крупногабаритных установок, например, буровых', 'Международная транспортная компания предлагает: перевозки негабаритных тяжеловесных грузов крупногабаритных транспорт автомобильная перевозка негабаритного груза железнодорожные (жд) перевозки доставка крупногабаритного груза морская перевозка негабарита негабаритных грузов международные контейнер