(17, 'Перевозки наливных и насыпных грузов', 'cargonalivnie', '', '<p align=\"justify\">Перевозки наливных и насыпных грузов  пищевых и непищевых грузов автотранспортом жд перевозка наливных грузов морские перевозки российские и международные перевозки контейнерные автомобильные морские авиа жд перевозки насыпных и наливных грузов пищевых продуктов: масел соков вин зерна непищевых товаров сыпучих грузов угля железной руды</p>\r\n<p align=\"justify\"><br /> Навалочные, насыпные грузы – это грузы, которые размещаются в кузове автомобиля, в специальном контейнере или на борту судна без специализированной упаковки, и характеризуются своей сыпучестью. При погрузке навалочных (насыпных) грузов на транспортное средство не требуется специальных креплений. Перевозки наливных грузов (пищевых и непищевых) международные и по России чаще всего осуществляются по следующим схемам: перевозка наливных грузов автотранспортом и жд перевозка наливных грузов в специальных цистернах, морские перевозки наливных грузов – в специальных танкерах. Перевозки насыпных, навалочных грузов международные и по России чаще всего осуществляются в контейнерах при авто (автомобильных) и жд (железнодорожных) перевозках насыпных грузов и в трюмах кораблей навалом, россыпью. Мы занимаемся российскими и международными перевозкам насыпных и наливных грузов (контейнерные, автомобильные, морские, авиа, жд перевозки насыпных и наливных грузов) перевозки пищевых продуктов: масел, соков, вин, зерна и т.п., непищевых товаров, сыпучих грузов: угля, железной руды и др. Сложно представить весь перечень товаров, с которыми наши менеджеры имели дело, мы относимся к каждой перевозке с огромной ответственностью и доставляем его нашим клиентам в сохранности и точно в срок.</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 11:00:01', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-03-09 11:00:01', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 43, 'Перевозки наливных и насыпных грузов, перевозка наливных пищевых и непищевых грузов, перевозка наливных грузов автотранспортом, жд перевозка наливных грузов, морские перевозки наливных грузов, российские и международные перевозки контейнерные, автомобильные, морские, авиа, жд перевозки насыпных и наливных грузов пищевых продуктов: масел, соков, вин, зерна и т.п., непищевых товаров, сыпучих грузов: угля, железной руды', 'Международная транспортная компания предлагает: Перевозки наливных и насыпных грузов  пищевых и непищевых грузов автотранспортом жд перевозка наливных грузов морские перевозки российские и международные перевозки контейнерные автомобильные морские авиа жд перевозки насыпных и наливных грузов пищевых продуктов: масел соков вин зерна непищевых товаров сыпучих грузов угля железной руды', 0, 15219, 'robots=\nauthor='),
(18, 'Перевозки рефрижераторных грузов', 'cargorefrigerator', '', '<p align=\"justify\">Мы занимаемся российскими и международными рефрижераторными перевозками (контейнерные, автомобильные, морские, авиа, жд перевозки рефрижераторных грузов) продуктов питания: мяса, птицы, морепродуктов, молочной продукции, овощей и фруктов и т.д. Наши направления перевозки грузов рефрижераторами: все города России. <strong>Перевозки рефрижераторных грузов из Турции , Греции , Молдовы в Россию всех типов грузов с соблюдением температурного режима.</strong> Перевозки медикаментов из России или в Россию , с температурным режимом рефрижераторами разных объёмов.<br /> Рефрижераторные грузы – это товары, требующие соблюдения специального температурного режима, для их перевозки при автоперевозке рефрижераторных грузов товары перевозятся в специальных фурах, которые называются рефрижераторами, при жд перевозке – в термовагонах – рефрижераторах, международные перевозки рефрижераторных грузов чаще всего осуществляются морем в специальных контейнерах. Сложно представить весь перечень товаров, с которыми наши менеджеры имели дело, мы относимся к каждой перевозке с огромной ответственностью и доставляем его нашим клиентам в сохранности и точно в срок. <strong>Грузоперевозку рефрижераторами в Россию из Сербии, Болгарии, Румынии, можно заказать через заявку на сайте.</strong></p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 11:02:51', 62, '', '2013-07-14 17:59:31', 62, 0, '0000-00-00 00:00:00', '2012-03-09 11:02:51', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 42, 'Перевозки рефрижераторных грузов, рефрижераторные грузы, автоперевозке рефрижераторных грузов, жд рефрижераторные грузы, международные перевозки рефрижераторных грузов, международными рефрижераторными перевозками', 'Международная транспортная компания предлагает: перевозки рефрижераторных грузов автоперевозка рефрижераторных грузов жд международные перевозки рефрижераторных грузов (контейнерные, автомобильные, морские, авиа, жд перевозки рефрижераторных грузов) продуктов питания: мяса, птицы, морепродуктов, молочной продукции, овощей и фруктов', 0, 8352, 'robots=\nauthor='),
(19, 'Ролкерные перевозки (система Ро-ро)', 'cargororobysea', '', '<p align=\"justify\">Ролкерные (накатные, система Ро-ро)  перевозки осуществляются на судах с помощью горизонтальной погрузкой \\ выгрузкой, при  этом груз загружается своим ходом (при перевозке самоходной техники: трактора,  комбайны,  грузовые автомобили и т.д.)  либо методом «наката», с помощью автопогрузчика (тяжеловесные грузы, негабарит).  (подробнее см. <a class=\"style3\" href=\"cargo_gabarit.html\">виды грузов</a>)</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 11:08:54', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-03-09 11:08:54', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 41, 'Перевозки ро-ро, ролкерные перевозки, накатные перевозки', 'Международная транспортная компания предлагает: перевозки ро-ро, ролкерные перевозки, накатные перевозки', 0, 11452, 'robots=\nauthor='),
(20, 'Схема осуществления международной морской перевозки на примере контейнерной перевозки, как заказать морскую перевозку', 'seashema', '', '<p align=\"justify\">1.	Составление заявки на <strong>транспортировку  груза морским видом транспорта </strong>(например, на<strong> международную перевозку грузов в контейнере)</strong> продавцом или  покупателем товара (в зависимости от того, является ли поставка экспортной или  импортной.<strong> </strong></p>\r\n<div><ol>\r\n<li>2. Подписание договора транспортной  экспедиции (в данном случае, договора на осуществление международной контейнерной  перевозки) между заказчиком (продавцом или покупателем товара) и <strong>компании по международным морским перевозкам  (</strong><strong>службы контейнерной перевозки</strong>)<strong> </strong></li>\r\n<li>3.<strong> Компания – экспедитор морских  грузов </strong>может забрать груз и со склада производителя, но  чаще всего<strong> </strong>международные договора на  поставку товара морем из зарубежных стран заключаются на условиях инкотермс (Incoterms), которые обеспечивают отгрузку товара в порту страны отправления,  такие как СИФ, ФОБ, ФАС, КАФ и т.д. Рассмотрим один из них:<strong> </strong></li>\r\n</ol></div>\r\n<p align=\"justify\">ФОБ  (free on board - свободно на борту) - порт выгрузки.<br /> Основные обязанности продавца:<br /> - доставить за свой счёт товар в порт выгрузки и известить об этом покупателя;<br /> - погрузить за свой счёт товар на борт судна;<br /> - передать покупателю \"чистый\" коносамент или иной документ, о  котором договорятся стороны;<br /> - нести все риски, которым может подвергнуться товар, до момента пересечения им  борта судна;<br /> Основные обязанности покупателя:<br /> - за свой счёт зафрахтовать судно или обеспечить на судне место для перевозки  товара;<br /> - заблаговременно известить продавца о сроке прибытия судна в порт выгрузки;<br /> - оплатить товар против коносамента, счёта-фактуры и других предусмотренных  документов;<br /> - нести все риски, которым может подвергнуться товар, с момента пересечения им  борта судна.</p>\r\n<div><ol>\r\n<li>4. Товар помещен на  судно, в случае международной перевозки грузов в  контейнере, грузоперевозки осуществляются на контейнеровозах, контейнеры  загружаются в соответствии с правилами службы контейнерных перевозок. </li>\r\n<li>5. Транспортные  документы, используемые при морской перевозке грузов.<br /> Коносамент, штурманская расписка, таймшит, морская накладная, коммерческий акт,  гарантийное письмо, подтверждение на фрахтование тоннажа, фрахт (плата за  провоз), фрахтовый счет, грузовой манифест, контейнерный манифест или  упаковочный лист грузовых единиц.</li>\r\n<li>6. По прибытию в порт  назначения контейнер перегружается на железнодорожный транспорт или на  автомобиль и доставляется на таможенный пост, указанный в документах, где товар  помещается в зону таможенного контроля на  таможенном складе или складе временного хранения СВХ, уполномоченное лицо,  сопровождающее товар, вручает документы таможенному органу и получает  письменное Подтверждение о принятии документов и ожидает окончания таможенного  оформления груза, чтобы доставить товар непосредственно на склад покупателя,  либо выгружает груз на СВХ, в зависимости от договоренности. </li>\r\n</ol></div>\r\n<p align=\"justify\">Вышеприведенная  информация об осуществлении международных контейнерных морских перевозок довольно  схематична и проста на первый взгляд, но в реальном времени<strong> контейнерные перевозки морем </strong>– это сложный процесс, который  включает в себя комплексную работу, экспедиторов, судовой команды, портовых  работников, таможенных органов и т.д. и для корректной транспортировки грузов  из зарубежных стран, для минимизации проблем, связанных с этим сложным  процессом, существуют экспедиторские компании, такие как наша, мы доставим Ваш  груз без проблем и точно в срок.</p>\r\n<p> </p>\r\n<p><strong>Заказать морскую и контейнерную грузоперевозку </strong></p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 11:30:55', 62, '', '2013-09-15 12:41:49', 62, 0, '0000-00-00 00:00:00', '2012-03-09 11:30:55', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 40, 'морские перевозки, контейнерная морская перевозка из Китая. Арабских эмират, морские перевозки из Турции, Украины, доставка контейнера из порта, контейнеровозы.', 'Международная транспортная компания предлагает: транспортировка груза водными видами транспорта международная перевозка грузов в контейнере службы контейнерной перевозки компании по международным морским перевозкам экспедитор морская перевозка грузов грузоперевозки контейнеровоз перевозка', 0, 4596, 'robots=\nauthor='),
(21, 'Виды морского транспорта', 'seatransport', '', '<p align=\"justify\"><strong>При перевозке грузов морем </strong>используются различные морские суда  (корабли) и контейнеры, что зависит от типа грузов перевозимых морским  транспортом.<strong> </strong>Таким образом, для  перевозки насыпных (навалочных) грузов используются балкеры, сухогрузы, для  перевозки наливных грузов – танкеры, газовозы используются для перевозки  сжиженного газа, если груз зависит от температурного режима, существуют  рефрижераторные суда.<strong> </strong>Наиболее  популярным видом судна является <strong>морской  контейнеровоз. Преимуществами контейнерных перевозок </strong>являются относительная  низкая стоимость<strong> перевозки морских  контейнеров, </strong>возможность загрузки в контейнер практически любых видов  товара (от бижутерии до автомобилей), автоматизация <strong>транспортировки морских контейнеров </strong>и т.д.<br /> Контейнеровозы  – это грузовые судна (корабли), с возможностью перевозки большого количества морских  контейнеров (от нескольких сотен до нескольких тысяч одновременно) Морские  контейнеровозы предельно автоматизированы и изначально осуществляют проверку на  совместимость контейнеров с конструкцией судна,   на совместимость содержимого контейнеров между собой и т.п. <br /> Перевозка  грузов морем осуществляется на контейнерах, которые подразделяются на следующие  виды:<br /> <br /></p>\r\n<ul type=\"disc\">\r\n<li>ST (Standart),       GP (General Purpose) и DV (Dry Van) — это стандартные морские сухогрузные       контейнеры универсального типа, </li>\r\n<li>HC (High Cube) —       высокий контейнер; </li>\r\n<li>PW (Pallet Wide)       — контейнер шире стандартного; </li>\r\n<li>OT (Open Top) —       контейнер с открытым верхом из брезентового тента; </li>\r\n<li>HT (Hard Top) —       контейнер с открывающейся металлической крышей; </li>\r\n<li>UP (Upgraded) —       усиленный контейнер повышенной прочности; </li>\r\n<li>FR (Flat Rack) и       PL (Platform) — контейнер-платформа <br /> <br /> </li>\r\n</ul>\r\n<p align=\"justify\">В распоряжении  нашей компании находятся все виды контейнеров, выбор которых зависит от типа  груза, тоннажа, размеров и т.д. Все наши контейнеры соответствуют международным  нормам ISO и требованиям КБК (Конвенции по безопасных контейнерам). Наша компания  осуществляет качественное <strong>экспедирование  морских грузов. Экспедирование морских грузов </strong>включает в себя не только  организацию международных морских перевозок, но и качественное документальное  сопровождение, и предоставление информации о передвижении груза. Все наши контейнеры  оснащены системой мониторинга, что позволяет нашим менеджерам быть в курсе о  местонахождении грузов. Наша организация осуществляет международные морские  перевозки уже много лет, за эти годы мы получили огромный опыт перевозки грузов  морским транспортом. Мы нацелены на положительный результат и долговременное  сотрудничество, именно поэтому нам доверяют экспедирование грузов в  международных перевозках наши клиенты и работают с нами на долговременной  основе</p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 11:57:08', 62, '', '2013-06-15 18:41:38', 62, 0, '0000-00-00 00:00:00', '2012-03-09 11:57:08', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 39, 'Перевозка грузов морем, грузы перевозимые морским транспортом, экспедирование морских грузов, организация международных морских перевозок, морской контейнеровоз, преимущества контейнерных перевозок, перевозка морских контейнеров, транспортировка морских контейнеров, экспедирование грузов в международных перевозках', 'Международная транспортная компания предлагает: Перевозка грузов морем экспедирование морских грузов морским транспортом организация международных морских перевозок морской контейнеровоз перевозка морских контейнеров транспортировка экспедирование грузов в международных перевозках', 0, 8395, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(22, 'Контейнерные морские перевозки, заказать морскую перевозку,перевозки контейнеров из всех портов мира', 'seacontainer', '', '<p align=\"justify\"><strong>Во всём мире морские контейнерные перевозки </strong>обеспечивают постоянный поток  транспортировки контейнеров с грузами на межконтинентальные расстояния через  океаны (атлантические, тихоокеанские и другие перевозки). Океанские перевозки  контейнеров широко используются там, где единственно возможным способом  доставки товаров является перевозка  грузов водными видами транспорта<strong>. </strong>Специализированные морские суда (корабли)<strong> – </strong>морские контейнеровозы предназначены  для единовременной перевозки большого количества<strong> </strong>контейнеров, что нельзя сравнить с возможностями автодорожных  перевозок. Корабль – контейнеровоз отправляется  исключительно по расписанию и прибывает по расписанию, за исключением случаев  форс-мажорных обстоятельств (например, плохие погодные условия).</p>\r\n<p align=\"justify\"><br /> <strong>Преимуществами морских контейнерных перевозок </strong>являются относительно низкая стоимость, сохранность  груза при перевозке, отлаженная система мировых  контейнерных перевозок. Благодаря постоянному потоку контейнерных перевозок товаров<strong> </strong>наблюдается устойчивый рост<strong> </strong>рынка  контейнерных перевозок.<strong> </strong>Цены на  контейнерные перевозки сильно варьируются и решающим фактором при выборе  организации по контейнерным перевозкам становятся качество обслуживания, грамотное  документальное сопровождение, опыт решения нестандартных ситуаций и т.д. Вы  можете спокойно доверить ваш груз нашей компании, обратившись к нам, Вы  получите надежную качественную перевозку Вашего товара и сервис высокого  уровня, так как мы профессионалы своего дела с многолетним опытом экспедирования контейнеров и<strong> транспортировки морских грузов, </strong>так же как и других видов транспортной  логистики.</p>\r\n<p align=\"justify\"><br /> <strong>Тарифы на международные морские контейнерные перевозки</strong> (морской  фрахт) зависят от характера, веса и объема перевозимого груза, расстояния между  пунктом отправки и пунктом назначения, и др. факторов, поэтому ставка на морскую контейнерную  перевозку рассчитывается индивидуально для каждого вида перевозимого груза. Для  Вашего удобства мы создали форму расчета стоимости в разделе стоимость  международной перевозки. Вам достаточно выбрать необходимые параметры в  предлагаемой форме письма и отправить нам. Наши менеджеры рассчитают <strong>стоимость морской контейнерной  перевозки </strong>и свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость морской контейнерной перевозки</strong></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 12:00:45', 62, '', '2013-09-15 12:33:29', 62, 0, '0000-00-00 00:00:00', '2012-03-09 12:00:45', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 9, 0, 38, 'Морские грузоперевозки, международная перевозка товаров, Международные морские грузоперевозки, международная морская перевозка грузов, доставка грузов морским транспортом, доставки грузов морем, перевозок грузов по морю, международные перевозки морем, транспортировка морских грузов, рынок морских грузоперевозок, перевозки грузов морскими видами транспорта, транспортировки грузов морем, контейнерные морские перевозки грузов, национальные перевозки грузов, международные речные перевозки', 'Международная транспортная компания предлагает: Морские грузоперевозки перевозка товаров международная морские грузоперевозки морем доставка грузов морским транспортом перевозки грузов по морю морем международная морская перевозка грузов морем транспортировка морских грузов рынок контейнерные морские перевозки грузов национальные перевозки грузов международные речные перевозки', 0, 4723, 'robots=\nauthor='),
(23, 'Схема осуществления международной авиаперевозки грузов,организация грузовых авиа перевозок', 'aviashema', '', '<p align=\"justify\">1. Составление заявки на <strong>международную грузовую авиа перевозку (доставку)</strong> продавцом или покупателем товара (в зависимости от того, является ли поставка  экспортной или импортной)</p>\r\n<div><ol>\r\n<li>2. Подписание договора транспортной  экспедиции (в данном случае, договора на осуществление международной грузовой  авиаперевозки) между заказчиком (продавцом или покупателем товара) и компании  по международным перевозкам воздушным транспортом<strong> (</strong><strong>международной авиатранспортной организацией</strong>)<strong> </strong></li>\r\n<li>3. Отгрузка товара на заводе (складе) производителя  и приемка товара экспедитором данной международной перевозки авиатранспортом.<strong> </strong><strong> </strong></li>\r\n<li>4. Международная авиатранспортная организация<strong> </strong>обеспечивает проведение погрузочных  работ на грузовом терминале<strong>.</strong><strong> </strong></li>\r\n<li>5. Экспедиционная компания отвечает за правильное  оформление отгрузочной и сопроводительной документации, за соблюдение правил  упаковки и <strong>маркировки авиа товара при грузоперевозке  самолетом. </strong><strong> </strong></li>\r\n<li>6. Если <strong>международная перевозка авиатранспортом</strong> подразумевает перевозку грузов авиационным транспортом под ключ (от двери до  двери), компания – перевозчик организует таможенное оформление груза по его  прибытию в пункт назначения и после получения всех необходимых документов,  доставляет товар непосредственно владельцу. </li>\r\n</ol></div>\r\n<p align=\"justify\"><strong>Международные перевозки воздушным транспортом </strong>это сложный процесс, который включает в себя комплексную работу,  экспедиторов, экипажа воздушного транспортного средства, работников  терминальной службы, таможенных органов и т.д. и для корректной транспортировки  грузов из / в зарубежных стран, для минимизации проблем, связанных с этим  сложным процессом, существуют экспедиторские компании, такие как наша, мы  доставим Ваш груз без проблем и точно в срок.</p>\r\n<p> </p>\r\n<p><strong>Заказать грузовую авиаперевозку, отправить заказ на доставку груза самолётом.</strong></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 12:19:36', 62, '', '2013-09-15 12:50:23', 62, 0, '0000-00-00 00:00:00', '2012-03-09 12:19:36', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 37, 'Международная грузовая авиаперевозка, договор на грузовую авиаперевозку, международные перевозки воздушным транспортом, международная авиатранспортная организация, международная перевозка авиатранспортом, авиа товар, грузоперевозка самолетом, перевозка грузов авиационным транспортом', 'Международная транспортная компания предлагает: международная грузовая авиаперевозка договор перевозки воздушным транспортом международная авиатранспортная организация перевозка авиатранспортом авиа товар грузоперевозка самолетом перевозка грузов авиационным транспортом', 0, 4395, 'robots=\nauthor='),
(24, 'Мультимодальные и интермодальные перевозки', 'multi', '', '<p align=\"justify\"><strong>Мультимодальные перевозки грузов</strong> – это один из наиболее  распространенных видов доставки товара несколькими видами транспорта. Для мультимодальных  перевозок грузов<strong> </strong>используются  автомобили, подвижные составы, суда и самолеты. Комбинации могут быть самыми  различными: это могут быть смешанные<strong> железнодорожно - водные перевозки грузов, смешанные перевозки жд – море,  перевозки море – авто (перевозка морским транспортом, судном – автомобилем) перевозки  авиа – авто (перевозка самолетом - автомобилем), перевозки жд – авто  (железнодорожно – автомобильные перевозки), перевозки авиа – жд </strong>и т.д.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">При организации мультимодальных  перевозок погрузочно-разгрузочные работы по смене транспортного средства  осуществляются без участия грузовладельца. <strong>Мультимодальные  контейнерные перевозки </strong>подразумевают перегрузку товара из контейнера на  автомобильный или железнодорожный транспорт с последующей доставкой  грузоотправителю.</p>\r\n<p align=\"justify\"><br /> При  привлечении перевозчиков со стороны, перевозка становится интермодальной. <strong>Интермодальная перевозка грузов – </strong>доставка  грузов с помощью одной грузовой единицы (контейнер, автомобиль и т.п.) без  перегрузки самого товара при смене транспортного средства. Например, перевозка  транспортных фур на паромах или <strong>интермодальные  контейнерные перевозки </strong>с перегрузкой контейнера с одного вида транспорта на  другой. Например, при перевозке <strong>контейнера  автомобилем и жд (железнодорожным транспортом) </strong>или <strong>авиа транспортом и морем</strong> и т.п.<strong> </strong></p>\r\n<p align=\"justify\"><br /> <strong>Мультимодальные и интермодальные  перевозки</strong> широко  распространены при перевозке грузов на большие расстояния<strong>, </strong>таким образом, большая часть<strong> </strong>международных грузоперевозок является<strong> </strong>международными мультимодальными перевозками и международными  интермодальными перевозками.<strong> </strong></p>\r\n<p align=\"justify\"><br /> Комбинированные  перевозки грузов (смешанные перевозки грузов)<strong> </strong>позволяют подобрать оптимальный маршрут и время доставки груза они  пользуются наибольшей популярностью в международном сообщении (международные комбинированные  и смешанные перевозки). Это довольно сложный процесс мультимодальной и  интермодальной перевозки грузов, где чрезвычайно важным является выполнение  сроков отгрузки товара, своевременная оплата всех сборов и налогов, продуманная  система погрузочных, перевалочных работ, выполнение договорных обязательств со  строго оговоренным переходом ответственности от одного перевозчика к другому, при  смешанных перевозках. Хорошая организация смешанных перевозок требует наличия  хорошего опыта экспедиционной компании и предельного внимания со стороны  операторов перевозки.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\">Наша компания  имеет обширный опыт <strong>международных  интермодальных и мультимодальных перевозок</strong>, мы знаем множество нюансов <strong>международных смешанных перевозок, </strong>благодаря  чему мы с легкостью обходим все подводные камни и доставляем груз в срок и в  сохранности, именно поэтому наши клиенты уже много лет работают с нашей  компанией на принципах долгосрочного сотрудничества.</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 12:40:39', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-03-09 12:40:39', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 36, 'Мультимодальные перевозки грузов, смешанные железнодорожно - водные перевозки грузов, смешанные перевозки река – море, смешанные перевозки жд море, перевозки море – авто, перевозка морским транспортом, перевозка судном – автомобилем, перевозки авиа – авто, перевозка самолетом - автомобилем, перевозки жд – авто, железнодорожно – автомобильные перевозки, перевозки авиа – жд, интермодальные перевозки грузов, мультимодальные и интермодальные перевозки, международные мультимодальными перевозки, международные интермодальные перевозки, мультимодальные контейнерные перевозки, интермодальные контейнерные перевозки, организация мультимодальных перевозок, комбинированные перевозки грузов, смешанные перевозки грузов, международные комбинированные и смешанные перевозки, организация смешанных перевозок', 'Международная транспортная компания предлагает: мультимодальные перевозки грузов смешанные железнодорожно - водные река море смешанные перевозки жд море авто смешанные перевозки морским транспортом судном автомобилем перевозки авиа авто самолетом  автомобилем перевозки жд авто железнодорожно – автомобильные перевозки авиа жд интермодальные перевозки грузов международные мультимодальными перевозки мультимодальные контейнерные перевозки интермодальные комбинированные перевозки грузов, смешанные международные организация смешанных перевозок', 0, 10877, 'robots=\nauthor='),
(25, 'Сборные грузоперевозки,перевозки сборных грузов', 'sbornie', '', '<p align=\"justify\">Иногда  появляется необходимость отправки малогабаритного груза, но заказ целого  контейнера или автомобиля является нецелесообразным, так как это может привести  к значительному удорожанию стоимости товара. Для таких случаев существуют  транспортные компании, занимающиеся организацией <strong>международных перевозок сборных грузов.</strong> <strong>Транспортные компании по сборным грузам </strong>организуют места консолидации  сборных грузов с максимальной выгодой для грузовладельца. Таким образом,  стоимость доставки товара оплачивается сразу несколькими грузовладельцами, что  значительно удешевляет перевозку. Небольшими недостатками такой перевозки  являются увеличение сроков  доставки  товара и зависимость перевозчиков сборных грузов от графика отправки груза с  места консолидации. Экспорт и импорт сборных грузов<strong> </strong>отличается набором необходимых документов.</p>\r\n<p align=\"justify\"><br /> Существуют  самые различные <strong>грузоперевозки сборных  грузов </strong>и в зависимости от типа транспорта подразделяются на <strong>автоперевозки сборных грузов,  железнодорожные (жд) перевозки сборных грузов, морские контейнерные перевозки  сборных грузов </strong>и т.п. Сборным грузом отправляются самые различные грузы,  даже товары, требующие соблюдения специального температурного режима, для отправки  сборных грузов такого характера используется рефрижератор для сборных грузов.<strong> </strong></p>\r\n<p align=\"justify\"><strong>Направление перевозок сборных грузов:</strong> перевозка сборных грузов из Турции, сбор и перевозка сборных грузов из Польши, Италии,Болгарии, Румынии, Франции, Португалии. Доставка сборных грузов из России, Украины, Беларусии, стран Прибалтики. Перевозка сборного груза из Китая,Арабских Эмират,Индии.<br /> <strong>Международная доставка сборных грузов  – </strong>это сложный  процесс<strong> </strong>сбора товара в месте консолидации  и его доставки грузовладельцам, требующий большого внимания и опыта сотрудников  компании, экспедирующей сборные грузы. Тарифы на доставку товаров сборным грузом зависят от характера, веса и  объема перевозимого груза, расстояния между пунктом отправки и пунктом  назначения, и др. факторов, поэтому ставка на перевозку сборных грузов  рассчитывается индивидуально для каждого вида перевозимого груза. Для Вашего  удобства мы создали форму расчета стоимости в разделе стоимость международной  перевозки. Для того, чтобы <strong>заказать сборную  грузоперевозку </strong>вам достаточно выбрать необходимые параметры в предлагаемой  форме письма и отправить нам. Наши менеджеры рассчитают стоимость перевозки и  свяжутся с Вами в течение кратчайшего промежутка времени.<strong> </strong></p>\r\n<p> </p>\r\n<div>\r\n<p><strong> Для перевозки сборного груза отправьте заявку.<br /></strong></p>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 12:47:58', 62, '', '2013-10-02 18:29:29', 62, 0, '0000-00-00 00:00:00', '2012-03-09 12:47:58', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 35, 'Международные перевозки сборных грузов, транспортные компании по сборным грузам, консолидации сборных грузов, экспорт и импорт сборных грузов, перевозчики сборных грузов, отправка сборных грузов, рефрижератор для сборных грузов, грузоперевозки сборных грузов, автоперевозки сборных грузов, железнодорожные (жд) перевозки сборных грузов, морские контейнерные сборные грузы, международная доставка сборных грузов, компания экспедирующая сборный груз', 'Международная транспортная компания предлагает: международные перевозки сборных грузов транспортные компании консолидации сборных грузов экспорт и импорт перевозчики сборных грузов отправка рефрижератор грузоперевозки сборных грузов автоперевозки железнодорожные (жд) перевозки сборных грузов морские контейнерные международная доставка сборных грузов', 0, 8393, 'robots=\nauthor='),
(26, 'Автомобильные перевозки по России', 'russiaavto', '', '<p align=\"justify\">Перевозка грузов по России автотранспортом пользуется наибольшей популярностью, как самый удобный  вид доставки товара. Автотранспортное средство подается на место погрузки товара, на склад отправителя груза и доставляется непосредственно получателю, к месту разгрузки. Все наши водители – экспедиторы имеют обширный опыт автомобильных грузовых перевозок по России. Все автотранспортные перевозки по России осуществляются на высоконадежных автотранспортных средствах таких марок как Камаз, Маз, Iveco (Ивеко), Scania (Скания), Renault (Рено), Volvo (Вольво), Man (Ман). В распоряжении компании находятся автотранспортные средства с различной грузоподъемностью и объемом всех вышеперечисленных марок (автопоезда, еврофуры, тентованные фургоны, рефрижераторы, для перевозки грузов в специальном  температурном режиме, например, рефрижераторная перевозка мяса по России; изотермические фургоны, контейнеровозы, для авто перевозки контейнеров по России и т.п.) для автомобильных перевозок грузов по России всех видов грузов. Тарифы на российские автомобильные перевозки зависят от характера, веса и объема перевозимого груза, расстояния между пунктом отправки и пунктом назначения, и др. факторов, поэтому ставка на автоперевозку по России рассчитывается индивидуально для каждого вида перевозимого груза.</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните <br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 13:31:49', 62, '', '2013-06-15 18:43:14', 62, 0, '0000-00-00 00:00:00', '2012-03-09 13:31:49', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 34, 'Автомобильные перевозки по России, перевозка грузов по России автотранспортом, автомобильные грузовые перевозки по России, автотранспортные перевозки по России, автомобильные перевозки грузов по России, перевозки контейнеров по России, тарифы на российские автомобильные перевозки, ставка на автоперевозку по России', 'Международная транспортная компания предлагает: автомобильные перевозки по России грузов автотранспортом автомобильные грузовые автотранспортные перевозки контейнеров по России тарифы на российские автомобильные перевозки ставка на автоперевозку по России', 0, 8359, 'robots=\nauthor='),
(27, 'Железнодорожные перевозки по России, грузоперевозки Ж.Д. вагонами.', 'russiarail', '', '<p align=\"justify\">Если доставка груза по России не является срочной, мы рекомендуем нашим клиентам обратить внимание на <strong>железнодорожную перевозку грузов по России.</strong> Жд перевозки по России осуществляются во все города России, железнодорожного транспортного сообщения и пользуются огромным спросом, благодаря высокой степени безопасности жд транспортировки грузов и относительно низкой стоимости перевозки. Если перевозка железнодорожным транспортом по России осуществляется при доставке больших объемов товаров, в этом случае можно заказать целый состав. Перевозка грузов ж.д. вагонами по России позволяет перевозить самые различные виды грузов от насыпных и наливных до тяжеловесной негабаритной техники, которая перевозится на специальных платформах, с использованием специальных креплений, поэтому при перевозке ж.д. транспортом используются самые различные виды вагонов, а также жд контейнеры.</p>\r\n<p align=\"justify\"><strong>Железнодорожные грузовые перевозки в вагонах</strong> осуществляются в крытых вагонах, полувагонах, на специальных платформах, вагонах – термосах, вагонах – рефрижераторах (если речь идет о скоропортящихся грузах или грузах, требующих соблюдения температурного режима) и т.п. Железнодорожные (жд) контейнерные перевозки по России осуществляется в стандартных и специализированных жд контейнерах. <strong>Тарифы на российские железнодорожные (жд) перевозки</strong> зависят от характера, веса и объема перевозимого груза, расстояния между городами и др. факторов, поэтому ставка на железнодорожную (жд) перевозку рассчитывается индивидуально для каждого вида перевозимого груза. Для того, чтобы заказать железнодорожный (жд) контейнер или или жд перевозку в любой город России вам достаточно выбрать необходимые параметры в предлагаемой форме письма и отправить нам. Наши менеджеры <strong>рассчитают стоимость железнодорожной перевозки</strong> и свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p align=\"justify\"> </p>\r\n<p><strong>Заявка для заказа ж.д. вагонов для перевозки грузов.</strong></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 13:41:07', 62, '', '2013-10-08 10:04:02', 62, 62, '2013-12-16 18:14:53', '2012-03-09 13:41:07', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 33, 'Железнодорожные перевозки по России, железнодорожные перевозки грузов по России, жд транспортировки грузов, жд перевозки по России, перевозка железнодорожным транспортом по России, перевозка грузов поездом по России, железнодорожные перевозки в вагонах, железнодорожные  жд, контейнерные перевозки по России, тарифы на российские железнодорожные жд перевозки, ставка на железнодорожную жд перевозку, заказать железнодорожный жд контейнер', 'Международная транспортная компания предлагает: Железнодорожные перевозки по России грузов жд транспортировки жд перевозки по России железнодорожным транспортом перевозка грузов поездом по России железнодорожные перевозки в вагонах жд контейнерные перевозки по России тарифы на российские железнодорожные жд перевозки ставка заказать железнодорожный жд контейнер', 0, 10972, 'robots=\nauthor='),
(28, 'Морские перевозки по России', 'russiasea', '', '<p align=\"justify\">В России много портовых городов, что делает возможной доставку товаров по обширной российской системе рек и каналов. Морские и речные перевозки грузов по России. Благодаря рекам, многие города имеют прямое транспортное сообщение с морями и океанами, что делает возможным перевозку товаров по России непосредственно до пункта назначения водными видами транспорта. Речные грузоперевозки по России являются наиболее экономичным видом перевозки товаров и позволяют транспортировать груз на большие расстояния, с грузоподъемностью в сотни тонн. Таким образом, основными преимуществами доставки грузов водным транспортом по России является сравнительная конкурентная стоимость речных перевозок по сравнению с автомобильным или авиационным транспортом, большая грузоподъемность судов. Наиболее популярным видом доставки грузов на речных судах являются контейнерные перевозки грузов по России. Тарифы на российские морские и речные грузоперевозки (фрахт) зависят от характера, веса и объема перевозимого груза, расстояния между пунктом отправки и пунктом назначения, и др. факторов, поэтому ставка на морскую или речную перевозку груза по России рассчитывается индивидуально для каждого вида перевозимого груза. Для Вашего удобства мы создали форму расчета стоимости в разделе стоимость перевозки. Вам достаточно выбрать необходимые параметры в предлагаемой форме письма и отправить нам. Наши менеджеры рассчитают стоимость перевозки и свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 13:46:58', 62, '', '2013-05-31 12:57:27', 62, 0, '0000-00-00 00:00:00', '2012-03-09 13:46:58', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 32, 'Железнодорожные перевозки по России, железнодорожные перевозки грузов по России, жд транспортировки грузов, жд перевозки по России, перевозка железнодорожным транспортом по России, перевозка грузов поездом по России, железнодорожные перевозки в вагонах, железнодорожные  жд, контейнерные перевозки по России, тарифы на российские железнодорожные жд перевозки, ставка на железнодорожную жд перевозку, заказать железнодорожный жд контейнер', 'Международная транспортная компания предлагает: Железнодорожные перевозки по России грузов жд транспортировки жд перевозки по России железнодорожным транспортом перевозка грузов поездом по России железнодорожные перевозки в вагонах жд контейнерные перевозки по России тарифы на российские железнодорожные жд перевозки ставка заказать железнодорожный жд контейнер', 0, 8523, 'robots=\nauthor='),
(29, 'Авиа грузоперевозки по России,авиа доставка груза.', 'russiaavia', '', '<p align=\"justify\">Если перевозка груза по России является срочной, мы рекомендуем нашим клиентам авиаперевозку грузов в города России. <strong>Авиа грузоперевозка по всей территории России</strong> – это наиболее быстрый способ доставки грузов, особенно если речь идет о больших расстояниях между городами. Воздушные перевозки по России делают возможной доставку товара практически в любой российский город. Грузовые авиационные перевозки по России просто незаменимы при перевозке срочных  и ценных грузов, скоропортящихся продуктов. При авиадоставке товара, который не является габаритным, например крупногабаритная техника, тяжеловесное оборудование и т.п. в нашем распоряжении авиа – тяжеловесы, которые доставят негабарит в \\ из любого города России. Грузовые самолеты – тяжеловесы также используются при перевозке авиа контейнеров по России. <strong>Авиа перевозка грузов самолетом через всю территорию России</strong> может занять 1 день с выполнением всех необходимых формальностей, в то время как доставка товара на поезде может занять несколько дней. <strong>Тарифы на авиаперевозки грузов </strong>по России  зависят от характера, веса и объема перевозимого груза, расстояния между городами и др. факторов, поэтому ставка на российскую авиаперевозку рассчитывается индивидуально для каждого вида перевозимого груза. После получения заявки на авиа грузоперевозку наши менеджеры рассчитают стоимость авиа перевозки и свяжутся с Вами в течение кратчайшего промежутка времени.</p>\r\n<p><strong>Чтобы узнать стоимость Грузовой авиа доставки отправьте заявку.</strong></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 13:57:23', 62, '', '2013-11-24 20:37:08', 62, 0, '0000-00-00 00:00:00', '2012-03-09 13:57:23', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 9, 0, 31, 'Воздушные перевозки по России, грузоперевозка по России, авиаперевозка грузов в города России, авиа перевозка по России, воздушные перевозки по России, грузовые авиационные перевозки по России, авиадоставке товара, перевозка авиа контейнеров по России, перевозка грузов самолетом через всю территорию России, тарифы на авиаперевозки грузов по России, ставка на российскую авиаперевозку', 'Международная транспортная компания предлагает: воздушные перевозки по России грузоперевозка авиаперевозка грузов в города России авиа перевозка грузовые авиационные перевозки по России авиадоставке товара перевозка авиа контейнеров по России, перевозка грузов самолетом через всю территорию России тарифы на авиаперевозку грузов ставка', 0, 6027, 'robots=\nauthor='),
(187, 'Авто рефрижераторы, перевозки грузов в рефрижераторах ', 'avto-refrizheratory', '', '<p><strong>Грузоперевозки  Рефрижераторами.</strong></p>\r\n<p><strong>Тип транспорта: Рефрижератор полуприцеп.</strong> Поддерживает температуру в диапазоне от  +10 до – 20 С. Вместительность: от 30м3 до 90м3. <br />Размеры полуприцепа: 13.65 Х 2.4 Х 2.6м. Размеры бортовика с прицепом: 8.10 Х 2.4 Х 2.6м. Размеры прицепа с холодильной установкой: 7,50 Х 2,4 Х 2.6м.</p>\r\n<p><strong>Автопоезд рефрижератор с холодильными установками</strong>. Поддерживает температуру в диапазоне от +10 -20С. Объём - от 20м3 до100м3. <br />Вес перевозимого груза до 21.5тонн. 33 евро палета. Перевозка с TIR и по СMR.</p>\r\n<p>Рефрижераторный полуприцеп оснащен холодильной установкой, позволяющей регулировать температуру в кузове от –30 С.° до +30 С.° Все кузова оснащены современным оборудованием, позволяющим легко поддерживать и контролировать нужную температуру для груза в пути. <strong>Также для перевозки скоропортящихся грузов</strong> используется изотермический фургон, работающий по тому же принципу. <br />В рефрижераторных и изотермических вагонах перевозятся продукты питания, напитки, медикаменты, цветы и другие скоропортящиеся грузы.<br /><strong>Рефрижераторные перевозки</strong> осуществляются по направлениям из России в Италию, Молдову, из Украины, Румынии в Россию, Турцию, Грецию, Польша, Казахстан другие страны ЕС и СНГ.</p>\r\n<p><strong>Для заказа перевозки в рефрижераторе отправьте заявку.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:14:50', 62, '', '2013-11-27 16:05:22', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:14:50', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 10, 0, 14, 'реф., рефрижератор, перевозка из России в рефрижераторах', 'рефрижераторные перевозки, перевозка грузов в рефах, доставка груза рефрижератором, перевозка с температурным режимом', 0, 9384, 'robots=\nauthor='),
(30, 'Таможенное оформление грузов в Молдове и Приднестровье , как растаможить груз в Молдавии, таможенное оформление грузов в Приднестровье', 'customs', '', '<p align=\"justify\">Наша  компания занимается <strong>экспортным и  импортным таможенным оформлением в Молдове </strong>города<strong>: </strong>Кишинёв, Бельцы, Кагул, Оргеев, Резина, Унгены,<strong> и Приднестровье</strong> в городах: Тирасполь, Бендеры, Каменка, Рыбница, Григориополь, Дубоссары, как в комплексе услуг по доставке  «товара под ключ» (грузоперевозки  «от двери до двери»), так и отдельно, без  перевозки грузов. Наша цель –  максимальное снижение затрат на перевозку грузов и сроков доставки. Наши  специалисты имеют обширный  опыт таможенной  очистки товаров, отличное знание  законодательной базы и правил ВЭД.  Ваш груз будет доставлен согласно сроков доставки, и без  лишних материальных издержек пройдёт таможенное оформление.</p>\r\n<p align=\"justify\"> </p>\r\n<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>Если Вам требуется помощь в таможенном оформлении товаров</strong> <strong>в Молдове или Приднестровье</strong>, позвоните нам.</span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"color: #993300;\">Тел:  <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+373 686 77712 </span>для таможенного оформления грузов в Молдове</span>. </span></p>\r\n<p><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"> </span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"color: #993300;\">Тел: +<span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">373 777 88958</span><strong> </strong> таможенное оформление груза в Приднестровье.</span> Наши  специалисты незамедлительно ответят вам на все вопросы.</span></p>\r\n<p align=\"justify\">Наша  компания является транснациональным логистическим грузоперевозчиком, поэтому мы  занимаемся всеми видами логистических услуг для осуществления доставки товара  «под ключ», включая таможенные услуги.</p>\r\n<p align=\"justify\"><strong>Таможенное оформление грузов</strong> <strong>на территории Молдовы и Приднестровья</strong> (растаможить, затаможить), импорт грузов, экспорт груза, это сложная процедура таможенной очистки грузов, т.е. прохождения экспортных и импортных  товаров через границу с соблюдением всех таможенных правил и предписаний.  При самостоятельном таможенном оформлении экспортных и импортных товаров (таможенной  очистке грузов) владелец груза часто сталкивается с огромными проблемами,  которые заключаются в неправильном оформлении документации, в  несоответствии  отгрузочных документов с  предоставленными данными о прибывшем товаре на таможню, с прохождением большого  количества инстанций и многими другими проблемами. Устранение этих проблем по прибытию  груза на таможню может привезти к дополнительным затратам, связанным с простоем  грузового транспорта, хранением товара на складе временного хранения (СВХ), а это  в свою очередь является недешевым удовольствием.</p>\r\n<p>Для таможенного оформления экспорта существуют правила, отличные от таможенного оформления импорта, так же  как и существуют различные правила для различных видов товаров, подлежащих таможенной очистке. Для организации  быстрого  прохождения Вашего груза через таможню, <strong>и таможенного  оформления товаров</strong>, этим займётся наш таможенный брокер, или таможенный представитель, предоставляющий услуги таможенного<strong> </strong>оформления вашего груза.<strong>(<a class=\"style3\" href=\"customs_services.html\">услуги по  таможенной очистке</a>).  (<a class=\"style3\" href=\"customs_cargo.html\">грузоперевозки и таможенные услуги</a>)</strong></p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-size: small;\"><strong>Для заказа</strong> <strong>таможенного оформления грузов в Молдове</strong> тел. <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+37368677712</span></span></span><span style=\"font-size: small;\"><span style=\"color: #993300;\"><span style=\"color: #000000;\"><strong>. По вопросам таможенного оформления груза в Приднестровье</strong> тел. <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">+37377788958</span></span><br /></span></span></p>\r\n<p align=\"justify\"><br /> <strong>Заявка для заказа международных грузоперевозок.</strong></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 14:10:35', 62, '', '2013-09-26 14:43:22', 62, 0, '0000-00-00 00:00:00', '2012-03-09 14:10:35', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 80, 0, 30, 'Таможенные услуг таможенное оформление товара таможенная очистка грузов  таможенное оформление импортных и экспортных товаров импорта таможенное оформление экспорта таможенное оформление компании  организация таможенный брокер услуги таможенного оформления по таможенной очистке экспортное и импортное таможенное оформление  таможенное оформление  в москве таможенная очистка товара требуется таможенное оформление  помощь в таможенном оформлении', 'Таможенные услуги таможенное оформление товара таможенная очистка грузов таможенное оформление импортных и экспортных товаров экспорта и импорта таможенная очистка таможенное оформление компании организация таможенный брокер услуги таможенного оформления услуги по таможенной очистке экспортное и импортное таможенное оформление в москве таможенная очистка товара требуется таможенное оформление  помощь в таможенном оформлении', 0, 16390, 'robots=\nauthor='),
(31, 'Страхование грузов', 'insurance', '', '<p align=\"justify\">Несмотря на то, что мы проводим большую работу по  минимизации рисков при перевозке, и что вероятность потери груза, даже  частичной – ничтожно мала, мы предоставляем <strong>услугу транспортного страхования грузов при перевозке </strong>и предлагаем  нашим клиентам застраховать свой груз от форс – мажорных обстоятельств. <strong>Страхование грузов перевозчиком  (экспедитором) </strong>позволяет обезопасить  свой груз от таких рисков как кража, порча, частичная или полная утеря груза в  результате аварии (если речь идет о <strong>страховании  грузов, перевозимых автотранспортом или страхование жд грузов</strong>), затопления  судна (<strong>страхование судовых грузов, морское  страхование грузов</strong>), в результате пожара, стихийного бедствия и др. Если  речь идет о <strong>международном страховании  внешнеторговых грузов, </strong>мы рекомендуем застраховать карго в обязательном  порядке, так как грузоперевозки осуществляются транзитом через территории  многих государств, часто посредством<strong> </strong>смены  не одного вида транспорта, а если речь идет о сборных перевозках, то груз еще и  может храниться на логистическом складе. Таким образом, <strong>страхование грузов при грузоперевозках </strong>не является обязательным, но  носит рекомендательный характер. <strong>Тарифы  и стоимость страхования грузов</strong> зависят от многих факторов, таких как выбор  страховой компании, вида транспортировки,   зоны страхового покрытия, стоимости груза и др. Наши специалисты  проконсультируют Вас о всех вариантах <strong>страхования  грузов при международных перевозках и при транспортировке</strong> по России.</p>\r\n<p align=\"justify\"> </p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 14:18:01', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-03-09 14:18:01', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 29, 'Услуги страхования грузов транспортное страхование грузов  при перевозке страхование груза перевозчиком страхование груза экспедитором автотранспорт страхование грузов судовых морское страхование грузов жд международное страхование грузов страхование внешнеторговых грузов страхование карго страхование грузов грузоперевозки тарифы стоимость страховые компании страхование грузов при транспортировке страхование грузов при международных перевозках', 'Услуги страхования грузов при перевозке страхование груза перевозчиком экспедитором транспортное страхование грузов автотранспорт морское страхование грузов судовых жд международное страхование грузов страхование внешнеторговых грузов карго страхование грузов грузоперевозки тарифы стоимость страховые компании страхование грузов при транспортировке страхование грузов при международных перевозках', 0, 4795, 'robots=\nauthor='),
(32, 'Сопровождение груза', 'convoy', '', '<p align=\"justify\">Наша компания предоставляет также <strong>услуги по сопровождению грузов</strong>. <strong>Сопровождение и охрана грузов при  транспортировке </strong>рекомендуется в первую очередь при перевозке ценных грузов:  материальных ценностей, предметов искусства, драгоценностей, изделий их меха и  т.п. <strong>Перевозка и сопровождение грузов</strong> – это сложный логистический процесс, который включает в себя планирование  и  детальную проработку маршрута, отбор  подходящих кадров с опытом <strong>охраны  специальных грузов, </strong>наличие всех необходимых лицензий и многое другое. Наша  компания предоставляет услугу по <strong>охране  и сопровождению грузов по железной дороге (жд грузы),</strong> занимается сопровождением негабаритных  грузов, охраной грузов при перевозке автотранспортом. <strong>Сопровождение и охрана ценных грузов</strong> осуществляется под наблюдением  профессионалов . Для более полной информации об услуги позвоните нам по  телефону ***</p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 14:21:43', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-03-09 14:21:43', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 28, 'Сопровождение грузов услуги по сопровождению грузов охрана грузов сопровождение охрана грузов при транспортировке перевозка и сопровождение грузов охрана специальных грузов сопровождение жд грузов сопровождение грузов по железной дороге сопровождение негабаритных грузов при перевозке автотранспорт