(33, 'Таможенные услуги. ', 'customsservices', '', '<p align=\"justify\">Наша  компания предоставляет <strong>таможенные  транспортные услуги</strong> (грузоперевозки по всему миру и <strong>таможенное сопровождение грузов</strong>). <strong>Стоимость таможенного оформления</strong> оговаривается индивидуально для  каждого вида товара, так как <strong>стоимость  таможенной очистки</strong> зависит от многих факторов: вида и типа груза, его  стоимости и стоимости транспортировки груза. При <strong>этом</strong> ставки, выплачиваемые на таможне, едины для всех таможенных  постов, то есть по прибытию груза на таможню выплачиваются НДС, пошлина, акциз,  таможенные сборы. Таможенное оформление на постах отличается оплатой <strong>таможенно – брокерских услуг</strong> или  отдельно <strong>услуг таможенного декларанта  (таможенного агента). </strong><br /> Наши  клиенты чаще всего заказывают комплекс услуг по перевозке и таможенному оформлению,<strong> </strong>независимо от способа  перевозки: <strong>таможенное оформление </strong>при  автоперевозках, авиа перевозках, таможенное  оформление и доставка грузов ж.д (железной дорогой), морем и т.д. Оказание <strong>таможенных услуг при оформлении ввозимых и  вывозимых товаров</strong>, отличаются перечнем документов</p>\r\n<div><strong>Грузоперевозки и таможенные  услуги </strong>предоставляемые  совместно позволяют сократить время и нервы владельца груза, связанные с лишней  бумажной волокитой и передачей информации о перевозке брокерской фирме. Наша  компания предоставляет <strong>услуги  таможенного оформления грузов</strong> по конкурентным ценам. Наши специалисты  подготовят <strong>документы для таможенного  оформления</strong>, заполнят таможенную декларацию, своевременно подготовят все  платежные поручения, подготовят Вас для свободного прохождения всех стадий  таможенного оформления.  Позвоните нам, и  наши менеджеры подробно проинформируют Вас об <strong>услугах по таможенной очистке</strong> и ответят на все Ваши вопросы.</div>\r\n<p> </p>\r\n<p><strong>Если вас интересует таможенное оформление груза</strong>, напишите вопрос на mtperevozki@gmail.com</p>\r\n<p> </p>\r\n<p><strong>Если вам нужно заказать перевозку отправьте заявку.</strong></p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 14:30:37', 62, '', '2014-01-27 10:38:37', 62, 0, '0000-00-00 00:00:00', '2012-03-09 14:30:37', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 27, 'Таможенные услуги москва  таможенные транспортные услуги таможенное сопровождение грузов стоимость таможенных услуг стоимость таможенного оформления стоимость таможенной очистки таможенно брокерские услуги услуги таможенного декларанта таможенные сборы за таможенное оформление ставки перевозки таможенное оформление  грузоперевозки таможенные услуги оказание таможенных услуг доставка грузов и таможенное оформление  таможенное оформление ввозимых товаров таможенное оформление вывозимых товаров услуги таможенного оформления грузов цены таможенное оформление документы необходимые для таможенного оформления стадии таможенного оформления услуги по таможенной очистке', 'Таможенные услуги москва  сопровождение грузов таможенные транспортные услуги таможенно брокерские услуги таможенного декларанта сборы за таможенное оформление ставки перевозки таможенное оформление  грузоперевозки оказание таможенных услуг доставка грузов таможенное оформление ввозимых товаров вывозимых услуги таможенного оформления грузов цены таможенное оформление документы стадии таможенного оформления услуги по таможенной очистке стоимость таможенных услуг стоимость таможенного оформления стоимость таможенной очистки', 0, 2187, 'robots=\nauthor='),
(34, 'Логистика   Таможенное оформление   Виды грузов', 'customscargo', '', '<p align=\"justify\">Мы  занимаемся комплексом услуг по доставке самых разнообразных товаров. Таким  образом мы осуществляем грузоперевозку, страхование и таможенную очистку  (таможенное оформление) автомобилей, оборудования, техники, промышленных машин,  драгоценных металлов, продуктов питания, фруктов, зерна, животных, алкоголя,  перевозку и таможенное оформление автотранспорта, нефтепродуктов, мебели,  одежды, запчастей, спецтехники, пиломатериалов и многих других видов груза. За  долгие годы мы накопили обширный опыт по перевозке  и таможенной очистке самых различных  транспортных средств: таможенное оформление легковых и грузовых автомобилей, прицепов,  запасных частей. Мы перевозим и осуществляем таможенное оформление грузов из Европы, России, Украины, Польши,  Китая, Америки, Индии, Африки и многих других стран.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\"> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2012-03-09 14:34:53', 62, '', '2013-07-31 08:59:14', 62, 0, '0000-00-00 00:00:00', '2012-03-09 14:34:53', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 26, 'Грузоперевозка страхование и таможенное оформление автомобилей оборудования техники промышленных машин драгоценных металлов продуктов питания фруктов зерна животных алкоголя также автотранспорта нефтепродуктов мебели одежды запчастей спецтехники пиломатериалов и многих других видов груза. Таможенная очистка легковых и грузовых автомобилей, прицепов, запасных частей. Таможенное оформление грузов из Китая Америки Индии Африки и многих других стран', 'Грузоперевозка страхование и таможенное оформление автомобилей оборудования техники промышленных машин драгоценных металлов продуктов питания фруктов зерна животных алкоголя также автотранспорта нефтепродуктов мебели одежды запчастей спецтехники пиломатериалов и многих других видов груза. Таможенная очистка легковых и грузовых автомобилей, прицепов, запасных частей. Таможенное оформление грузов из Китая Америки Индии Африки и многих других стран', 0, 2155, 'robots=\nauthor=');
