(35, 'Грузоперевозки  из Европы,  Австрия - Россия - Австрия    (Вена).Автоперевозки из России в Австрию', 'austria', '', '<p align=\"justify\"><strong>Грузоперевозки из Европы, Австрия</strong> - Россия.<strong> Перевозки из Австрии</strong> в Казахстан , Молдову, Беларусь. Австрия Вена,  Грац, Линц, Зальцбург, Инсбрук<strong> </strong></p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\"><strong>Для получение стоимости за перевозку из Европы, из Австрии, заполните заявку.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка груза из Австрии</strong> <strong>в Россию, Молдову, Казахстан </strong>и в любую точку мира всеми видами транспорта (авиа, контейнерные грузоперевозки, автомобильные и железнодорожные перевозки). Чаще всего доставка грузов Австрия - Россия - Австрия (Вена, Грац, Линц, Зальцбург, Инсбрук) осуществляется автотранспортом, так как автоперевозки Австрия - Россия - Австрия являются наиболее удобным видом транспортировки товаров, также перевозки Австрия - Россия - Австрия осуществляются по железной дороге, самолетом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Австрии, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>\r\n<p><strong>Как заказать транспорт для доставки груза из/в Австрию.</strong><br />Страна перевозки груза Австрия, наиболее развитые индустриальные города Австрии это: Вена, Грац, Линц, Зальцбург, Инсбрук, Клагенфурт, Брегенц, Штайр.<br /><strong>Основной импорт грузов в Австрию</strong> это: машины и оборудование, цветные металлы, товары народного потребления, животные корма, удобрения, продукты питания. <br /><strong>Основной экспорт грузов из Австрии в Россию,Молдову, Казахстан</strong> это: авто запчасти, топливо, оборудование, станки, чёрные металлы, товары народного потребления, текстиль, канцтовары, продукты питания.<br />Торговые отношения у Австрии с Германией, Италией, Францией, Швейцарией, Венгрией, Чехией, Словакией, Словенией, Польшей, Румынией, Грецией, Турцией, Мальтой, Кипром, США, Китаем, Молдавией, Россией.<br /><strong>Грузовые перевозки в Австрию, или из Австрии</strong> осуществляются автомобильным, железнодорожным, воздушным транспортом. В 2012 году автомобильным транспортом в Австрии было перевезено 344,6 млн. тонн грузов. Объем железнодорожных перевозок грузов составил 107,6 млн. тонн. Важное значение для контейнерных перевозок по Дунаю имеет речной транспорт Австрии, в 2012 году им было перевезено 9,9 млн. тонн грузов.<br />Международная авиа доставка осуществляется из 6 аэропортов Австрии, в 2012 году было обработано около 227,9 млн. тонн грузов. Также на территории Австрии располагаются 16 крупных грузовых терминалов и логистических центров.<br /><strong>Таможенное оформление грузов при перевозках из/в Австрию</strong> происходит на основе Единого таможенного тарифа Европейского Союза и Таможенного Кодекса Австрии. Средний уровень импортной пошлины на товар, происходящий не из страны ЕС, составляет 4%.Обязательства по уплате таможенных платежей несет заявитель таможенной декларации, оформляющий ее на свое имя. По запросу заявителя таможня может предоставить отсрочку по таможенным платежам, с обязательным внесением залога. Транзитные грузы, следующие на основе международных таможенных документов (carnet TIR), не облагаются таможенными сборами. <br />Транспорт, который предоставляется для  перевозки грузов из Австрии, может быть попутным. Стоимость за перевозку груза в таком случае будет ниже, чем при заказе перевозки из Австрии,  у Австрийской транспортной компании.<br /><strong>Как заказать автоперевозку грузов в Австрию или из Австрии в Россию, Молдову, Казахстан, Прибалтику и др. страны.</strong><br />На нашем сайте представлен транспорт для перевозки грузов в Австрию в разных категориях грузоперевозок: это тентованный автотранспорт, рефрижераторы и изотермические фургоны, транспорт для перевозки опасных, объемных, негабаритных, тяжеловесных грузов. Транспорт по комбинированным грузоперевозкам: включая водный и воздушный транспорт для перевозки любых типов грузов из Австрии. <strong>Транспортировка сборных и попутных грузов в Австрию</strong>, услуги по железнодорожным и контейнерным  перевозкам  грузов из Австрии.<br /><strong>Срочный поиск транспорта для перевозки груза из или в Австрию. </strong><br />Для того, чтобы оперативно получить стоимость перевозки из или в Австрию из любой страны мира, вам необходимо внести ваши контактные данные в заявку на сайте, направление перевозки,  наименование груза, число погрузки. <strong>После внесения данных вам позвонит наш менеджер по организации грузоперевозок в направлении Австрия.</strong><br /><br /></p>', '', 1, 1, 0, 1, '2012-03-09 15:35:56', 62, '', '2018-01-22 09:45:14', 62, 0, '0000-00-00 00:00:00', '2012-03-09 15:35:56', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 20, 0, 32, 'Грузоперевозки из Европы, Австрия - Россия - Австрия Вена Грац Линц Зальцбург Инсбрук Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки из Европы, Австрия - Россия - Австрия Вена Грац Линц Зальцбург Инсбрук Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 0, 12719, 'robots=\nauthor='),
(36, 'Грузоперевозки    Бельгия - Россия - Бельгия   (Брюссель).Грузоперевозки из России в Бельгию, и все страны Европы.', 'belgium', '', '<p align=\"justify\"><strong>Грузоперевозки Бельгия</strong> - Россия. <strong>Перевозки из Бельгии</strong> в Россию, Казахстан, Молдову.  Брюссель Антверпен, Гент, Шарлеруа, Льеж, Брюгге, Намюр и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка груза из Бельгии в Россию, Украину, Молдову, Казахстан</strong> и в любую точку мира всеми видами транспорта (авиа, контейнерные грузоперевозки, автомобильные и железнодорожные перевозки). Чаще всего доставка грузов Бельгия - Россия - Бельгия Брюссель Антверпен, Гент, Шарлеруа, Льеж, Брюгге, Намюр осуществляется автотранспортом, так как автоперевозки Бельгия - Россия - Бельгия являются наиболее удобным видом транспортировки товаров, также перевозки Бельгия - Россия - Бельгия осуществляются по железной дороге, самолетом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Бельгии, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Бельгию.</strong><br />Страна перевозки груза Бельгия, наиболее развитые индустриальные города Бельгии это: Брюссель, Антверпен, Льеж, Брюгге, Шарлеруа, Гент, Кортрейк, Турнэ, Вервье, Мехелен.<br /><strong>Основной импорт грузов в Бельгию это</strong>: нефтепродукты, продукты химической промышленности, металлы, машины, драгоценные камни, одежда, текстиль, продукты питания, фармацевтическая продукция, продукты животного происхождения. <br /><strong>Основной экспорт грузов из Бельгии в Россию,Казахстан. Молдову, Прибалтику это</strong>: оборудование, цветные металлы, железо и сталь, уголь, обработанные алмазы, легковые автомобили, продукты питания, текстиль, пластмассы, каучук, инструменты и аппараты, растительная продукция, стройматериалы, обувь, древесина, кож.сырье. <br />Торговые отношения у Бельгии со странами ЕС, Германией, Францией, Нидерландами, Великобританией, Италией, Испанией, Швецией, Люксембургом; США, Индией, Китаем, Россией, Турцией, Японией, Украиной, Молдовой. <br /><strong>Грузоперевозки из Бельгии в Россию, Казахстан, Беларусь, Молдову</strong> возможна различными транспортными средствами: автомобильным, морским, железнодорожным, воздушным транспортом. По состоянию на начало 2013 года грузовой автопарк Бельгии насчитывал 716тыс. грузовиков. Объем автотранспортных перевозок в 2012 году составил 298,5 млн. тонн. Грузооборот железнодорожного транспорта - 36 млн. тонн, объем морских грузоперевозок - 231 млн. тонн. Один из крупнейших портов мира Антверпен в 2012 году принял 184 млн тонн грузов, количество заходов морских судов  составило14 тыс. 556 ед. <br />Грузооборот крупнейшего международного аэропорта Бельгии в Льеже составил 576,6 тыс. тонн, что является седьмым показателем в Европе.<br /><strong>Таможенное оформление грузов при перевозках из/в Бельгии</strong> соответствует таможенным нормам и положениям Евросоюза. За въезд на территорию Бельгии, временное хранение груза на складе и транзит грузов таможенные пошлины не снимаются. Для товаров из третьих стран, предназначаемых для внутреннего потребления в ЕС, средневзвешенный показатель ввозных таможенных сборов за очистку груза составляет 2,39% от стоимости товара. Процесс таможенной очистки грузов занимает 1-2 часа, оплата таможенных платежей возможна спустя месяц после подачи декларации. Таможенное оформление грузов, следующих в Бельгию, предполагает максимальную прозрачность, быстрый выпуск товаров, отсутствие неизвестных таможенных платежей. <br /><strong>Транспорт который предоставляется для перевозки грузов из Бельгии</strong>, к примеру, Бельгия-Россия, Бельгия-Казахстан, Бельгия-Молдова, Бельгия-Украина, может быть попутными, из других стран. Цена за доставку груза в таком случае будет ниже, чем при заказе перевозки из Бельгии у бельгийской транспортной компании.<br /><strong>Как осуществить заказ транспорта для  доставки грузов в/из Бельгии в страны СНГ.</strong><br />На нашем транспортном сайте можно осуществить быстрый заказ транспорта для перевозки грузов в Бельгию в разных категориях грузоперевозок: это тентованный автотранспорт, рефрижераторы и изотермические фургоны. Транспортные услуги морских и железнодорожных контейнерных перевозок грузов из Бельгии. Автотранспорт для перевозки опасных, негабаритных объемных, сборных и попутных грузов в Бельгию. Транспорт для перевозок  любых грузов, с использованием воздушного транспорта.  <br /><strong>Быстрый поиск транспорта для перевозки груза из Бельгии в Россию, Украину, Молдову.</strong><br />Для заказа перевозки грузов из Бельгии, вам необходимо внести ваши контактные данные, направление перевозки,  наименование груза, число погрузки. <br />После внесения данных вам  сообщат <strong>стоимость грузоперевозки, и возможность перевезти ваш груз в направлении Бельгия.</strong><br /><br /></p>', '', 1, 1, 0, 1, '2012-03-09 16:06:11', 62, '', '2013-07-21 08:22:34', 62, 0, '0000-00-00 00:00:00', '2012-03-09 16:06:11', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 31, 'Грузоперевозки Бельгия - Россия - Бельгия Брюссель Антверпен Гент Шарлеруа Льеж Брюгге Намюр Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Бельгия - Россия - Бельгия Брюссель Антверпен Гент Шарлеруа Льеж Брюгге Намюр Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 0, 10984, 'robots=\nauthor='),
(37, 'Грузоперевозки  Венгрия - Россия - Венгрия   (Будапешт).Грузоперевозки из России в Венгрию.', 'hungary', '', '<p align=\"justify\"><strong>Грузоперевозки Венгрия - Россия.Перевозки из Венгрии В Молдову-Кишинёв, Украину-Киев, Литву-Вильнюс, Казахстан-Актау, Приднестровье -Тирасполь.</strong> Будапешт, Деберцен, Мишкольц, Сегед, Печ, Дьёр и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /></strong></h1>\r\n<h2><strong> Заказать перевозку направление Венгрия</strong></h2>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка груза из Венгрии в Россию, Украину, Молдову, Казахстан и обратно в Венгрию, всеми видами транспорта </strong>(авиа, контейнерные грузоперевозки, автомобильные и железнодорожные перевозки). Чаще всего доставка грузов Венгрия - Россия - Венгрия Будапешт, Деберцен, Мишкольц, Сегед, Печ, Дьёр и др. осуществляется автотранспортом, так как автоперевозки Венгрия - Россия - Венгрия являются наиболее удобным видом транспортировки товаров, также перевозки Венгрия - Россия - Венгрия осуществляются по железной дороге, самолетом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Венгрии, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Венгрию.</strong><br />Страна перевозки груза Венгрия, наиболее развитые индустриальные города Венгрии это: <br />Будапешт, Дебрецен, Мишкольц, Сегед, Биаторбадь, Тисауйварош, Дунауйварош, Кечкемет, Секешфехервар. <br /><strong>Основной импорт грузов в Венгрию это:</strong> нефтепродукты, автомобили, запчасти, электронное оборудование и аппаратура, инструменты, пластмассы, сырье, продовольственные товары, лекарственные средства.<br /><strong>Основной экспорт грузов из Венгрии в Россию, Украину, Молдову, Казахстан это</strong>: машины и электрооборудование, промышленные товары, нефтепродукты, электроника, запчасти, провода, холодильники, насосы, продукты питания, технические культуры. <br />Торговые отношения у Венгрии с Германией, Австрией, Словакией, Нидерландами, Францией, Польшей, Италией, Молдовой, Румынией, Украиной, Казахстаном, Китаем, США, Россией. <br /><strong>Перевозки грузов в/из Венгрии возможна всеми распространенными видами транспорта</strong>: автомобильным, железнодорожным, водным, воздушным. На автомобильные и железнодорожные грузоперевозки по расчетам в тонно-километрах приходится 66% и 30% всего грузооборота Венгрии. Авиа обслуживание грузов обеспечивают пять международных аэропортов, крупнейший из них в Будапеште в 2012 году обработал 93,123 тонн грузов. Важную роль в международных грузоперевозках из Венгрии играет речной транспорт, курсирующий по Дунаю. <br /><strong>Таможенное оформление грузов при перевозках из/в Венгрию </strong>проходит с минимальными административными барьерами. Некоторые таможенные процедуры, как подача декларации можно производить в электронном виде. После перехода Венгрии на Общий таможенный тариф ЕС уровень таможенного обложения в Венгрии составил 1,53% по промышленным товарам и 2,2% - по аграрной продукции.<br />Транспортировка груза из Венгрии в Россию, Украину, Молдову, и др. страны может быть попутной. Цена грузоперевозки в таком случае будет ниже, чем при заказе перевозки из Венгрии у венгерской транспортной компании.<br /><strong>Как заказать транспортировку и доставку грузов в/из Венгрии в Россию, Украину, Молдову, Прибалтику, Казахстан.</strong><br />На сайте нашей транспортной компании можно сделать заказ для перевозки грузов из Венгрии в Россию. Украину, Молдову, и другие страны, в различных категориях грузоперевозок: это  автотранспорт тенты, рефрижераторы и изотермические фургоны. Автоперевозки из Венгрии всех типов грузов – опасных, негабаритных, объемных, жидких, насыпных грузов. Транспорт для сборных грузов, мультимодальные, авиа перевозки грузов в и из Венгрии. Контейнерные перевозки из Венгрии с использованием железнодорожного и речного транспорта. <br /><strong>Заявка on-line для заказа  перевозки груза из или в Венгрию из России, Украины, Молдовы.</strong> <br />Для того, чтобы быстро получить стоимость перевозки из или в Венгрию, вам необходимо внести ваши контактные данные, направление перевозки,  наименование груза, число погрузки. <br />После внесения данных  мы вам  сообщим <strong>стоимость перевозки вашего груза в направлении Венгрия.</strong><br /><br /></p>', '', 1, 1, 0, 1, '2012-03-09 16:26:05', 62, '', '2013-08-11 17:04:11', 62, 0, '0000-00-00 00:00:00', '2012-03-09 16:26:05', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 30, 'Грузоперевозки Венгрия - Россия - Венгрия Будапешт Деберцен Мишкольц Сегед Печ Дьёр Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Венгрия - Россия - Венгрия Будапешт Деберцен Мишкольц Сегед Печ Дьёр Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 0, 11787, 'robots=\nauthor='),
(38, 'Грузоперевозки    Великобритания - Россия (Лондон).Перевозки из России в Великобританию-Англию.', 'greatbritain', '', '<p align=\"justify\">Грузоперевозки Великобритания - Россия - Великобритания Англия Ирландия Шотландия Уэльс Лондон, Бирмингем, Манчестер, Глазго  и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка груза из Великобритании в Россию, Украину, Молдову, Румынию, Казахстан и др. страны, всеми видами транспорта</strong> (авиа, контейнерные грузоперевозки, автомобильные и железнодорожные перевозки). Чаще всего доставка грузов Великобритания - Россия - Великобритания Англия Ирландия Шотландия Уэльс Лондон, Бирмингем, Манчестер, Глазго осуществляется автотранспортом, так как автоперевозки Великобритания - Россия - Великобритания являются наиболее удобным видом транспортировки товаров, также перевозки осуществляются по железной дороге, самолетом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Великобритании, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>\r\n<p><strong>Как найти транспортную компанию по перевозкам  груза из/в Великобританию.</strong><br />Страна перевозки груза Великобритания, наиболее развитые индустриальные города Великобритании это: Лондон, Бирмингем, Глазго, Ливерпуль, Лидс, Манчестер, Ньюкасл, Белфаст, Кардифф. Бристоль. <br /><strong>Основной импорт грузов в Великобританию</strong> это: нефтепродукты, минералы, химикаты, машины и оборудование, транспортные средства, зерновые культуры, молочные продукты, сахар, мясо. <br /><strong>Основной экспорт грузов из Великобритании</strong> это: нефтепродукты, химическая продукция, машины и оборудование, станки, полезные ископаемые, цветные металлы, грузовые автомашины, продовольственные товары, сельскохозяйственное сырье, текстильная продукция, обувь. <br />Торговые отношения у Великобритании(Англии) с Германией, Нидерландами, Францией, Швейцарией, Ирландией, Бельгией, Италией, Украиной, Молдовой, Испанией, Норвегией, США, Японией, Россией, Китаем. <br /><strong>Грузоперевозки  в/из Великобритании-Англии в Россию, Украину, Молдову, и другие страны</strong>, осуществляется автомобильным, морским, железнодорожным, воздушным транспортом. На грузовой автомобильный транспорт Великобритании приходится 62% от общего объема грузоперевозок. В Великобритании зарегистрировано порядка 500 тыс. грузовых автомобилей массой более 3,5 тонн, общее число транспортных компаний составляет более 100 тыс. Важную роль играет морской транспорт – в Великобритании построено более 70 международных морских торговых портов. Ежегодно перевалку через них проходят более 565 млн. тонн грузов. Около 2млн. тонн грузов ежегодно обслуживаются в аэропортах Великобритании, из них половина – британскими авиакомпаниями.  <br /><strong>Таможенное оформление грузов при перевозках из/в Великобританию(Англии)</strong> отличается лояльным порядком декларирования товаров. В зависимости от категории груза, его растаможка грузов происходит исходя из объема, веса или первоначальной стоимости. Регулирование импорта грузов в Великобританию осуществляется на основе Единого таможенного тарифа ЕС, системы статистической номенклатуры, системы описания и кодирования ввозимых товаров. Ставки таможенных пошлин на товары из-за пределов Евросоюза аналогичны принятым в других странах-членах ЕС, тогда как товары, происходящие из стран ЕС импортируются беспошлинно. На ряд товаров растительного и животного происхождения при импорте требуется наличие лицензии.  <br /><strong>Транспорт, который  осуществляет перевозки грузов из Великобритании-Англии,</strong> может быть попутным. Стоимость за доставку груза в таком случае будет ниже, чем при заказе перевозки из Великобритании у британской транспортной компании.<br />Как заказать перевозку груза из Великобритании в Россию, Украину, Молдову и др. Страны.<br />На сайте нашей транспортной компании представлен список транспорта для перевозки грузов из Великобритании в различных категориях грузоперевозок: это тентованный автотранспорт, рефрижераторы и изотермические фургоны. Перевозки из Англии автотранспортом грузов всех категорий: опасных, негабаритных, объемных, тяжеловесных грузов. Транспорт, осуществляющий доставку сборных и попутных грузов из России, Украины, молдовы в Великобританию, а также услуги по перевозкам грузов из Великобритании, по схеме «от двери к двери» с применением различных транспортных средств: морского, железнодорожного, авиа транспорта. <br /><strong>Быстрый заказ перевозки груза из или в Великобританию( Англию). </strong><br />Для оперативного получения стоимости за перевозку из Великобритании, вам необходимо внести ваши контактные данные, направление перевозки,  наименование груза, число погрузки. <br />После отправки данных вам сообщат<strong> стоимость перевозки из Великобритании в страну перевозки груза.</strong>.<br /><br /></p>', '', 1, 1, 0, 1, '2012-03-09 16:28:56', 62, '', '2013-07-13 19:55:14', 62, 0, '0000-00-00 00:00:00', '2012-03-09 16:28:56', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 29, 'Грузоперевозки Великобритания - Россия - Великобритания Англия Ирландия Шотландия Уэльс Лондон Бирмингем Манчестер Глазго перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Великобритания - Россия - Великобритания Англия Ирландия Шотландия Уэльс Лондон Бирмингем Манчестер Глазго Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 0, 22435, 'robots=\nauthor='),
(39, 'Грузоперевозки из Европы, Германия - Россия.Перевозки из Германии в Казахстан, Молдову, Узбекистан. ', 'germany', '', '<p align=\"justify\"><strong>Грузоперевозки из Европы, Германия - Россия</strong>, <strong>перевозки</strong> <strong>Германия</strong>- <strong>Казахстан, Германия-Молдова. Германия:</strong> Берлин,  Гамбург, Мюнхен, Кельн, Франкфурт-на-Майне,  Дортмунд, Эссен, Штутгарт, Дюссельдорф, Бремен, Ганновер и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /></strong></h1>\r\n<h2><strong> Заявка для заказа перевозки в направлении из Европы, из Германии.</strong></h2>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка груза из Германии в Россию. Германия-Казахстан, Германия -Молдова и </strong>в любую точку мира всеми видами транспорта (авиа, контейнерные грузоперевозки, автомобильные и железнодорожные перевозки). Чаще всего доставка грузов Германия - Россия - Германия Берлин, Гамбург, Мюнхен, Кельн, Франкфурт-на-Майне, Дортмунд, Эссен, Штутгарт, Дюссельдорф, Бремен, Ганновер осуществляется автотранспортом, так как автоперевозки Германия - Россия - Германия являются наиболее удобным видом транспортировки товаров, также перевозки Германия - Россия - Германия осуществляются по железной дороге, самолетом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Германии, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Германию.</strong><br />Страна перевозки груза Германия, наиболее развитые индустриальные города Германии это: Берлин, Гамбург, Мюнхен, Кёльн, Франкфурт-на-Майне, Бремен, Бранденбург, Вольфсбург, Ганновер, Штутгарт, Нюрнберг.<br /><strong>Основной импорт грузов в Германию из России, Беларуси, Молдавии,Украины, Литвы, Латвии </strong>это: нефтепродукты, химикаты, автомобильные компоненты, офисная и вычислительная техника, продукты питания, изделия из тканей, электронные компоненты, металлоизделия, пластмассы, изделия из древесины.<br /><strong>Основной экспорт грузов из Германии в Россию, Казахстан, Украину, Молдавию, Румынию, страны Балтии это</strong>: легковые автомобили и компоненты, пластмассовые изделия, контрольно-измерительная техника, химические изделия, грузовики, электроника, фармацевтические изделия.  <br />Торговые отношения  у Германии с Польшей, Францией, Нидерландами, Китаем, США, Великобританией, Норвегией, Италией, Бельгией, Австрией, Испанией, Россией, Молдовой, Румынией.<br /><strong>Для грузоперевозок из Германии </strong>в Россию, Казахстан, Беларусь, Молдову, Украину доступны все существующие виды транспорта: автомобильный, водный, железнодорожный, воздушный.<br />Объем грузоперевозок автотранспортом в 2012 году составил 3млрд 107,1 тонн, железнодорожным транспортом - 312,1млн тонн, речным - 203,9млн тонн, морским - 259,5млн тонн, воздушным - 3,4млн тонн. Крупнейший речной порт Германии находится в Гамбурге, а в Франкфурте-на-Майне распложен крупнейший аэропорт, занимающий второе место в Европе по грузоперевозкам.<br /><strong>Таможенное оформление грузов при перевозках из/в Германию</strong> осуществляется согласно положениям Таможенного кодекса ЕС, постановления об осуществлении таможенной очистки, с применением  Единого (интегрированного) таможенного тарифа ЕС (TARIC). Таможенные пошлины, установленные в тарифе, применяются только при импорте в Германию товаров из третьих стран. При перевозках грузов в свободном обращении из других стран ЕС таможенные пошлины не взимаются. Грузы, ввозимые в Германию из третьих стран, должны сопровождаться таможенной декларацией, представленной в письменном виде, а также счет-фактурой в двух экземплярах. Заявление для осуществления таможенной очистки грузов в Германии подается в электронном виде импортером и/или уполномоченным лицом с использованием системы таможенного администрирования «Атлас» (German Customs Administration\'s ATLAS System).<br /><strong>Транспорт для перевозки грузов из Германии,</strong> например, Германия-Россия, Германия -Казахстан, Германия -Молдова, Германия -Беларусь, может следовать из других стран. Стоимость попутных грузоперевозок  гораздо ниже, чем заказ доставки груза из Германии у немецкой транспортной компании.<br /><strong>Как заказать перевозку груза в/из Германии в страны СНГ.</strong><br />На нашем транспортном сайте вы можете выбрать необходимую вам категорию международных грузоперевозок и заказать транспорт для перевозки грузов из/в Германию. Автомобильные перевозки тентами, рефрижераторами, изотермическими фургонами, другими типами полуприцепов и прицепов, в том числе для опасных, объемных, длинномерных, тяжеловесных грузов. Транспорт для доставки сборных и попутных грузов из Германии. Контейнерные перевозки, доставка грузов речным, морским, воздушным транспортом по схеме «от двери к двери». <br /><strong>Найти транспорт для перевозки груза из Германии в Россию, Украину, Беларусь, Молдову</strong>, <strong>Казахстан</strong> и другие страны<br />Для того, чтобы быстро найти и заказать транспорт для перевозки грузов из Германии введите ваши контактные данные, характеристику и габариты груза, направление перевозки, дату отгрузки. <br />После того, как вы отправите заполненные данные, оператор свяжется с вами и сообщит<strong> стоимость грузоперевозки в направлении Германия.</strong><br /><br /><br /></p>', '', 1, 1, 0, 1, '2012-03-09 16:33:01', 62, '', '2018-01-22 09:47:00', 62, 0, '0000-00-00 00:00:00', '2012-03-09 16:33:01', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 18, 0, 28, 'Грузоперевозки Германия - Россия - Германия Берлин Гамбург Мюнхен Кельн Франкфурт-на-Майне Дортмунд Эссен Штутгарт Дюссельдорф Бремен Ганновер Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Германия - Россия - Германия Берлин Гамбург Мюнхен Кельн Франкфурт-на-Майне Дортмунд Эссен Штутгарт Дюссельдорф Бремен Ганновер Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 0, 21933, 'robots=\nauthor='),
(40, 'Грузоперевозки из Греции в Россию.Перевозки Россия-Греция (Афины).Перевозки грузов из Греции в Россию. Автоперевозки Греция-Россия, Греция-Молдова, Греция-Казахстан.', 'greece', '', '<p align=\"justify\"><strong>Грузоперевозки Греция-Россия - Греция. Перевозки из Греции в Россию, доставка грузов Греция-Молдова, Греция-Украина, Греция-Казахстан,</strong> Перевозка грузов из Греции города: Афины, Салоники, Пиреи, Патры, Ираклион, Ларисса и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /></strong></h1>\r\n<p><strong> <span style=\"font-family: verdana,geneva;\"><span style=\"font-size: large;\">Заказать перевозку в направлении из/в Греция.</span></span></strong></p>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка груза из Греции в Россию, перевозки из Греции в любую точку мира всеми видами транспорта </strong>(авиа, контейнерные грузоперевозки, автомобильные и железнодорожные перевозки). Чаще всего доставка грузов Греция - Россия - Греция Афины, Салоники, Пиреи, Патры, Ираклион, Ларисса осуществляется автотранспортом, так как автоперевозки Греция - Россия - Греция являются наиболее удобным видом транспортировки товаров, также перевозки Греция - Россия - Греция осуществляются по железной дороге, самолетом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Греции, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Грецию.</strong><br />Страна перевозки груза Греция, наиболее развитые индустриальные города Греции это: Афины, Салоники, Пирей, Патры, Волос, Ираклион, Касторья. <br /><strong>Основной импорт грузов в Грецию</strong> это: нефтепродукты, машины, транспортные средства, топливо, химические вещества, потребительские товары, продовольствие.<br /><strong>Основной экспорт грузов из Греции в Россию, Молдову, Украину, Беларусь, Казахстан  это</strong>: промышленные товары, химические вещества, сырье, ткани, металлы, цемент, сельхозпродукты, табак, текстиль, оливковое масло, овощи, фрукты, консервированные продукты, зерновые культуры, продукты питания, напитки. Торговые отношения у Греции с Италией, Германией, Болгарией, Кипром, США, Великобританией, Румынией, Россией, Китаем, Францией, Нидерландами. <br /><strong>Перевозки грузов из Греции в Россию, Казахстан, Украину, Беларусь, Молдову</strong> возможны всеми распространенными видами транспорта: автомобильным, морским, железнодорожным, воздушным транспортом. 60% внутренних грузовых перевозок приходится на автотранспорт. Важная роль принадлежит морским грузоперевозкам - торговый флот Греции занимает одно из первых мест в мире. Большое значение играет авиатранспорт – в стране функционируют 22 международных аэропорта.  <br /><strong>Таможенное оформление грузов при перевозках из/в Грецию</strong> осуществляется аналогично другим странам ЕС. Товары, перевозимые из стран ЕС не облагаются таможенными пошлинами или ограничениями. Для третьих стран действует единый таможенный тариф. Необходимые товаросопроводительные документы при таможенном оформлении груза в Греции это: коммерческий счет-фактура: оригинал и копии, сертификат происхождения товара. Транспортные документы: коносамент, накладная CMR. При наличии всей документации и уплате таможенных платежей, таможенное оформление грузов в Греции осуществляется в течение нескольких рабочих часов, как и в других странах ЕС.<br /><strong>Транспорт, предоставляемый для перевозки грузов из Греции, например Греция-Россия, Греция Казахстан, Греция - Молдова, Греция-Украина, Греция-Беларусь,</strong> может быть попутным, из третьих стран. Стоимость грузоперевозки в таком случае будем ниже, чем при заказе доставки груза из Греции у местной транспортной компании.<br /><strong>Что нужно сделать, чтобы осуществить заказ перевозки грузов в/из Греции.</strong><br />Используя он-лайн заказ на нашем  транспортном сайте вы можете заказать любой транспорт для перевозки грузов из Греции самым быстрым способом. На сайте представлены все категории международных грузоперевозок: доставка грузов тентованным автотранспортом, рефрижераторами и изотермическими фургонами. Морские контейнерные перевозки, комбинированные перевозки грузов в Грецию автомобильным, железнодорожным и авиатранспортом. Услуги транспорта  по перевозкам опасных, негабаритных и других грузов из Греции. Сборные и попутные грузоперевозки для небольших партий товаров. Быстрый поиск транспорта прямо на сайте, для перевозки груза из Греции в Россию, Украину, Беларусь, Молдову, Литву, Латвию, Казахстан<br /><strong>Чтобы найти и заказать транспорт для перевозки грузов из Греции</strong>, вам надо заполнить форму заявки: ввести контактные данные, указать направление перевозки, описание груза и число погрузки. <br />После того как ваша заявка будет обработана, <strong>наши сотрудники сообщат вам стоимость и другие детали грузоперевозки по направлению Греции.</strong><br /><br /><br /></p>', '', 1, 1, 0, 1, '2012-03-09 16:41:36', 62, '', '2013-07-31 19:12:49', 62, 0, '0000-00-00 00:00:00', '2012-03-09 16:41:36', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 41, 0, 27, 'Грузоперевозки Греция - Россия - Греция Афины Салоники Пиреи Патры Ираклион Ларисса Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Греция - Россия - Греция Афины Салоники Пиреи Патры Ираклион Ларисса Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 0, 17710, 'robots=\nauthor='),
(41, 'Грузоперевозки    Дания - Россия - Дания   (Копенгаген)', 'denmark', '', '<p align=\"justify\">Грузоперевозки Дания - Россия - Дания Копенгаген, Орхус, Оденсе, Эсбьерг, Раннерс, Коллинг и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p>Доставка груза из Дании в любую точку мира всеми видами транспорта (авиа, контейнерные грузоперевозки, автомобильные и железнодорожные перевозки). Чаще всего доставка грузов Дания - Россия - Дания Копенгаген, Орхус, Оденсе, Эсбьерг, Раннерс, Коллинг осуществляется автотранспортом, так как автоперевозки Дания - Россия - Дания являются наиболее удобным видом транспортировки товаров, также перевозки Дания - Россия - Дания осуществляются по железной дороге, самолетом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Дании, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>', '', 1, 1, 0, 1, '2012-03-09 16:43:29', 62, '', '2012-03-20 08:14:05', 62, 0, '0000-00-00 00:00:00', '2012-03-09 16:43:29', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 26, 'Грузоперевозки Дания - Россия - Дания Копенгаген Орхус Оденсе Эсбьерг Раннерс Коллинг Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Дания - Россия - Дания Копенгаген Орхус Оденсе Эсбьерг Раннерс Коллинг Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки