а контейнерные грузоперевозки авто доставка товара транспортировка груза морем самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Япония - Россия - Япония Токио Киото Осака Нагоя Кобэ Иокогамаи Нагасаки Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза морем самолетом по железной дороге автотранспортом перевозки груза', 0, 9112, 'robots=\nauthor='),
(60, 'Грузоперевозки Китай - Россия - Китай   (Пекин).Перевозки из Китая в Россию, Украину, Молдову, Казахстан, Азербайджан.', 'china', '', '<p align=\"justify\"><strong>Грузоперевозки Китай - Россия - Китай. Перевозки из Китая в Россию, Украину, Молдову. Доставка грузов Китай-Азербайджан, Армения, Китай-Казахстан</strong>.Китай города: Пекин, Шанхай, Сиань, Харбин, Гуанчжоу, Далянь и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /></strong></h1>\r\n<h2><strong> Заявка для заказа перевозки грузов из Китая</strong></h2>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка груза из Китая в любую точку мира всеми видами транспорта</strong> (морские, авиа, контейнерные грузоперевозки, комбинированные с автомобильными и железнодорожными перевозками). Чаще всего доставка грузов Китай - Россия - Китай ( Пекин, Шанхай, Сиань, Харбин, Гуанчжоу, Далянь - Москва) осуществляется морскими или воздушными видами транспорта, так как перевозки морем или самолетом Китай - Россия - Китай являются наиболее удобным видом транспортировки товаров, часто грузовые перевозки Китай - Россия - Китай осуществляются мультимодальным способом в комбинации с транспортировкой груза по железной дороге или автотранспортом. Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара из Китая, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Китай.</strong><br />Перевозка  груза из Китая, наиболее развитые индустриальные города Китая это: Пекин, Шанхай, Сиань, Харбин, Гуанчжоу, Далянь, Чунцин, Тяньцзинь. <br /><strong>Основной импорт грузов в Китай это</strong>: черные металлы, нефтепродукты, химикаты, пластмассы, автомобили, тракторы, запчасти, станки, технологическое оборудование, электрические машины, аппараты, древесный уголь, масличные семена и плоды, хлопок, пряжа, ткань, кожа, бумага, картон.<br /><strong>Основной экспорт грузов из Китая в Россию, Украину, Молдову, Беларусь, Казахстан, Азербайджан, Узбекистан это: </strong>электрические машины и оборудование, нефтепродукты, изделия из черных металлов, никель, медь, пластмассы, транспортные средства, мебель, матрацы, обувь, игрушки, спортивный инвентарь, изделия из кожи, хлопок, пряжа, древесина. <br />Торговые отношения  у Китая с США, Японией, Гонконгом, Кореей, Тайванем, Германией, Австралией, Малайзией, Сингапуром, Индией, Россией, Великобританией, Италией, Францией. <br /><strong>Для грузоперевозок из Китая в Россию, Казахстан, Беларусь, Молдову, Украину</strong> используются все распространенные транспортные средства: автомобильный, водный, железнодорожный, воздушный транспорт. Общий объем грузоперевозок в Китае в 2011 году составил 31,53 млрд. тонн. Из них автомобильным транспортом было перевезено 24,25 млрд. тонн грузов, железнодорожным - 3,64 млрд. тонн, воздушным - 5,57 млрд. тонн, водным - 3, 64 млрд. тонн грузов. <br /><strong>Таможенное оформление грузов при перевозках из/в Китая</strong> осуществляется согласно таможенному законодательству КНР. Для всех грузов, экспортируемых или импортируемых в Китай, требуется обязательное указание гармонизированных кодов товаров в таможенной декларации и правильное, подробное описание грузов в сопроводительных документах. Также все импортеры и экспортеры в  Китае должны быть зарегистрированы в Таможенных органах для присвоения Импортного и Экспортного Таможенного Регистрационного кода (Кодекс CR). Данный код CR должен указываться в таможенных декларациях. Четкое соблюдение данных правил поможет ускорить проведение таможенного оформления товаров из Китая.<br /><strong>Транспорт для перевозки грузов из Китая, например, Китай-Россия, Китай -Казахстан, Китай -Молдова, Китай -Беларусь, перевозка из Китая в Узбекистан или Азербайджан,</strong> может совершать попутный транспорт из стран импортёров. Транспортные услуги попутного транспорта, гораздо дешевле, чем платить китайской транспортной компании полную стоимость за перевозку груза из Китая. <br /><strong>Транспорт для перевозки груза в/из Китая в страны СНГ</strong>.<br /><strong>Способы доставки грузов из Китая</strong>: автомобильные перевозки тентами, рефрижераторами или изотермическими фургонами, перевозка опасных, негабаритных, объемных, тяжеловесных грузов из Китая. Услуги транспорта  по организации морских и железнодорожных контейнерных перевозок из Китая, включая мультимодальные перевозки с применением авиатранспорта. Доставка сборных и попутных грузов из Китая по схеме «от двери к двери». <br /><strong>Оперативно найти транспорт для перевозки груза из Китая в Россию, Украину, Беларусь, Молдову, Казахстан, </strong>можно через форму заявки на нашем сайте: введите ваши контактные данные, описание груза, направление доставки, число погрузки. Как только ваши данные будут обработаны, наши сотрудники свяжутся с вами и сообщат стоимость грузоперевозки, а вы получите <strong>возможность доставить груз в направлении Китай.</strong><br /><br /></p>', '', 1, 1, 0, 3, '2012-03-10 08:49:18', 62, '', '2013-08-22 20:03:18', 62, 0, '0000-00-00 00:00:00', '2012-03-10 08:49:18', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 6, 'Грузоперевозки Китай - Россия - Китай Пекин Шанхай Сиань Харбин Гуанчжоу Далянь Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза морем самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Китай - Россия - Китай Пекин Шанхай Сиань Харбин Гуанчжоу Далянь Россия Москва перевозки грузовые автомобильные железнодорожные жд морские авиа контейнерные грузоперевозки авто доставка товара транспортировка груза морем самолетом по ж