(68, 'Грузоперевозки по России ', 'russia', '', '<p align=\"justify\">Наша компания осуществляет межрегиональные и междугородние грузовые перевозки по России от Калининграда до Дальнего Востока:<br /> Автомобильные перевозки по России и из России.Железнодорожные перевозки по России. Морские перевозки по России.Воздушные перевозки по России.<br /> <strong>Нашими преимуществами при перевозках из/по России являются :</strong><br /> Стабильная политика при расчете стоимости перевозки, разумные тарифы<br /> Четкое формирование маршрутов и соблюдение сроков доставки<br /> Разработанная система доставки грузов по России «под ключ», «от двери до двери»<br /> Осуществление грузоперевозок с помощью современных транспортных средств и спецтехники<br /> Индивидуальный подход к каждому клиенту.<br /> <strong>Тарифы на перевозки из/по России</strong> зависят от вида товара, маршрута, выбора транспортных средств, пункта назначения и пункта отправки. Наши менеджеры подберут оптимальный маршрут для перевозки Вашего груза по России, рассчитают наиболее экономичную стоимость перевозки груза по России, организуют погрузочно-разгрузочные работы, оформят соответствующую документацию. <br /> <strong>Транспортные перевозки по России, осуществляемые нашей компанией </strong>также включают в себя следующее: перевозка негабаритных грузов по России, перевозка сборных грузов по России, интермодальные перевозки в России и т.д. Мы занимались перевозкой по России самых различных грузов: продуктов питания (пищевых грузов),  стройматериалов, металла, металлических профилей, труб, леса, спецтехники, автомобилей, техники, оборудования, станков, запасных частей, угля, железной руды, бытовой химии и многих других. Мы также занимаемся перевозками грузов, требующих повышенной безопасности или сопровождения, например перевозка автомобилей по России, ценных грузов и т.п. Многолетний опыт грузоперевозок позволяет нам сотрудничать на долгосрочной основе со многими крупными предприятиями России.</p>\r\n<p align=\"justify\"> </p>\r\n<p align=\"justify\"><strong>Таким образом, наша транспортно-экспедиторская компания осуществляет грузовые перевозки  по всей России</strong> (автомобильные перевозки, железнодорожные, воздушные, перевозки  речные). Все виды грузоперевозок: автоперевозки, жд перевозки, авиа, перевозки  на речном транспорте по России осуществляются во всех направлениях: Северо –  Запад, Юг, Центр страны. Мы также осуществляем доставку грузов на Урал, Сибирь,  Приволжский округ, Дальний Восток. <br /> <strong>Северо-Запад</strong> : Архангельская область, Вологодская область,  Калининградская область, Ленинградская область, Мурманская область,  Новгородская область, Псковская область, Республика Карелия, Республика Коми <br /> <strong>Юг: </strong>Республика Адыгея, Республика Калмыкия,  Карачаево-Черкессия, Краснодарский край, Ставропольский край, Астраханская  область, Волгоградская область, Ростовская область <br /> <strong>Центр</strong>: Белгородская область, Брянская область, Владимирская  область, Воронежская область, Ивановская область, Калужская область,  Костромская область, Курская область, Липецкая область, Московская область,  Орловская область, Рязанская область, Смоленская область, Тамбовская область,  Тверская область, Тульская область, Ярославская область  <br /> <strong>Урал:</strong> Курганская область, Свердловская область, Тюменская  область, Ханты-Мансийский АО, Ямало-Ненецкий АО, Челябинская область <br /> <strong>Сибирь:</strong> Республика Алтай, Республика Бурятия, Республика  Тува, Республика Хакасия, Алтайский край, Красноярский край, Иркутская область,  Кемеровская область, Новосибирская область, Омская область, Томская область,  Читинская область, Агинский Бурятский АО, Таймырский АО, Усть-Ордынский  Бурятский АО <br /> <strong>Приволжский округ</strong>: Республика Башкортостан, Республика Марий  Эл, Республика Мордовия, Республика Татарстан, Республика Удмуртия, Республика  Чувашия, Кировская область, Нижегородская область, Оренбургская область,  Пензенская область, Пермская область, Самарская область, Саратовская область,  Ульяновская область, Коми-Пермяцкий АО<br /> <strong>Дальний Восток:</strong> Республика Саха ( Якутия ), Приморский край,  Хабаровский край, Амурская область, Камчатская область, Сахалинская область,  Еврейская АО, Корякский АО, Чукотский АО</p>\r\n<p align=\"justify\"> </p>\r\n<p> </p>\r\n<p> </p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>', '', 1, 1, 0, 2, '2012-03-10 10:13:23', 62, '', '2013-10-01 17:31:29', 62, 0, '0000-00-00 00:00:00', '2012-03-10 10:13:23', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 18, 0, 75, 'Грузовые перевозки по России, межрегиональные и междугородние грузовые перевозки, стоимость, перевозки груза по России, стоимость перевозки по России, тарифы на перевозки по России, перевозка негабаритных грузов по России, транспортные перевозки по России, перевозка сборных грузов по России, перевозка автомобилей по России, перевозка мяса по России', 'Международная транспортная компания предлагает: грузовые перевозки по России межрегиональные и междугородние стоимость перевозки груза по России тарифы на перевозка негабаритных грузов по России транспортные перевозки сборных грузов по России ', 0, 6409, 'robots=\nauthor='),
(69, 'Грузоперевозки    Мурманск и города    Мурманской области', 'murmansk', '', '<p align=\"justify\">Грузоперевозки Москва   - Мурманск и города Мурманской области: Апатиты,  Заозерск, Заполярный, Кандалакша, Кировск, Ковдор, Кола, Мончегорск,  Оленегорск, Островной, Полярные Зори, Полярный, Скалистый, Снежногорск - Москва (из любой страны, в любую точку мира)  Высоконадежный транспорт Камаз, Маз, Iveco (Ивеко), Scania (Скания), Renault (Рено), Volvo  (Вольво), Man (Ман) и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p>Доставка груза Мурманск (из любой страны в любую точку мира), всеми видами транспорта (автомобильные и железнодорожные перевозки, речные, авиаперевозки). Чаще всего грузовые перевозки из г. Мурманск и города Мурманской области: Апатиты, Заозерск, Заполярный, Кандалакша, Кировск, Ковдор, Кола, Мончегорск, Оленегорск, Островной, Полярные Зори, Полярный, Скалистый, Снежногорск и др. осуществляется автотранспортом, так как автоперевозки по России являются наиболее удобным видом транспортировки товаров, также перевозки осуществляются по железной дороге, самолетом. Все виды грузоперевозок осуществляются на высоконадежном транспорте. Например,  при автоперевозках в распоряжении компании находятся автотранспортные средства с различной грузоподъемностью и объемом марок Камаз, Маз, Iveco (Ивеко), Scania (Скания), Renault (Рено), Volvo (Вольво), Man (Ман) (автопоезда, еврофуры, тентованные фургоны, рефрижераторы, контейнеровозы) Жд перевозки осуществляются в крытых вагонах, полувагонах, на специальных платформах, вагонах – термосах, вагонах – рефрижераторах. Мы также можем перевезти Ваш груз целым контейнером (контейнерная перевозка). Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара Мурманск и города Мурманской области: Апатиты, Заозерск, Заполярный, К