(142, 'Грузоперевозки    Анадырь и города Чукотского автономного округа', 'anadyr', '', '<p align=\"justify\">Грузоперевозки Москва   - Анадырь и города Чукотского автономного  округа  - Москва (из любой страны, в любую точку мира)  Высоконадежный транспорт Камаз, Маз, Iveco (Ивеко), Scania (Скания), Renault (Рено), Volvo  (Вольво), Man (Ман) и др.</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> Для информации по тарифам звоните ***<br /> или заполните нижеприведенную<br /> ЗАЯВКУ НА ПЕРЕВОЗКУ </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p>Доставка груза Анадырь - Москва - Анадырь (из любой страны в любую точку мира), всеми видами транспорта (автомобильные и железнодорожные перевозки, речные, авиаперевозки). Чаще всего грузовые перевозки из г. Анадырь и города Чукотского автономного округа и др. осуществляется автотранспортом, так как автоперевозки по России являются наиболее удобным видом транспортировки товаров, также перевозки осуществляются по железной дороге, самолетом. Все виды грузоперевозок осуществляются на высоконадежном транспорте. Например,  при автоперевозках в распоряжении компании находятся автотранспортные средства с различной грузоподъемностью и объемом марок Камаз, Маз, Iveco (Ивеко), Scania (Скания), Renault (Рено), Volvo (Вольво), Man (Ман) (автопоезда, еврофуры, тентованные фургоны, рефрижераторы, контейнеровозы) Жд перевозки осуществляются в крытых вагонах, полувагонах, на специальных платформах, вагонах – термосах, вагонах – рефрижераторах. Мы также можем перевезти Ваш груз целым контейнером (контейнерная перевозка). Наши менеджеры подбирают наиболее оптимальный маршрут доставки товара Анадырь и города Чукотского автономного округа, грузоперевозки, таким образом, осуществляются по индивидуальной тщательно продуманной транспортной схеме.</p>', '', 1, 1, 0, 2, '2012-03-10 16:44:08', 62, '', '2012-03-20 09:17:11', 62, 0, '0000-00-00 00:00:00', '2012-03-10 16:44:08', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 1, 'Грузоперевозки Анадырь и города Чукотского автономного округа Москва перевозки грузовые автомобильные железнодорожные жд авиа контейнерные грузоперевозки перевозка груза авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 'Грузоперевозки Анадырь и города Чукотского автономного округа Москва перевозки грузовые автомобильные железнодорожные жд авиа контейнерные грузоперевозки перевозка груза авто доставка товара транспортировка груза самолетом по железной дороге автотранспортом перевозки груза', 0, 32766, 'robots=\nauthor='),
(143, 'Грузоперевозки с TIRом и CMR, правила перевозки груза по TIRу, грузоперевозки из Европы по TIRу, доставка грузов по CMR  ', 'gruzoperevozki-tir-cmr', '', '<p><strong>Какие грузы можно перевозить по TIRу, какой груз доставляется по \"CARNET TIR\" а какой по  СMR. </strong></p>\r\n<p>Грузовладельцы со стажем, и заказчики перевозок заказывающие перевозку в первый раз, и те и другие не могут понять почему одни грузы надо перевозить по TIRу, а другие грузы можно перевозить без TIRа достаточно накладной CMR.<br />Назначение и смысл системы МДП TIR означает Transports Internationaux Routiers. Русский вариант названия — «Международные  перевозки» (МДП). Наличие «Carnet TIR» (книжки МДП)  у водителя или владельца транспортного средства обозначается соответствующими знаками на грузовике. Это позволяет осуществлять международные перевозки грузов в соответствии с Конвенцией TIR. Грузовик пломбируется и водитель, имея при себе «Carnet TIR», доставляет груз в место назначения без досмотра при пересечении границ в европейских странах, входящих в соглашение.<br />В Европе действует целый ряд таможенных соглашений и конвенций в области транспортных перевозок, главная цель которых – упрощенное и быстрое прохождение таможенных процедур между странами-участницами. На практике это выражается в оптимизации процесса грузоперевозки, как для транспортных компаний и грузовладельцев, которые теряют гораздо меньше времени при пересечении границ, так и для государства, которое получает полную уплату всех таможенных пошлин от контрагентов. <strong>Перевозка грузов по TIRу</strong> обеспечивает перевозку грузов без промежуточных таможенных досмотров с одной стороны, и гарантированное пополнение госбюджета  за счет таможенных сборов с другой. В ряде случаев, на усмотрение таможенной службы, грузовик все же могут досмотреть на месте или отправить на полную выгрузку. Отметим, что при вскрытии пломбы составляет акт досмотра транспортного средства. После проведения досмотра на грузовик вешается новая пломба, и соответствующий номер вписывается в «карнет TIR». <br />Суть всех соглашений и МДП можно охарактеризовать как гарантированную систему оплаты таможенных пошлин в тех случаях, когда товар не доставляется в таможню назначения. Для стимулирования перевозчиков и увеличения грузооборота правительства стран и идут на послабления в международных грузоперевозках.</p>\r\n<p><br /><strong>Применение «карнета TIR» не освобождает перевозчика от ответственности </strong><br />Перевозки грузов автотранспортом по территории СНГ, как правило, осуществляются на основе “Конвенции о международной дорожной перевозке грузов” — МДП, или TIR (Transport International Roads). Данная система транзита грузов в странах Западной Европы и СНГ, действующая по принципу упрощения процесса перевозки, применяется уже более 30 лет. Система была утверждена в 1975 году и с тех пор является самой эффективной в сфере международных грузоперевозок. Доказательство тому – использование её идей и принципов в формировании других транспортных транзитных систем во всем мире. <br />Отвечает за соблюдение договоренностей Международный союз автомобильного транспорта (IRU) (Женева, Швейцария). В его обязанности входит координирование и поддержка работы системы грузовых перевозок.  <br />Книжка МДП (carnet TIR) является специальным таможенным документом, подтверждающим право транспортной компании/перевозчика работать в рамках системы по ее правилам и обязательствам. Имея в наличии такой документ, перевозчик оформляет груз в таможенном органе только одной страны, и доставляет его в место назначения без таможенного контроля и дополнительных финансовых гарантий при транспортировке грузов через транзитные страны. Правом выдачи книжек МДП, как правило, обладают национальные ассоциации международных автоперевозчиков. На сегодняшний день размер гарантии, для покрытия таможенных платежей при транзите грузов по ТИРу, достигает  <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">60 000</span> евро. Перевозчик должен гарантировать уплату таможенных платежей государству.</p>\r\n<p><span style=\"color: #993300;\">Важно отличать гарантию TIRа от страховки на груз и страховки ответственности перевозчика CMR, так как многие отправители грузовладельцы полагают, что если груз транспортируется по тиру, то груз застрахован, это ошибочное мнение.</span><br />СМR является Международной товарно-транспортной накладной. В нее вносится информация о грузе, маршрут перевозки. Обязательно должны стоять печати перевозчика, отправителя и получателя груза. Стоит также отметить страховку «СMR», применяемую для страхования ответственности перевозчика. Страхование грузов – это дело грузополучателя.</p>\r\n<p><br /><strong>Carnet TIR используется в соответствии с правилами и обеспечением дополнительных финансовых гарантий.</strong><br />TIR - (Книжка МДП) – представляет собой международный документ для осуществления таможенного транзита в странах Европы и СНГ. Выдается предоставляющей гарантию транспортной ассоциацией, уполномоченной таможенным органом. С помощью документа можно перевозить грузы без срыва таможенных печатей и пломб с грузовиков и контейнеров при пересечении границ государств и экономических союзов, в соответствии с положением Таможенной конвенции о международной перевозке грузов с применением Carnet TIR. Количество листов в книжке TIR-МДП <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">4 , 6 и 14 листов</span>, этого достаточно для пересечения <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">7 -10</span> государственных границ при международной перевозке грузов.<br />CMR – это накладная на товар, отправляемая вместе с товаром, следующим в  международном сообщении. TIR необходим для страхования финансовых рисков, тогда как страховка-CMR для страхования ответственности перевозчика. Другими словами, разные документы – для страхования разных рисков. Гарантия TIR на уровне 60 000 евро обязательна во всех государствах – членах ЕС, а также Сербии и СНГ: Белоруссии, Украине, России, Казахстане, Молдавии. Важно иметь в виду, что наличие TIR не означает, что страховка CMR необязательна и наоборот, поскольку у этих документов совершенно разные гарантийные и страховые покрытия.</p>\r\n<p> </p>\r\n<p><strong>В каждой стране транзита действуют свои правила перевозок.</strong><br />Перевозить груз без TIRа можно не только по территории Евросоюза и по территории  любого государства. При международной перевозке грузов, и со странами СНГ, необходимо оформлятьTIR и CMR , или фин.гарантию. В процессе транспортировки груза, в страны СНГ, следует учитывать: наименование груза и его стоимость, таможенный код груза ТНВЭД. Кроме того, у каждой страны доставки или транзита груза существуют свои таможенные «проволочки». С учетом большой ответственности и ценности груза важно сделать правильный выбор, сделав ставку на опытную транспортно-экспедиторскую компанию.  <br /><span style=\"color: #993300;\">Хотим напомнить, что перевозка некоторых категорий  товаров однозначно возможна только по TIRу.</span> К примеру, это относится к спиртному и сигаретам, продуктам питания, мебели и других грузов. Перевезти в страны Евросоюза спиртное, содержащее алкоголь  выше 17градусов, бренди водка, ликёр и т.д. без TIRa, можно только оформив Европейскую фин-гарантию.<br />Фин-гарантия на груз, даже при наличии TIR необходима  при перевозке сигарет, грузов стоимостью от <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">250000</span> евро, а также для других подакцизных грузов. При транзите через Украину и Беларусь, гарантию на груз можно оформить прямо на таможенном переходе. При въезде с таким грузом в Россию может потребоваться официальное сопровождение «конвой». <br />Перевозка без TIRa, не подакцизных грузов, стоимостью груза более чем <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">300000</span>дол, транзитом через Беларусь и Украину, при ввозе грузов в Россию, Молдову и другие страны СНГ, может быть осуществлена только при наличии дополнительной фин. Гарантии. <br /><span style=\"color: #993300;\">Доставка груза, который независимо от его стоимости, при транзите через Украину,  попадает под фин.гарантию, можно перевезти только по TIRу, </span>но и тут есть тонкости и нюансы, которые знают наши опытные логисты.<br />Для вашего спокойствия, рекомендуем заказывать транспорт для международной перевозки груза, в нашей транспортно-экспедиторской компании, и оформить нужные документы для успешной доставки грузов. <strong>Проконсультируйтесь с нашими менеджерами указанными в разделе  <span style=\"text-decoration: underline;\"><a href=\"ru/contacts.html\" title=\"Контакты\">Контакты</a></span><br /></strong></p>', '', 1, 0, 0, 0, '2013-07-01 14:45:45', 62, '', '2013-07-20 16:43:13', 62, 0, '0000-00-00 00:00:00', '2013-07-01 14:45:45', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 34, 0, 25, 'перевозки, Tir, CMR, как правильно перевозить грузы, где заказать перевозку по TIR, как перевозятся грузы по CMR', 'Правила перевозок по TIRу ,грузоперевозки из Европы в Россию и страны СНГ по CMR без Cornet TIRа.Товары попадающие под перевозку по фин.гарантии.', 0, 74884, 'robots=\nauthor='),
(145, 'Перевозки из России в Приднестровье. Автоперевозки Россия –Приднестровье (Тирасполь). Транспорт  из России в Приднестровье.', 'perevozki-pridnestrovie-tiraspol', '', '<p><strong>Грузоперевозки из Приднестровья, перевозки</strong> <strong>из России в Приднестровье.</strong> <strong>Доставка грузов Приднестровье-Европа, Россия, Беларусь</strong>. Приднестровье. Города Тирасполь, Бендеры, Рыбница,  Григориополь, Дубоссары, Днестровск, Каменка.</p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость перевозки направление  Приднестровье</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Грузоперевозки всех типов грузов из  России в Приднестровье, перевозки из Европы, Украины, Беларусии , Прибалтики в Приднестровье, перевозки из Польши в Приднестровье</strong> и из других стран мира всеми  существующими видами транспорта: автомобильным, железнодорожным, морским и  воздушным транспортом. Доставка грузов из Приднестровья по самым востребованным  направлениям  Приднестровье – Россия –  Приднестровье-Европа и другие направления перевозок. <strong>Перевозка груза из  городов: Тирасполь, Бендеры, Рыбница, Григориополь, Каменка, Дубоссары, Днестровск </strong>также  в обратном  направлении из России и других стран в  Приднестровье. Наиболее удобным способом транспортировки грузов из России  в Приднестровье являются авто перевозки, железнодорожные перевозки и  морские контейнерные перевозки. Для срочной  доставки груза из России в Приднестровье может быть применена авиа доставка. В  зависимости от требований клиента, наши менеджеры подберут оптимальный вариант  перевозки груза из России, Приднестровья, Тирасполя и других городов с  предоставлением сопутствующих логистических и таможенных услуг. Вам требуется срочная  доставка груза из Приднестровья в Россию? <strong>Заказ  перевозки из России в Тирасполь</strong> <strong>и  другие города Приднестровья, а также обратно в Россию</strong> оформляются  через заявку на сайте или позвонив менеджеру  в разделе контакты.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Приднестровье.</strong><br />Страна перевозки груза Приднестровье, наиболее развитые индустриальные города Приднестровья это: Тирасполь, Бендеры, Рыбница, Григориополь, Дубоссары, Днестровск, Каменка.<br /><strong>Основной импорт грузов в Приднестровье из Европы, России, Казахстана, Украины, Беларусии</strong> это: топливо, чёрные металлы, химикаты, минеральное топливо, оборудование и механические устройства, машины, электрооборудование, хлопок, фармацевтическая продукция, одежда, древесина, бумага, мясо, пищевые продукты.<br /><strong>Основной экспорт грузов из Приднестровья в Россию, Европу, Турцию, Казахстан это</strong>: металлы, текстильные изделия, вино-водочные изделия, стройматериалы, продовольственные товары, кожевенное сырье, пушнина, текстильные изделия, одежда, обувь, сельскохозяйственная продукция.  <br />Торговые отношения у Приднестровья с Россией, Беларусью, Украиной, Молдовой, Италией, Грецией, Румынией, Германией, Польшей, Турцией, Казахстаном, Китаем. <br /><strong>Грузоперевозки из Приднестровья в Россию, Казахстан, Беларусь, Молдову</strong>, Приднестровье Европа, возможны автомобильным, железнодорожным, водным-морским, воздушным (через Молдову) транспортом. Объем перевозок грузов организациями автомобильного транспорта в 2012 году составил 959,3 тыс. тонн. Посредством железнодорожного транспорта осуществляются транзитные грузовые перевозки. Доставка грузов морским транспортом через порт в Джурджулештах (Молдова) или порты Украины, возможна только с комбинированием авто транспорта. Регулярного авиационного сообщения в Приднестровье нет, доставка грузов авиатранспортом возможна через аэропорт в Кишиневе (Молдова). <br /><strong>Таможенное оформление грузов при перевозках из/в Приднестровье </strong>производится в порядке, установленном таможенным законодательством республики Приднестровье, в зоне деятельности таможенного органа, или ином месте по просьбе заявителя. Владелец груза или его представитель вправе присутствовать при таможенном оформлении. Заполнение необходимых документов производится на одном из государственных языков ПМР (русский, молдавский, украинский). В некоторых случаях возможен упрощенный порядок таможенного оформления. Сроки проверки таможенных деклараций и других необходимых документов при декларировании грузов сокращены до двух дней.<br /><strong>Транспорт для перевозки грузов из Приднестровья,</strong> к примеру, Приднестровье-Россия, Приднестровье - Казахстан, Приднестровье-Молдова, Приднестровье-Беларусь, Приднестровье-Украина, Приднестровье-Тирасполь-Азербайджан<strong>,</strong> может быть попутным из Молдовы или следовать из других стран. Заказать попутный транспорт для грузоперевозки из Приднестровья будет дешевле и проще, чем нанимать Приднестровскую транспортную компанию.<br /><strong>Осуществить заказ доставки грузов в/из Приднестровья в страны Европы и  СНГ.</strong><br />На нашем транспортном сайте представлен транспорт для перевозки грузов из Приднестровья во всех возможных категориях грузоперевозок. Тентованный автотранспорт, рефрижераторы, изотермические фургоны, другие типы прицепов для различных грузов. Услуги транспорта осуществляющих морские и железнодорожные контейнерные перевозки грузов в Приднестровье, в том числе, с использованием авиатранспорта. Вы можете найти и заказать транспорт для перевозки опасных, негабаритных, объемных, сборных, попутных грузов из Приднестровья. <br /><strong>Найти транспорт для перевозки груза из Приднестровья в Россию, Беларусь, Молдову, Казахстан, Украину. </strong><br />Чтобы перевезти груз из Приднестровья, воспользуйтесь формой заявки на сайте: внесите ваши контактные данные, описание груза, направление перевозки, дату погрузки. <br />После того, как ваша заявка будет обработана, наши сотрудники сообщат вам стоимость перевозки, и предложат подходящий <strong>транспорт для доставки груза по направлению Приднестровье. </strong><br /><br /><br /></p>', '', 1, 1, 0, 4, '2013-07-02