(158, 'Перевозки из России в Чехию. Чехия – Россия – Чехия (Прага).Перевозки Чехия-Россия, Украина, автоперевозки из Чехии в Молдову, Казахстан, Узбекистан, Чехия-Азербайджан', '2013-07-05-08-20-05', '', '<p><strong>Грузоперевозки Чехия – Россия</strong>. <strong>Перевозки из Чехии в Россию, Молдову, Казахстан, Прибалтику.</strong> Чехия<strong> </strong>города: Прага, Брно,  Острава, Пльзень, Оломоуц Усти над Лабем, Либерец.</p>\r\n<p> </p>\r\n<p><strong>Заказать перевозку  из России, и др. стран из/в Чехию</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Перевозки  грузов всех категорий из Чехии в Россию</strong> и в обратном  направлении, доставка во все страны мира из России любым необходимым  транспортом: автомобильным, железнодорожным, морским и авиатранспортом. Железнодорожные  контейнерные и мультимодальные грузоперевозки в направлениях Чехия – Россия –  Чехия<strong> </strong>Прага, Брно, Острава, Пльзень,  Оломоуц Усти над Лабем, Либерец. Для перевозки грузов из Чехии в Россию наши  сотрудники предлагают самые удобные варианты доставки и другие необходимые  транспортные услуги, включая таможенные, брокерские, экспедиторские услуги.  Самые распространенные типы грузоперевозок из России, Чехии и других стран –  это автомобильные перевозки, контейнерные морские перевозки, доставка грузов  железнодорожным и авиа транспортом. <strong>Для</strong> <strong>заказа перевозки из России в Чехию </strong>необходимо  заполнить заявку на сайте или позвонить менеджеру по телефону в разделе  контакты. <strong>Грузоперевозку из Чехии в Россию, Молдову, Казахстан </strong>и другие страны, срочные перевозки, всеми типами транспорта вы  сможете заказать в нашей компании.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Чехию</strong>. <br />Страна перевозки груза Чехия, наиболее развитые индустриальные города Чехии это: Прага, Брно, Острава, Пльзень, Оломоуц, Усти-над-Лабем, Либерец.<br /><strong>Основной импорт грузов в Чехию</strong> это: топливо, химикаты, металлы, автомобили, транспортное оборудование, шины, лесоматериалы, жиры и масла, продовольственные товары. <br /><strong>Основной экспорт грузов из Чехии в Россию, Украину, Молдову, Казахстан, Азербайджан</strong> это: химическая продукция, автомобили, запчасти, машины и оборудование, станки, насосы, электроаппаратура, бумага. <br />Торговые отношения у Чехии с Германией, Словакией, Польшей, Францией, Великобританией, Италией, Австрией, Бразилией, Китаем, Казахстаном, Россией, Сербией, США, Турцией, Украиной, Молдовой.<br /><strong>Грузоперевозки из Чехии в Россию, Казахстан, Беларусь, Молдову, Узбекистан</strong> и другие страны осуществляются автомобильным, железнодорожным, водным, воздушным транспортом. В 2012 году автотранспортом было перевезено 349,3млн тонн грузов, железнодорожным - 87,1млн тонн, водным - 1,9млн тонн грузов. 6 аэропортов обслуживают международные авиаперевозки.<br /><strong>Таможенное оформление грузов при перевозках из/в Чехию</strong> из третьих стран, не входящих в ЕС, осуществляется в рамках единой системы внешнеторгового регулирования и единой таможенной системы ЕС. Таможенные пошлины, сертификация, иные таможенные требования внешнеторговой деятельности Чехии определяются директивами ЕС. При перевозках грузов в Чехию из третьих стран применяется интегрированный таможенный тариф ЕС.<br /><strong>Предоставляемый транспорт для перевозки грузов из Чехии</strong>, к примеру, Чехия-Россия, Чехия -Казахстан, Чехия -Молдова, Чехия -Беларусь, может быть попутным, осуществляющим доставку грузов из других стран. Прибегнуть к услугам попутного транспорта будет экономнее, чем заказывать грузоперевозку из Чехии у чешской транспортной компании.<br /><strong>Как найти транспорт для  перевозки грузов в/из Чехии в страны СНГ.</strong><br />С помощью нашего транспортного сайта вы можете совершить быстрый заказ транспорта для перевозки грузов из Чехии в нужном вам направлении. На сайте представлены все существующие категории международных грузоперевозок: автоперевозки тентованными прицепами, рефрижераторами и изотермическими фургонами. Грузовики и прицепы для любых типов грузов, в том числе, опасных, негабаритных, длинномерных, объемных, тяжеловесных грузов. <br />Услуги всех типов транспорта для мультимодальных перевозок из и в Чехию в сочетании с морским, железнодорожным, авиа транспортом. Перевозки в контейнерах, доставка сборных консолидировнных, попутных грузов из Чехии в нужном вам объеме и в оптимальные сроки. <br /><strong>Поиск транспорта для перевозки груза из Чехии в Россию, Беларусь, Молдову, Казахстан. </strong><br />Чтобы оперативно заказать перевозку груза из Чехии заполните форму онлайн заявки: внесите ваши контакты, данные по грузу, направление доставки груза, дату погрузки, наши сотрудники свяжутся с вами и сообщат цену за перевозку, и другие подробности<strong> доставки груза по направлению Чехия. </strong><br /><br /><br /></p>', '', 1, 1, 0, 1, '2013-07-05 08:19:26', 62, '', '2013-08-24 13:11:51', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:19:26', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 9, '', '', 0, 20634, 'robots=\nauthor='),
(159, 'Перевозки из Хорватии в Россию. Автоперевозки Хорватия Россия Хорватия (Загреб).Грузоперевозки из Хорватии в Россию, Молдову.Украину,Беларусию, Казахстан', '2013-07-05-08-20-59', '', '<p><strong>Грузоперевозки Хорватия Россия. Грузоперевозки из Хорватии в Россию</strong>, Украину, Беларусь, Молдову, Казахстан. Хорватия города: Загреб,  Сплит, Риека, Осиек.</p>\r\n<p> </p>\r\n<p><strong>Заказ грузоперевозки из Хорватии в Россию, страны СНГ.<br /></strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Грузоперевозки  грузов различных характеристик из Хорватии в Россию</strong> и противоположном направлении, транспортная доставка во все страны мира любым  из существующих видов транспорта: автомобильным, морским, железнодорожным,  авиа, комбинированным транспортом. Контейнерные, сборные и мультимодальные  грузоперевозки в направлениях Хорватия – Россия – Хорватия Загреб, Сплит,  Риека, Осиек. В зависимости от характеристики груза, сроков доставки и  пожеланий грузовладельца предлагается самый удобный вид транспортировки груза,  сопровождение груза в пути, таможенные и другие сопутствующие услуги. Наши  специалисты готовы предложить оптимальную схему доставки груза из России в  Хорватию, обычно это автоперевозки, контейнерные или морские,  железнодорожные перевозки или доставка груза  воздушным транспортом. <strong>Заказ перевозки  из России в Хорватию</strong> можно осуществить, заполнив заявку на сайте или по  телефону в разделе контакты. Срочный заказ транспорта из Хорватии в Россию  можно заказать в нашей транспортно-экспедиторской компании.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Хорватию.</strong><br />Страна перевозки груза Хорватия, наиболее развитые индустриальные города Хорватии это: Загреб, Сплит, Риека, Осиек.  <br /><strong>Основной импорт грузов в Хорватию</strong> это: нефтепродукты, уголь, металлы, машиностроительная продукция, транспортные средства, древесина, лесоматериалы, целлюлозно-бумажные изделия, текстиль, обувь, галантерейные товары. <br /><strong>Основной экспорт грузов из Хорватии в Россию, Беларусь, Молдову, Украину это</strong>:фрукты, химикаты, электротехника, фармацевтическая продукция, продукты питания, мебель, кожгалантерея, пластмассовые изделия. <br />Торговые отношения  у Хорватии с Германией, Италией, Боснией и Герцеговиной, Словенией, Сербией, Россией, Австрией, Испанией. <br /><strong>Для грузоперевозок из Хорватии в Россию, Казахстан, Беларусь, Молдову, Украину</strong> применяются все распространенные виды транспорта: автомобильный, морской, железнодорожный, авиа транспорт. Автомобильным транспортом осуществляется большая часть грузовых перевозок в Хорватии (58,3 % в 2010 году). Второе место принадлежит интенсивно развивающимся железнодорожным перевозкам. В Хорватии функционируют морские и речные порты, годовой грузооборот крупнейшего морского порта в Риеке в 2011 году составил 9,4млн тонн. Шесть аэропортов обслуживают международные грузовые авиарейсы<br /><strong>Таможенное оформление грузов при перевозках из/в Хорватию</strong> после вступления страны в ЕС осуществляется на основе таможенного законодательства ЕС. Для прохождения таможенных процедур при экспортно-импортных операциях необходим инвойсовый счет, заполненная таможенная декларация, подтверждение проверки качества, сертификат происхождения товара. В целом, экспорт и импорт грузов в Хорватию достаточно либерализован. При своевременном предоставлении всех необходимых документов, таможенная очистка занимает не более 2-3 рабочих часов. <br /><strong>Транспорт для перевозки грузов из Хорватии</strong>, к примеру, Хорватия-Россия, Хорватия-Казахстан, Хорватия-Молдова, Хорватия-Беларусь, может следовать частично загруженным, или порожним по пути из других стран. Воспользоваться попутной перевозкой груза будет выгоднее и удобнее для грузовладельца, чем оплачивать хорватской транспортной компании полную цену за доставку груза из Хорватии.<br /><strong>Как заказать доставку груза из Хорватии в Россию и страны СНГ.</strong><br />С помощью нашего транспортного сайта, вы можете заказать нужный транспорт для перевозки грузов из Хорватии. Это могут быть автотранспортные перевозки тентованными прицепами, рефрижераторами и изотермическими фургонами, другими типами грузовиков и прицепов для перевозки опасных, негабаритных, объемных, тяжеловесных грузов. Услуги нашей транспортной компании это доставка сборных и попутных грузов из Хорватии. Морские контейнерные,  железнодорожные и авиа перевозки любых грузов из Хорватии. <br /><strong>Поиск транспорта для перевозки груза из Хорватии в Россию, Украину, Молдову, Беларусь.</strong><br />Заказать транспорт для перевозки грузов из Хорватии не займет много времени: внесите ваши контактные данные, пункт назначения доставки, описание груза, число погрузки. <br />Обработав вашу заявку в оперативном режиме, наши сотрудники предложат вам оптимальный транспорт и условия для <strong>перевозки вашего груза в направлении Хорватия.</strong><br /><br /><br /><br /><br /></p>', '', 1, 1, 0, 1, '2013-07-05 08:20:30', 62, '', '2013-09-04 17:59:15', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:20:30', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 9, 0, 8, '', '', 0, 6259, 'robots=\nauthor='),
(160, 'Перевозки из России в Словакию. Россия – Словакия (Братислава)', '2013-07-05-08-21-53', '', '<p>Грузоперевозки в Словакию из России. Словакия.  Города Братислава, Кошице, Прешов, Жилина, Банска-Бистрица.</p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость перевозки  Россия -Словакия</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Перевозки  грузов всех типов из России в Словакию</strong> и в другие страны мира  всеми видами транспорта: автомобильным, морским, железнодорожным и воздушным  транспортом. Перевозка грузов из Словакии по самым популярным направлениям  Словакия – Россия – Словакия и другие  направления перевозок. Перевозка груза из Словакии Братислава, Кошице, Прешов,  Жилина, Банска-Бистрица и обратно в Россию. В зависимости от пожеланий владельца  груза, срочности доставки и характеристик груза предлагаются различные способы  перевозки. Как правило, это перевозка автомобильным, железнодорожным, морским  транспортом грузов из Россию в Словакию. Контейнерные, воздушные и  мультимодальные перевозки из России, Словакии в самые сжатые сроки.  Предоставление полного пакета транспортных, логистических, брокерских,  экспедиторских услуг. <strong>Заказать перевозки  из России в Словакию</strong> можно через форму заявки на сайте или звонок менеджеру  в разделе контакты. Устали от поиска транспортной компании,  для перевозки груза из Словакии в Россию?  Звоните или направьте on-line  заказ.</p>', '', 1, 1, 0, 1, '2013-07-05 08:21:16', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-07-05 08:21:16', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 7, '', '', 0, 6864, 'robots=\nauthor='),
(161, 'Перевозки из России в Турцию. Автотранспорт Россия – Турция (Стамбул),Грузоперевозки из Турции в Россию, автоперевозка Турция-Россия.', '2013-07-05-08-23-01', '', '<p><strong>Грузоперевозки из Турции</strong> в  Россию. Перевозки Россия-Турция. <strong>Перевозка груза из Турции в Россию, Молдову, Украину, Казахстан</strong>. Города Стамбул,  Анкара, Измир, Бурса, Адана, Анталья, Конья.</p>\r\n<p> </p>\r\n<p><strong>Узнать стоимость перевозки из Турции в Россию, а также из  России в Турцию</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Перевозки  всех типов грузов из России в Турцию</strong> и во все страны мира  всеми существующими видами транспорта: автомобильным, железнодорожным, морским  и воздушным транспортом. Грузоперевозки осуществляются по самым востребованным  направлениям  Турция – Россия – Турция.  Перевозка груза из городов Стамбул, Анкара, Измир, Бурса, Адана, Анталья, Конья.  <strong>Для перевозки грузов из Турции в Россию, Молдову, Украину, Казахстан наши сотрудники предлагают самые  удобные варианты доставки</strong> и другие необходимые транспортные услуги, включая  таможенные, брокерские, экспедиторские услуги. Самые распространенные типы грузоперевозок  из России, Турции и других стран – это автомобильные перевозки, контейнерные  морские перевозки, доставка грузов железнодорожным и авиа транспортом. <strong>Для</strong> <strong>заказа перевозки из России в Турцию </strong>необходимо заполнить заявку на  сайте или позвонить менеджеру по телефону в разделе контакты. <strong>Если вам необходимо срочно доставить  груз Россия-Турция-Россия</strong>, <strong>Турция-Молдова, Турция-Казахстан</strong>, и вы в поиске транспорта, мы доставим ваш груз из  Турции в Россию или в обратном направлении.</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза в направлении Турция.</strong><br />Страна перевозки груза Турция, наиболее развитые индустриальные города Турции это: Стамбул, Анкара, Измир, Бурса, Адана, Анталья, Конья. <br /><strong>Основной импорт грузов в Турцию</strong> это: нефтепродукты, уголь, машины и оборудование, полуфабрикаты, сырье, фармацевтические товары, красители, черные металлы, транспортные средства, каучук, удобрения, приборы, запчасти. <br /><strong>Основной экспорт грузов из Турции в Россию, Украину, Молдову, Казахстан, Польшу это</strong>: металлы, пластмассы, резина, хлопок, одежда, ковры, текстиль, плодоовощная продукция, цитрусовые, электрооборудование, мебель, транспортные средства, керамика.  <br />Торговые отношения  у Турции с Россией, Саудовской Аравией, Германией, США, Китаем, Италией, Францией, Молдовой, Румынией, Великобританией, Польшей, Голландией. <br /><strong>Грузоперевозки из Турции в Россию, Казахстан, Беларусь, Молдову, Украину</strong> осуществляется автомобильным, морским, железнодорожным, авиа транспортом. В Турции зарегистрировано 45 тыс. грузовых автомобилей и 1420 транспортно-логистических компаний. Высоко развиты морские и авиа перевозки – в стране функционируют  45 аэропортов и 51 морской порт. Интенсивно развиваются высокоскоростные железные дороги. <br /><strong>Таможенное оформление грузов при перевозках из/в Турцию</strong> осуществляется в соответствии с торговым законодательством Европейского Союза. Между Турцией и странами ЕС отменены все таможенные пошлины. При перевозке грузов из третьих стран в Турцию используются совместные со странами ЕС таможенные тарифы. Таможенные пошлины на импортируемые в Турцию товары взимаются на основании базы таможенных тарифов, в соответствии с Номенклатурой Таможенных Тарифов. <br /><strong>Транспорт для перевозки грузов из Турции, к примеру, Турция-Россия, Турция -Казахстан, Турция -Молдова, Турция -Беларусь</strong>, может быть предоставлен из других стран. Воспользоваться услугами попутного транспорта зачастую дешевле, чем заказывать грузоперевозки из Турции у местных турецких транспортных компаний.  <br /><strong>Как заказать перевозку груза из Турции в страны СНГ, Литву, Латвию, Эстонию.</strong><br />На транспортном сайте вы можете быстро найти и заказать транспорт из Турции в нужной категории грузоперевозок. Автотранспорт для перевозки всех типов грузов в тентованных прицепах, рефрижераторах и изотермических фургонах. <strong>Перевозки грузов из Турции</strong> морским транспортом в контейнерах, с возможностью комбинировать с железнодорожным, автомобильным и авиа транспортом. Доставка сборных и попутных грузов из России в Турцию и в обратно из Турции в Россию. Услуги транспортных компаний по перевозке опасных, объемных, тяжеловесных грузов из Турции. <br /><strong>Найти транспорт для перевозки груза из Турции в Россию, Украину, Молдову.</strong><br />Для того, что быстро заказать перевозку грузов из Турции внесите ваши контактные данные, направление перевозки, описание груза и дату погрузки. <br />После заполнения всех необходимых данных, оператор обработает вашу заявку и свяжется с вами, чтобы сообщить <strong>стоимость доставки и другие детали перевозки груза по направлению Турции.</strong><br /><br /><br /></p>', '', 1, 1, 0, 1, '2013-07-05 08:22:28', 62, '', '2013-07-30 17:40:23', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:22:28', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 13, 0, 6, 'доставка грузов Турция Россия, автоперевозки из России в Турцию, морская контейнерная перевозка Турция Россия', 'Грузоперевозки Турция-Россия-Турция, перевозка грузов из России в Турцию автотранспортом,морские перевозки из Турции.Грузоперевозки из России в Турцию', 0, 25135, 'robots=\nauthor='),
(162, 'Перевозки из России в Боснию и Герцеговину. Грузоперевозки из Боснии и Герцеговины в Россию. – Босния и Герцеговина (Сараево)', '2013-07-05-08-24-16', '', '<p>Грузоперевозки в Боснию и Герцеговину из России. Босния  и Герцеговина. Города Сараево, Баня-Лука, Тузла, Мостар, Зеница.</p>\r\n<p> </p>\r\n<p><strong>Заказ перевозки из России  в Боснию Герцеговину.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Транспортные  перевозки грузов различного происхождения из Россию в Боснию Герцеговину</strong> и обратно, срочная доставка грузов в любую страну мира всеми распространенными  видами транспорта: автомобильным, железнодорожным, морским и воздушным  транспортом. Доставка грузов из Боснии и Герцеговины по самым востребованным  направлениям  Россия, Европа и другие  направления перевозок. Перевозка груза из городов: Сараево, Баня-Лука, Тузла,  Мостар, Зеница и в обратном направлении России.Наиболее удобным способом  транспортировки грузов из России в Боснию и Герцеговину являются авто  перевозки, железнодорожные перевозки и морские контейнерные перевозки. Для  срочной доставки груза из России в Боснию и Герцеговину применяется применена  авиа доставка. В зависимости от требований клиента, наши менеджеры подберут  оптимальный вариант перевозки груза из России, Боснии и Герцеговины с  предоставлением сопутствующих логистических и таможенных услуг. <strong>Заказ перевозки из России в Боснию и  Герцеговину</strong> оформляется через заявку на сайте или посредством звонка  менеджеру в разделе контакты. Перевозим ваши грузы в обратном направлении из  Боснии Герцеговины в Россию.</p>\r\n<p><strong>Как найти попутный транспорт для доставки груза из/в Боснию и Герцеговину.</strong><br />Страна перевозки груза Босния и Герцеговина, наиболее развитые индустриальные города Боснии и Герцеговины это: Сараево, Баня-Лука, Тузла, Мостар, Бановичи, Зеница, Биелина, Брод, Требинье.<br /><strong>Основной импорт грузов в Боснию и Герцеговину </strong>это: нефтепродукты, химикаты, минералы, сталь, машины и оборудование, котлы, электроника, сельскохозяйственная продукция, кожа, меха, текстиль. <br />Основной экспорт грузов из Боснии и Герцеговины это: руда, металлы и изделия, химические продукты, древесина, бумага, мебель, электрооборудование, котлы, кожаные изделия, фармацевтическая продукция. <br /><strong>Торговые отношения у Боснии и Герцеговины с Украиной, Россией, Молдовой, Казахстаном</strong>, Беларусией, Хорватией, Сербией, Черногорией, Германией, Словенией, Италией, Чехией, Австрией, Венгрией, Турцией.  <br />Грузы в/из Боснии и Герцеговины доставляются всеми распространенными видами транспорта: автомобильным, морским, железнодорожным, воздушным транспортом. Перевозки автомобильным транспортом составляют до 62% от общего объема грузооборота Боснии и Герцеговины. Важную роль играют железнодорожные грузоперевозки, также есть выход к морю и поддерживается международное грузовое авиасообщение. <br /><strong>Таможенное оформление грузов при перевозках из/в Боснию и Герцеговину</strong>, а также права и обязанности всех участников таможенных процедур регулируются Законом о внешнеторговой политике Боснии и Герцеговины. Таможенные тарифы устанавливаются в соответствии с обязательствами в рамках международных соглашений и правил ВТО. Тарифные ставки при экспорте-импорте грузов Боснию и Герцеговину варьируются на уровне 0-15%.<br /><strong>Транспортные компании, которые мы привлекаем для  перевозки грузов из Боснии и Герцеговины в Россию, Украину , Казахстан или Молдову могут быть попутными</strong>, из других стран. Цена грузоперевозки в таком случае будет дешевле, чем при заказе перевозки из Боснии и Герцеговины у местной транспортной компании.<br /><strong>Как заказать грузоперевозку в Боснию или из Боснии и Герцеговины в Россию, Украину, Молдову, Прибалтику.</strong><br />На нашем сайте грузовладелец должен выбрать транспорт для перевозки грузов в Боснию и Герцеговину в различных категориях грузоперевозок: это тентованный автотранспорт, рефрижераторы и изотермические фургоны. Транспортные услуги по перевозке опасных, негабаритных, объемных, сборных грузоперевозок из Боснии и Герцеговины. Морские и железнодорожные контейнерные перевозки в Боснию и Герцеговину, доставка грузов по схеме «от двери к двери» с использованием воздушного транспорта. <br /><br /><strong>Заказать транспорт для перевозки груза из или в Боснию и Герцеговину. </strong><br />Для оперативного получения цены на грузоперевозку из Боснии и Герцеговины в Россию, Украину, Молдову, вам необходимо внести ваши контактные данные, направление перевозки,  наименование груза, число погрузки. <br /><strong>После внесения данных с вами свяжется наш отдел перевозок в направлении Босния и Герцеговина.</strong><br /><br /></p>', '', 1, 1, 0, 1, '2013-07-05 08:23:21', 62, '', '2013-07-10 18:25:43', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:23:21', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 5, '', '', 0, 6862, 'robots=\nauthor='),
(163, 'Перевозки из России в Словению. Словения – Россия – Словения (Любляна).Перевозки из Словении в Украину, Беларусь.Словения- Молдова,Казахстан.', '2013-07-05-08-25-26', '', '<p><strong>Грузоперевозки Словения – Россия.Перевозки из Словении в Россию, Беларусь, Молдавию, Литву, Казахстан, Азербайджан</strong>. Словения: города Любляна,  Марибор, Целе, Крань, Веленье.</p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость перевозки в направлении из в Словению.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Перевозка  различных грузов из Словении в Россию, Молдавию,Украину</strong>,<strong> Таджикистан</strong> и обратно,  грузоперевозки в любую страну мира из России всеми распространенными видами  транспорта – автомобильным, железнодорожным, морским и авиатранспортом.  Грузовые доставки в направлениях Словения – Россия – Словения Любляна, Марибор,  Целе, Крань, Веленье. Самые оптимальные способы доставки груза из России в  Словению – это автомобильный и железнодорожный транспорт. При необходимости  применяется авиа доставка, контейнерные и мультимодальные перевозки. Для  грузоперевозок из Словении в Россию и другие страны, наши специалисты подбирают  лучший транспорт, предоставляют все сопутствующие экспедиционные и  логистические услуги. <strong>Заказ перевозки из  России в Словению </strong>принимается через заявку на сайте или звонок по телефону  в разделе контакты. <strong>Вам требуется  срочная доставка грузов из Словении в Россию? </strong>Звоните нашим менеджерам в  разделе <a href=\"ru/contacts.html\">«Контакты»</a></p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Словению.</strong><br />Страна перевозки груза Словения, наиболее развитые индустриальные города Словении это: Любляна, Марибор, Целе, Крань, Веленье.<br /><strong>Основной импорт грузов в Словению</strong> это: нефтепродукты, металлы, химическая продукция, автотранспортные средства, промышленное оборудование, медицинские и фармацевтические продукты, одежда, телекоммуникационное оборудование, текстильные ткани и волокна, животные и растительные масла. <br /><strong>Основной экспорт грузов из Словении в Россию, Беларусь, Казахстан, Узбекистан, Молдавию, Литву</strong> это: машины и транспортное оборудование, чехлы для автомобилей, электрооборудование, металлические изделия, бумага, резиновые изделия, фармацевтическая продукция, сельскохозяйственная продукция, мебель, текстиль.<br />Торговые отношения  у Словении с Германией, Италией, Австрией, Хорватией, Францией, Боснией и Герцеговиной, Венгрией, Россией. <br /><strong>Грузоперевозки из Словении в Россию, Казахстан, Беларусь, Молдову, Украину</strong> выполняются всеми существующими транспортными средствами: автомобильным, морским, железнодорожным, авиа транспортом. В Словении хорошо развитая сеть как автомагистралей, так и железных дорог посредством которых осуществляются комбинированные перевозки грузов. Крупнейший порт Копер с 12 терминалами обеспечивает международные коммерческие связи с Европой. Его грузооборот в 2010 году составил 15 млн. тонн. Три международных аэропорта (Любляна, Марибор и Порторож) обслуживают авиационные перевозки грузов. <br /><strong>Таможенное оформление грузов при перевозках из/в Словению</strong> осуществляется согласно общей торговой политики ЕС. После вступления страны в ЕС, используется единая согласованная таможенная система. Для прохождения таможенных процедур необходимо иметь коммерческий счет-фактуру в трех экземплярах, сертификат происхождения товара, и другие транспортные документы. <br />Для перевозки грузов из Словении, к примеру, по направлению Словения-Россия, Словения -Казахстан, Словения -Молдова, Словения -Беларусь, Словения-Литва можно заказать попутный транспорт. Зачастую такой вариант доставки обходится грузовладельцу дешевле, по сравнению с заказом грузоперевозки из Словении у местной Словенской транспортной компании.  <br /><strong>Как заказать перевозку груза из Словении в страны СНГ.</strong><br />Осуществить быстрый поиск и заказ транспорта для перевозки грузов из Словении вы можете прямо на нашем сайте. Транспорт доступен во всех востребованных категориях международных грузоперевозок: автотранспортные тентованные перевозки, рефрижераторные и изотермические перевозки. Доставка грузов в Словению в контейнерах морским, железнодорожным и авиатранспортом. Услуги транспорта по перевозке сборных, попутных, опасных, объемных, негабаритных, тяжеловесных грузов из Словении, также как и в Словению.<br /><strong>Поиск нужного транспорта для перевозки груза из Словении в Россию, Украину, Молдову, Беларусь.</strong><br />Чтобы найти и заказать транспорт для перевозки грузов из Словении, воспользуйтесь формой заявки: укажите ваши контактные данные, направление перевозки, характеристики груза и дату погрузки. <br />Ваша заявка будет рассмотрена в самые короткие сроки, и скоро вы получите информацию о <strong>стоимости перевозки и возможность доставить груз в направлении Словения.</strong><br /><br /><br /><br /></p>', '', 1, 1, 0, 1, '2013-07-05 08:24:45', 62, '', '2013-09-09 10:01:08', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:24:45', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 4, 'перевозки, доставка, автоперевозки, Грузоперевозки, транспорт, транспортные услуги', 'Перевозки из Словении в Россию, доставка грузов Словения-Россия, Автоперевозки груза из Словении в Молдову, Казахстан, Узбекистан.Перевозки Словения-Беларусь, Словения, Украина', 0, 8558, 'robots=\nauthor='),
(164, 'Перевозки зерна, зерновозами,транспортировка зерна в зерновозах.Зерновозы самосвальные и цистерны.', '2013-07-05-08-38-58', '', '<p>Перевозки зерна, зерновозами.</p>\r\n<p><strong>Заказ перевозки зерновых зерновозами разных объёмов.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Перевозка зерна, Заказать услуги перевозки зерновозами.</strong><br />Перевозки зерновых культур по России, на экспорт в страны СНГ и Европы самосвальными, бортовыми авто зерновозами и зерновозами-цистернами входят в перечень услуг, предоставляемых нашей транспортно-экспедиторской компанией. Перевозка зерна автотранспортом происходит согласно правилам и требованиям к перевозкам грузов данной категории. Отгрузка зерна осуществляется в сухой, чистый, продезинфицированный кузов, без присутствия посторонних запахов. Открытый кузов обязательно накрывается тентом для защиты зерна и пломбируется. Следует следить за уровнем влажности и не  допустить попадания влаги в процессе перевозки, при перегрузке и разгрузке зерна.<br /><strong>Для перевозки зерновых мы используем бортовые и самосвальные автопоезда</strong> зерновозы грузоподъемностью от 20 до 35 тонн с объемом кузова <span style=\"font-family: verdana,geneva;\">40-50м3.</span> (шасси + прицеп). Выгрузка зерна в таких автозерновозах осуществляется сбоку или сзади за счет опрокидывания кузова. Все зерновозы оборудованы брезентовым пологом (тентом). Максимальный объем перевозимого зерна достигает <span style=\"font-family: verdana,geneva;\">55 m3.</span><br />Другой вариант перевози зерна – полуприцепом автоцистерной-зерновозом объемом от <span style=\"font-family: verdana,geneva;\">13 до 80м3.</span> Эффективность таких алюминиевых автозерновозов заключается в возможности перевезти зерно на любые расстояния с сохранением его качеств. <br /><strong>Стоимость перевозки зерна зависит от направления и расстояния грузоперевозки, сроков доставки и объемов поставок.</strong></p>\r\n<p>Выделяют сезонные перевозки зерна, осуществляемые в период уборки урожая. Как правило, это перевозки зерна на небольшие и средние расстояния в пределах одной страны. Другой тип доставки – это экспортные перевозки зерна на дальние расстояния. Расчет стоимости таких перевозок происходит с учетом количества и типа используемых зерновозов, расстояния и условий доставки, транспортной документации на зерно и других факторов. <br /><strong>Профессиональное оказание услуг по перевозке зерна в зерновозах</strong> включает подготовку необходимой товаротранспортной документации для таможенного оформления зерна. Важно иметь в виду, что в каждой стране, действуют свои правила ввоза импорта и экспорта зерна, с учетом мировых стандартов. Обязательные документы при международных перевозках зерновых – это санитарно-эпидемиологические заключения и фитосанитарные сертификаты подтверждающие качество зерна, сертификат происхождения зерновых. <br />В зависимости от объемов перевозок зерна и направления доставки, мы готовы предложить вам оптимальные условия сотрудничества. К вашим услугам надежные оборудованные автозерновозы для перевозок пшеницы, ячменя, солода, ржи, и других зерновых, семечковых и технических культур. З<strong>аказать перевозку зерна можно в любом направлении:</strong> в страны ЕС - Румынию, Болгарию, Грецию, Сербию, Польшу, Хорватию, Францию, Италию из СНГ - России, Казахстана, Украины, а также в обратном направлении.<br /><br /></p>', '', 1, 0, 0, 0, '2013-07-05 08:38:41', 62, '', '2013-09-11 15:46:20', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:38:41', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 12, 0, 24, 'перевозка зерна, доставка зерновых, транспорт для перевозки зерна.', 'Перевозки зерна, грузоперевозки зерновозами, транспортировка зерна и зерновых из России', 0, 12754, 'robots=\nauthor='),
(165, 'Перевозка сельхоз.и спец.техники.Транспортировка комбайнов,и сельскохозяйственной техники.', '2013-07-05-08-39-16', '', '<p>Перевозка сельскохозяйственной и спец. техники.</p>\r\n<p><strong>Отправьте данные по грузу, для заказа транспорта и доставки техники.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Международные перевозки спецтехники. Заказать транспорт для перевозки агро. и сельхоз. техники, объёмных и негабаритных грузов.</strong><br />Для осуществления международной перевозки спецтехники требуется не только  специальный транспорт, но и штат высококвалифицированных сотрудников знающих не понаслышке, что представляет из себя транспортировка негабаритных грузов.<br />Перевозка крупногабаритных грузов, сельскохозяйственной техники и спецтехники в страны Европы, России, Украины, Беларуси, Молдовы, Прибалтики, и другие страны Евросоюза и СНГ является одним из основных направлений деятельности нашей транспортной компании. Обратившись к нам, вы получите полное комплексное обслуживание по перевозке бульдозеров, башенных кранов, экскаваторов, комбайнов, а также другой спецтехники, негабаритных и длинномерных грузов в кратчайшие сроки. <br /><strong>Перевозка сельхоз.и спецтехники и других видов негабаритных грузов</strong> осуществляется на низкорамных тралах – «низкорамниках», модулях-тяжеловозах, автопоездах тралах с усиленной платформой и аппарелями для съёзда перевозимой техники. Выбор транспортного средства происходит с учетом специфики и габаритов груза.   <br />Перевозка спецтехники осуществляется с соблюдением правил, предусмотренных для данной категории грузов. Наши специалисты помогут с оформлением документов на негабаритный перевозимый груз. Согласуют маршрут перевозки, тип перевозимого негабаритного груза, размеры, массу, количество, вес снаряженного автопоезда, способ его крепления  с надзорными органами. Важно произвести правильную погрузку, крепление негабаритного груза, досконально изучить маршрут следования груза, чтобы знать каждый участок пути. <br /><strong>Цены на  перевозки спецтехники и негабаритных грузов </strong>формируются исходя из типа груза, его габаритов, сложности и дальности маршрута, сопровождения груза в пути, срочности доставки. В каждом конкретном случае точная стоимость может быть определена нашими логистами только после изучения всех деталей перевозки и с учетом требований клиента по доставке негабаритного груза.<br />Наша компания доставляет спецтехнику, сельскохозяйственную технику и негабаритные грузы по всем направлениям: в страны СНГ и Европы из России, Казахстана,Украины, Беларуси, Молдовы. В кратчайшие сроки доставим крупногабаритные и длинномерные грузы или спецтехнику из Германии, Турции, Греции, Болгарии, Румынии в Россию, Украину и другие страны СНГ, Казахстан, Киргизстан, Азербайджан, Туркменистан, Армению.<br /><br /></p>', '', 1, 0, 0, 0, '2013-07-05 08:39:01', 62, '', '2013-09-10 18:28:59', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:39:01', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 14, 0, 23, '', '', 0, 5370, 'robots=\nauthor='),
(166, 'Стоимость перевозок,стоимость грузоперевозки из России в Европу, страны СНГ, цены на транспортные перевозки в Россию.', 'stoimosty-gruzoperevozok', '', '<p>Стоимость перевозок можно узнать отправив запрос, или позвонить.</p>\r\n<p><strong>Для определения стоимости грузоперевозки отправьте заявку.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Стоимость перевозок. Цены на доставку грузов.Что влияет на стоимость грузоперевозки.Реальная цена грузоперевозок.</strong><br />Цены на перевозку грузов всегда волнуют заказчиков в первую очередь. Постараемся выяснить, какие факторы влияют на ценообразование, по каким причинам разные транспортные компании выполняют перевозку в одном и том же направлении  за разную стоимость.<br />Во-первых, важно учитывать географическое местоположение транспортной компании. К примеру, российскому перевозчику невыгодно перевозить груз из России в Румынию с порожним пробегом в обратном направлении. Если перевозчик из России и согласиться выполнять такую доставку, то только по завышенной стоимости. В то же время, транспортная компания из Молдовы может доставить груз в Румынию по более низкой стоимости, если автотранспорт находится недалеко от места погрузки. Однако  если перевозчику, придётся, посылать грузовик из более отдаленных городов цена на перевозку будет дороже.<br />Во-вторых, играет роль тип транспортного средства. Перевозки тентованными грузовиками всегда дешевле по сравнению с рефрижераторными перевозками. <br />В-третьих,  стоимость груза и тип груза. Так, перевозка опасных грузов ADR стоит дороже, нежели обычный груз. При перевозке сборных грузов учитываются дополнительные затраты и время, затраченное на сбор грузов. А при формировании итоговой цены на мультимодальные перевозки рассчитываются совокупные затраты на все виды транспорта.  <br />В целом, цены на грузоперевозки можно привязать к состоянию транспортной инфраструктуры во всем мире. Колебание цен, возможно, определить, если учитывать ситуацию на рынке сырья – удорожание/удешевление топлива, отсутствие разрешений для грузовиков на проезд в некоторые европейские страны, необходимость открытия виз для водителей при пересечении стран ЕС, Турции, стран СНГ.<br /><strong>Грузовладельцу важно понять, что грузоперевозка не может быть дешёвой</strong>, если транспортная компания страхует ответственность перевозчика (CMR страхование), предоставляет качественный подвижной состав, работает по TIR, а водители компании имеют международные автомобильные удостоверения. <br />В то же время, клиент может рассчитывать на более низкую стоимость грузоперевозки в тех случаях, когда частный перевозчик работает на грузовике в плохом техническом состоянии, без страховки CMR и без TIR. Однако при этом владелец груза не получает уверенности в качественной, своевременной, безопасной доставке своего груза.<br /><strong>Дополнительная статья расходов – это страхование перевозки и ответственность за перевозимый груз.</strong> В независимости от стоимости груза, направления перевозки, груз рекомендуется застраховать – заказчик может сделать это самостоятельно. Перевозчик страхует свою ответственность за перевозимый груз страхованием CMR.<span style=\"color: #993300;\"> Качественно перевозя грузы, транспортная компания не может снизить цену перевозки ниже себестоимости расходов,</span> <span style=\"color: #993300;\">но грузовладелец может с уверенностью дождаться своего груза в целостности, и вовремя получить груз у себя на складе.</span></p>\r\n<p>Остерегайтесь экспедиторских компаний в лице одного менеджера, остерегайтесь дешёвых ставок на перевозки, требуйте документы транспортной или экспедиторской компании. Рекомендуем заказчикам и всем грузовладельцам: работайте с вашими исполнителями по доставке грузов, которые на рынке перевозок не менее 5 лет. <span style=\"color: #993300;\"><strong></strong></span></p>\r\n<p><span style=\"color: #993300;\"><strong>Опыт организатора перевозки это сохранность вашего груза и качественные транспортные услуги.</strong></span></p>', '', 1, 0, 0, 0, '2013-07-05 08:39:20', 62, '', '2013-07-27 09:33:21', 62, 0, '0000-00-00 00:00:00', '2013-07-05 08:39:20', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 23, 0, 22, 'перевозка недорого, доставка грузов по умеренным ценам, узнать стоимость грузоперевозки', 'стоимость перевозки груза из России , сколько стоит доставка груза в Россию, какая стоимость перевозки из Турции в Россию, транспортная компания по перевозкам грузов из Греции, Молдавии , Румынии', 0, 12092, 'robots=\nauthor='),
(171, 'Договор перевозки грузов', 'dogovor-perevozki-gruzov', '', '<p>Договор перевозки грузов</p>', '', 1, 1, 0, 1, '2013-09-04 12:48:06', 62, '', '2013-09-04 12:49:31', 62, 0, '0000-00-00 00:00:00', '2013-09-04 12:48:06', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 3, '', '', 0, 0, 'robots=\nauthor='),
(172, 'Договор перевозки грузов, основные правила.', 'dogovor-perevozki-gruzov', '', '<p><strong>Договор для международных грузоперевозок автомобильным, морским, и другими видами транспорта.</strong><br />Доверить перевозку груза на словах, без заключения договора или заявки, это неразумно.<br />Договор перевозки грузов, может называться по-разному, «Договор транспортной экспедиции», или «Договор на перевозку грузов» может быть «Договор-заявка на международную перевозку», это только названия. На самом деле если вы как грузовладелец-заказчик обращаетесь в транспортно-экспедиторскую компанию, то с вами как с «заказчиком перевозки» будет договор «Транспортной экспедиции» так как экспедиторская компания выступает посредником между грузовладельцем и транспортной компанией. Это нормально и ничего тут не страшно.</p>\r\n<p><strong>Главное для заказчика перевозки:</strong> это ответственность сторон, прописанная в договоре, сроки доставки груза, обеспечение перевозки CMR страхованием, проверка экспедитора на добропорядочность, обмен регистрационными документами, рекомендациями. Если «Заказчик перевозки» грузовладелец нанимает транспорт у транспортной компании, то договор на перевозку будет называться так: «Договор на международную грузоперевозку»   в данном случае ответственность за перевозимый груз несёт транспортная компания, но, также необходимо прописать все ответственности за перевозимый груз, также сроки доставки, также регистрационные документы транспортной компании, также CMR страхование. Также необходимы рекомендации от перевозчика на его порядочность и профессионализм от других компаний, с которыми работал перевозчик.<br /><br />Как  уже видно, что название договора ничего не меняет, грузовладельцу во всех случаях необходима гарантия доставки грузов, с кем бы ни был заключён договор перевозки. Обращайте внимание при заключении «Договора перевозок» на  ответственность сторон, где прописываются санкции за невыполнение обязательств транспортной или экспедиторской фирмы, ссылка на то, что перевозка осуществляется согласно Конвенций CMR и TIR. Также необходимо в договоре прописать детали касающиеся характера груза, к примеру, товар должен перевозиться в тенте, или с температурным режимом в рефрижераторе, в некоторых случаях, при перевозке ДСП, необходимы крепёжные ремни 12 шт. не меньше. Если груз оборудование или станок, возможно, понадобится верхняя загрузка.<strong> Каждый тип груза нуждается в исполнении правил перевозки, именно для данного вида груза.</strong> Грузы опасные ADR-одни требования к перевозки. Грузы жидкие или зерновые сыпучие, другие требования к перевозке, медикаменты – свои особые требования, перевозка продуктов питания, стройматериалов. Каждый груз по особенному должен быть перевезён, соблюдая правила перевозки индивидуально характеру груза.  Это всё, до мелочей обязательно должно быть прописано в «Договоре заявке».<br /><br />В том случае, когда Транспортная компания или экспедиторская компания вам как заказчику перевозки предлагает свой типовой договор на перевозку – это вас не должно пугать, наоборот это говорит о том, что компания реально работает, и несёт ответственность, необходимо изучить договор и внести коррективы своих пожеланий.<br />Во многих случаях заключается контракт на перевозку, где описаны все детали подробно, и к нему «Заявка на перевозку» где вносятся данные о грузе, месте погрузки/выгрузки, адреса доставки груза, оплате за перевозку, номер машины, и другие условия перевозки.<br /><strong>При наличии «Контракта на перевозку»</strong>, где все условия доставки прописаны, при постоянном сотрудничестве с исполнителем перевозок, достаточно отправлять заявку на каждую перевозку отдельно. Работайте с профессионалами по организации международных перевозок, и ваш груз будет доставлен в нужное место и в нужный срок, без задержек, простоев, и в сохранности.</p>\r\n<p> </p>\r\n<p><strong>Для заказа перевозки, отправьте предварительную заявку.</strong><br />{mtpform}</p>', '', 1, 0, 0, 0, '2013-09-04 15:07:31', 62, '', '2013-09-10 18:40:43', 62, 0, '0000-00-00 00:00:00', '2013-09-04 15:07:31', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 23, 0, 17, 'перевозки по договору, автоперевозка согласно договора, правила составления договора на перевозку груза, договор для доставки груза, договора перевозок', 'Договор на перевозку, как правильно заключать договор на перевозку груза автомобильным транспортом, контракт на автоперевозку, заявка на перевозку груза ', 0, 7604, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(167, 'Вакансии в Молдове. Работа в Молдове, компания в Кишинёве и Тирасполе.Требуются менеджеры логисты, диспетчера грузоперевозок.', 'vakansii-v-moldove-v-kishinau-i-tiraspole', '', '<p><strong>Приглашаем на работу  в транспортно-логистическую компанию в Молдове, работа в Кишинёве и Тирасполе.</strong><br />Транспортно-логистическая Компания Transport Union из Молдовы, г. Кишинёв, с филиалом в Тирасполе, приглашает на работу молодых энергичных, а также желающих попробовать себя в другом бизнесе людей. Всех кто желают сменить профессию и испытать себя в новом,  динамически развивающемся  направлении в транспортной логистике, организация международных грузоперевозок. Для менеджеров с опытом работы в перевозках, в нашей компании, также будут новые выгодные условия.</p>\r\n<p> </p>\r\n<p><strong>Желающие работать, без опыта, проходят курс обучения, бесплатно! </strong><br /><br /><strong>Если вы опытный менеджер по международным грузоперевозкам,</strong> и вам приходилось организовывать перевозки различных грузов, в нашей компании вам будет интересно перенять наш опыт работы и реализовать себя как состоявшего менеджера управленца в организации международных перевозок. Если вы как молодой соискатель ещё ни где не работали, и логистика вас привлекает своей разносторонностью, в нашей компании, вам передадут знания опытные менеджеры.<br />Ваше приобретённое ранее высшее образование покажет, насколько вы готовы к самостоятельной трудовой деятельности. В нашей компании нет дискриминации по половым признакам. Возраст соискателя на должность логиста по грузоперевозкам, также неограничен.<br /><br /><strong>Для работы в нашей компании есть несколько предпочтений к соискателям ищущих интересную работу.</strong><br /><span style=\"font-family: verdana,geneva;\">1.</span>Желание работать в команде, проявить себя и реализовать свои желания к познанию новой профессии.<br /><span style=\"font-family: verdana,geneva;\">2.</span>Быть преданным делу осознавать свою ответственность к компании, в которой  ты работаешь, отстаивать интересы компании и быть её лицом.<br /><span style=\"font-family: verdana,geneva;\">3.</span>Совершенствовать уровень своих знаний, использовать полученные знания в компании на благо усиления компании. Стремится к собственным достижениям и повышению карьерного статуса в компании.<br /><br /><strong>Профессиональные качества и личные навыки.</strong><br />Общительность, стремление к новым профессиональным контактам для увеличения клиентской базы компании.  Профессиональное обслуживание клиентов компании, которые когда-либо заказывали услуги перевозок в нашей компании, сохранение связей.<br />Ваша пунктуальность, ответственность и продуктивность – это ваш конёк, благодаря которому возрастёт перспектива  карьерного роста в нашей компании.<br />Оплата вашего труда дифференцированная, по труду, навыкам, и знаниям, которыми вы обладаете, и приобретёте в нашей транспортной - логистической компании.<br /><br /><strong>Мы ждём Вас на должности: Требуются специалисты на вакансии.</strong><br /><span style=\"color: #993300;\">Менеджер по организации международных грузоперевозок.<br />Менеджер по организации морских и контейнерных перевозок.<br />Менеджер по организации сборных грузов, частичных партий грузов<strong>.</strong></span></p>\r\n<p>Менеджер по организации экспресс доставки, посылок, писем , бандеролей.<br />Условия к соискателям индивидуальны, в зависимости от профессионального опыта, и других личных качеств.<br /><br />Вопросы  по условиям работы, а также вопросы по трудоустройству, и ваше резюме направляйте на <strong>Еmail</strong> - mtperevozki@gmail.com  или по тел. <span style=\"font-family: verdana,geneva;\">+37368677712</span></p>\r\n<p>Для работы в Тирасполе тел <span style=\"font-family: arial,helvetica,sans-serif;\">777 88958</span><br />Наша компания видит  Вас в рядах наших сотрудников и желает вам удачи.<br /><br /></p>', '', 1, 0, 0, 0, '2013-07-27 23:15:53', 62, '', '2017-07-31 10:19:18', 62, 0, '0000-00-00 00:00:00', '2013-07-27 23:15:53', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 28, 0, 21, 'Работа в Молдове, Работа в Приднестровье, работа в Кишинёве, требуются менеджеры на работу в Тирасполе.', 'Вакансии для соискателей на работу в транспортной компании по организации международных перевозок.Требуются менеджеры по продажам транспортных услуг, приглашаем на работу в Молдове, работа к Кишинёве и Тирасполе.', 0, 7466, 'robots=\nauthor='),
(168, 'Железнодорожные грузоперевозки, перевозки грузов по железной дороге, доставка всех типов грузов, грузоперевозки ж.д вагонами.', '2013-08-03-18-51-53', '', '<p><span style=\"line-height: 1.3em;\"><strong>Перевозки грузов железнодорожным транспортом.</strong><br />Железнодорожные грузоперевозки включают транспортировку любых категорий грузов подвижным составом, экспедиторское обслуживание, контейнерные перевозки, складские услуги для временного хранения груза, перевозка грузов «от двери до двери», мультимодальные перевозки универсальных контейнеров с комбинированием различных типов транспорта.<br /><strong>Правильная подача подвижного состава для перевозки грузов. </strong><br />После погрузки груза в железнодорожный состав все вагоны пломбируются, наличие пломбы проверяется на всех перевалочных пунктах, где осуществляется сцепка/расцепка состава. Под погрузку предоставляются исключительно исправные, очищенные изнутри и снаружи, продезинфицированные, если речь идет о перевозках продуктов питания, вагоны для перевозок различных категорий грузов. Необходимо убедиться в пригодном для перевозок состоянии грузовых отсеков вагонов, в том числе, в отсутствии в вагонах посторонних запахов, влаги и других факторов, которые могут оказать пагубное влияние на состояние груза при погрузке, разгрузке, и в процессе перевозки. <br /><br />При перевозке наливных грузов проверяется техническое состояние цистерн, включая исправность котлов, сливных приборов цистерн. При осуществлении рефрижераторных железнодорожных перевозок важно удостовериться в полном соответствии рефрижераторных и изотермических вагонов требованиям к перевозке скоропортящихся грузов: продуктов питания, цветов, медикаментов. Сбои в работе холодильных установок, систем отопления и вентиляции недопустимы и несут прямую угрозу сохранности груза.  <br /><br />Требования к таре и упаковке груза, качеству перевозимой продукции устанавливается стандартами и техническими условиями в соответствии с законодательством той страны, где происходит погрузка/разгрузка груза. Перед погрузкой грузоотправители предъявляют сертификаты качества, стандарты и другие документы на отгружаемый груз, обязательные для таможенного оформления груза. <br /><br />Грузы, для которых не установлены специальные требования и тара, представляются к перевозке в исправной таре, соответствующей общим условиям международных грузоперевозок, а также двустороннего договора между перевозчиком и грузовладельцем. При перевозке грузов, не относящихся к числу легковоспламеняющихся, но при этом упакованных с применением рогожи, кожи, ткани или защищенных соломой, бумагой, стружкой и другими легковоспламеняющимися веществами, осмотр и подготовка вагонов производится так же, как и для горючих грузов. Маркировка производится в соответствии с ГОСТом «Маркировка грузов».<br /><br /><strong>Типы вагонов в подвижном составе.</strong><br />Крытые вагоны для перевозки всех типов грузов, требующих защиты от атмосферных осадков. Погрузка и выгрузка осуществляется через двери, расположенные в боковых стенах. Грузоподъёмность – 60-68т. Объем – до 120м3.<br /><br /><strong>Полувагоны с открытым верхом для перевозки грузов</strong> стойких к любым погодным условиям, с выгрузкой через люк в полу. Грузоподъемность 60т и выше, объем 74-76м3. <br /><br /><strong>Платформы для перевозки длинномерных крупнотоннажных грузов</strong>, контейнеров, автомобилей, спецтехники, оборудования и сыпучих грузов. Грузоподъемность 60, 70, 90т. <br /><br /><strong>Вагоны-цистерны для перевозки наливных пищевых и непищевых грузов</strong>, сжиженного газа, мазута и других технических жидких грузов.<br /><br /><strong>Вагоны-хопперы для перевозки зерна и других сыпучих грузов</strong>, удобрений, цемента и строительных насыпных грузов<br /><br /><strong>Рефрижераторные и изотермические вагоны для перевозки скоропортящихся грузов</strong> вместимостью до 40т. Рефрижераторные секции из нескольких вагонов.<br /></span></p>\r\n<p><span style=\"line-height: 1.3em;\"><strong>Контейнеры стандартных размеров 20 и 40футов, </strong>с открытым верхом, контейнер-платформа, танк-контейнер,<strong> для перевозки всех типов грузов,</strong> включая дорогостоящие грузы. Контейнеры массой брутто 3т, 5т, 10 т и выше (10т, 16т, 20т, 24т, 25.4т, 30.48т). <br /><strong>Возможность мультимодальной перевозки контейнера</strong>, комбинирование железнодорожного с морским, авиа и автотранспортом.<br /><strong><br />Стоимость железнодорожных перевозок грузов.</strong><br />При расчете итоговой стоимости перевозки груза железнодорожным транспортом учитываются подготовительные работы, связанные с погрузкой груза на состав, применение человеческих ресурсов и погрузочной техники при перегрузке груза в перевалочных пунктах или выгрузке в конечном пункте, крепление и раскрепление грузов в крытых и открытых вагонах и полувагонах. Экспедиционные услуги: согласование маршрута перевозки с железной дорогой, сопровождение груза, диспетчерское слежение за грузом в пути, контроль доставки груза и оповещением получателя о дате, времени и рейсе прибытия груза. Уплата таможенных и транзитных пошлин. Подготовка пакета товаротранспортной документации (накладных, сертификатов) для таможенной очистки груза. Консультация в страховании грузов и другие сопроводительные услуги. Весь перечень предоставляемых услуг и итоговая стоимость содержится в договоре на перевозку, заключаемом между грузовладельцем и транспортной компанией.<br /><strong><br />Универсальность железнодорожных перевозок.</strong><br />Вы можете оставить заявку на железнодорожную перевозку в любом интересующем направлении на нашем сайте. В зависимости от типа груза, его размеров и объема, мы предоставим подвижной состав, соответствующий характеристикам груза. Перевозить железнодорожным транспортом можно все грузы: сырье для производства, строительные материалы, грузы из металлургической, нефтехимической, машиностроительной, сельскохозяйственной  промышленности. Объемные, тяжеловесные грузы - лес, металлоконструкции, сыпучие строительные материалы, автомобили, хрупкие ценные грузы в контейнерах, опасные грузы из нефтехимической промышленности в специальных вагонах-цистернах. Продукты питания, скоропортящиеся грузы в рефрижераторах, вагонах-термосах. <br /><br />В зависимости от объемов перевозок Вам будет предложен оптимальный вариант доставки груза подвижным составом: нужный размер площади в вагоне при малотоннажной перевозке, или требуемое количество вагонов для крупной групповой или маршрутной отправки. <br /><br />Развитость железнодорожных путей позволяет организовать прямые железнодорожные, контейнерные или комбинированные перевозки во все страны евроазиатского континента – Европа, СНГ, Россия, Украина, Казахстан, Китай. В сочетании с другими типами транспорта доставить груз по железной дороге можно из любой страны мира – это выгодный и экономичный способ транспортировки грузов. <br /><br /><strong>Заявка для  заказа железнодорожной перевозки. </strong><br /></span>{mtpform}<br /><span style=\"line-height: 1.3em;\"><br /></span></p>', '', 1, 0, 0, 0, '2013-08-03 18:51:43', 62, '', '2013-09-04 15:55:44', 62, 0, '0000-00-00 00:00:00', '2013-08-03 18:51:43', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 17, 0, 20, '', '', 0, 2204, 'robots=\nauthor='),
(201, 'Разместить транспорт для морских перевозок и контейнеровозы. Грузы для морских перевозок и контейнеров.', 'morskoj-transport', '', '<p><strong>Владельцы контейнеровозов, экспедиторы морских линий, организаторы морских перевозок.</strong></p>\r\n<p>Размещая ваш транспорт для морских перевозок и перевозок контейнеров,  вы увеличиваете возможность получать необходимые заказы на перевозку грузов морским путём и контейнеровозами. Грузовладельцы, заказчики перевозок, из разных стран, увидят ваш размещённый транспорт для морских перевозок, на наших информационных сайтах. Получение заказов на перевозки по морю вам, гарантированно. Предложите ваш транспорт для морских и контейнерных перевозок пройдя по ссылке <strong>Предложить морской и контейнерный транспорт.</strong><br /><strong> </strong></p>\r\n<p> </p>\r\n<p><strong>Заявка на размещение морского транспорта и получение заказов для морских и контейнерных перевозок.</strong><br /><br /></p>\r\n<h2><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/morskie-kontejnernie-perevozki/predlozhit-transport\" target=\"_blank\">Предложить морской и контейнерный транспорт</a></h2>', '', 1, 0, 0, 0, '2013-12-25 07:38:23', 62, '', '2013-12-25 20:57:39', 62, 0, '0000-00-00 00:00:00', '2013-12-25 07:38:23', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 12, 0, 7, 'грузы для перевозок, поиск грузов для морских перевозок, найти груз для контейнера, поиск грузов для контейнеровоза.', 'Грузы для морских перевозок, гру для контейнеров и контейнеровозов, заказы для морских линий на морские перевозки', 0, 3283, 'robots=\nauthor='),
(169, 'Доставка посылки, сборного груза, доставить посылку, перевезти сборный груз, перевозка мелких грузов и небольших партий сборных грузов.', 'dostavka-posylok-i-melkih-gruzov', '', '<p><strong>Доставка посылок и сборных грузов автотранспортом.</strong><br />Доставка посылок, небольших грузов в составе сборных грузов, доставка товаров приобретённых через Интернет магазины, автомобильным транспортом – одна из наиболее востребованных услуг на рынке международных сборных и попутных грузоперевозок. Данный способ доставки самым оптимальным по соотношению цена – срок – качество доставки, поэтому пользуется популярностью среди клиентов нашей компании. Доставка посылок автотранспортом из Катая, в/из Европы, страны СНГ  в Россию, Молдову, Украину, Беларусь, Казахстан, Туркменистан, Азербайджан. <br /><br />Данная транспортная услуга  характеризуется широким выбором автотранспортных средств различной вместимости: грузовики, микроавтобусы, мини-вэны, гибкостью построения маршрута, вовлечение в перевозку всех типов транспорта: от огромных фур, до малых авто.  Возможность доставить посылку или небольшой груз абсолютно в любой населенный пункт непосредственно в руки получателю, с большой частотой рейсов и высокой скоростью доставки, различного объёма и веса.</p>\r\n<p> </p>\r\n<p><strong><span style=\"text-decoration: underline;\"><em><a href=\"http://mtperevozki.ru/zajavka-na-dostavku-posylki.html\"> </a></em></span><span style=\"color: #800000;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\"><a href=\"http://mtperevozki.ru/zajavka-na-dostavku-posylki.html\"><strong>Рассчитать</strong> <strong>стоимость  доставки посылки </strong></a></span></span></span><span style=\"color: #800000;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\"><a href=\"http://mtperevozki.ru/zajavka-na-dostavku-posylki.html\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>от</strong> <strong>3кг.</strong></span></a></span></span></span></strong></p>\r\n<p> </p>\r\n<p><strong> </strong></p>\r\n<p><strong><span style=\"color: #800000;\"> </span></strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><span style=\"color: #800000;\"> </span></strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><span style=\"color: #800000;\"> </span></strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><span style=\"color: #800000;\"> </span></strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><span style=\"color: #800000;\"><a href=\"http://mtperevozki.ru/ru/cform.html\"> </a><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\"><a href=\"http://mtperevozki.ru/ru/cform.html\"><strong>Отправить</strong> </a></span></span></span><span style=\"color: #800000;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\"><a href=\"http://mtperevozki.ru/ru/cform.html\"><strong>запрос на</strong> <strong>доставку сборного груза от 100кг.</strong></a></span></span></span></strong></p>\r\n<p><br /><strong>Доставка посылок и сборных грузов железнодорожным транспортом. </strong><br />Перевозка посылок, небольших частных грузов, небольших партий товаров железнодорожным транспортом в Россию, Казахстан, Узбекистан, Молдову, Китай, страны СНГ и Европы – надежный, удобный и распространенный способ доставки сборных грузов, посылок, личных вещей, подарков, предметов первой необходимости на любые расстояния. После приема и оформления вашей посылки, она отправляется в пункт назначения ближайшим поездом, по самой оптимальной логистической цепочке. Интенсивное развитие железнодорожных путей в странах Европы, СНГ и Китае, позволяет выбирать наиболее быстрые маршруты доставки грузов через крупные международные транспортные узлы. Отправка посылок железнодорожным транспортом и их получение осуществляются круглосуточно.<br /><br /><strong>Международная доставка посылок авиатранспортом.</strong><br />Когда вам необходима экспресс-доставка посылки, небольшого груза, или товара приобретённого через Интернет магазин, срочная небольшая товарная партия, в самые кратчайшие сроки, вплоть до одних суток, можно воспользоваться авиа доставкой. Отправление посылки происходит ближайшим рейсом, таким образом, в зависимости от расстояния, посылка может быть доставлена адресату даже в день отправления. Международное авиасообщение развито во всех крупных городах Европы, СНГ, России, Украины, Казахстана, Турции, Китая, Молдовы и организация доставки посылки по схеме «из рук в руки» является распространённой услугой среди курьерских и транспортных компаний. Наша компания гарантирует скорость отправки и высокое качество доставки посылок авиатранспортом.<br /><br /><strong>Стоимость перевозки посылок и небольших партий сборных грузов зависит от таких факторов, как:</strong><br />Характер посылки или груза, габариты посылки/груза  и вес, объём. Выделяют мелкие посылки массой до 3-5кг, тяжеловесные – 10-20кг, мелкие грузы от 20кг. до 200кг., грузы от 200кг, до 1000кг. Стоимость доставки посылки будет тем дороже, чем больше ее вес и объём. А также зависит от необходимого типа транспорта. Цена доставки будет разной в зависимости от того, какой кузов грузовика или тип железнодорожного вагона применяется для перевозки. Доставка груза или посылки, требующей определенного температурного режима, в изотермическом фургоне или вагоне-рефрижераторе всегда дороже, нежели стандартная перевозка. Доставка посылки авиатранспортом – всегда самый дорогостоящий способ перевозки ввиду дороговизны обслуживания авиатранспорта.<br />Скорость доставки. Цена за экспресс-доставку посылок, когда срок доставки фактически идет на часы и минуты, определенно выше, по сравнению со стандартной доставкой в 2-3 дня.<br />В зависимости от расстояния и направление перевозки труднодоступности населенного пункта, количества задействованных единиц транспорта и человеческих трудозатрат будет сформирована итоговая стоимость за доставку посылки.<br /><br /><strong>Условия доставки посылок</strong>. Посылки принимаются в упакованном виде, так чтобы избежать повреждений в процессе перевозки. Минимальные и максимальные допустимые размеры посылки, ограничения по объему и весу, вам назовет сотрудник нашей компании, в зависимости от типа применяемого транспорта и других условий перевозки. Отдельные требования касаются посылок содержащих продукты питания, жидкости, лекарственные препараты. Подробнее об условиях доставки таких посылок Вам расскажут сотрудники компании, изучив Вашу заявку.<br /><strong> </strong></p>\r\n<p><strong>Сборные и попутные перевозки мелких грузов и посылок. </strong>Доставка сборных и попутных грузов, посылок с применением различного транспорта идеально подходит для выполнения вашей заявки. Благодаря комбинированию автомобильного, железнодорожного, авиатранспорта, и услуги консолидации грузов на крупных складах в Нидерландах, Германии, Чехии, Польше, Италии, России, Китае, в наших силах организовать доставку грузов и посылок в любом направлении, оперативно и по доступной стоимости. Объединение и перевозка  грузов от разных отправителей в одном транспортном средстве позволяет значительно снизить цену за доставку – каждый оплачивает перевозку только за место своего груза/посылки, тогда как отдельная перевозка обошлась бы в разы дороже. Условия доставки, возможность перевозки, <strong>стоимость доставки посылок и сборных грузов</strong> вы узнаете после отправки нам заполненной заявки. Менеджер отдела сообщит вам все детали перевозки вашего груза в вашем направлении.</p>\r\n<p><strong><span style=\"font-size: medium;\"> </span></strong></p>\r\n<p> </p>\r\n<p><span style=\"color: #993300;\"><strong><span style=\"color: #993300;\"><a href=\"zajavka-na-dostavku-posylki.html\"><strong>Рассчитать стоимость  доставки посылки </strong></a></span><span style=\"font-size: medium;\"><span style=\"color: #993300;\"><a href=\"zajavka-na-dostavku-posylki.html\"><strong>от</strong> </a></span></span><span style=\"font-size: medium;\"><span style=\"color: #993300;\"><a href=\"zajavka-na-dostavku-posylki.html\"><span style=\"font-family: verdana,geneva;\"><strong>3</strong> <strong>кг</strong></span><strong>.</strong></a></span></span><br /></strong></span></p>\r\n<p><span style=\"color: #993300;\"><strong> </strong></span></p>\r\n<p><span style=\"color: #993300;\"><strong><a href=\"ru/cform.html\"><strong>Отправить</strong> <strong>запрос на доставку сборного груза от 100кг.</strong></a></strong></span></p>\r\n<p><span style=\"color: #993300;\"><strong><br /></strong></span></p>', '', 1, 0, 0, 0, '2013-09-03 12:46:05', 62, '', '2014-01-04 11:30:09', 62, 0, '0000-00-00 00:00:00', '2013-09-03 12:46:05', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 104, 0, 19, 'посылки, доставка посылок, передать посылку, экспресс доставка, авиа доставка посылок', 'доставка посылок, доставить посылку из Европы, доставить посылку в Россию, отправка посылок из Америки, компании по доставки посылок, курьерская компания по отправке посылок в Россию, Молдову, Украину ', 0, 41387, 'robots=\nauthor='),
(170, 'Заявка на доставку посылки, стоимость доставки посылки, как отправить посылку, бандероль, пакет.', 'zajavka-na-dostavku-posylki', '', '<p>Чтобы <strong>отправить посылку, узнать стоимость доставки,</strong> необходимо заполнить все данные о вашей посылки, товаре или грузе.</p>\r\n<p>{rsform 8}</p>', '', 1, 0, 0, 0, '2013-09-03 13:56:15', 62, '', '2013-09-04 05:44:24', 62, 0, '0000-00-00 00:00:00', '2013-09-03 13:56:15', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 12, 0, 18, '', '', 0, 7810, 'robots=\nauthor='),
(182, 'Морские перевозки из всех портов Мира, доставка грузов морскими контейнерами из морского порта всех стран.', '-morskie-perevozki-morskie-kontejnernye-gruzoperevozki-dostavka-gruzov-kontejnerami-morskim-putjom-', '', '<p><strong>Морские и контейнерные грузоперевозки.</strong><br />Осуществляя Международные морские перевозки, мы придерживаемся главным критериям: оперативность, качество, надёжность, цена-качество выполнения всех транспортных процессов и взаимодействие с заказчиком перевозки. Оповещение грузовладельца об отправки груза, контейнера, из порта отправления в порт прибытия.<br />Использование контейнеровозов и морских контейнеров всех необходимых типов и размеров, для всех типов грузов. <span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">20-DV, 40-DV, 40-HQ, 20-REF, 40-REF.</span> Направление морских и контейнерных перевозок это практически все порты Европы, России, Украины, Китая, Турции, Греции, Польши, Арабских Эмират и др.<br /><strong><br />Таким образом, процесс Морской перевозки </strong>происходит под пристальным контролем клиента, ежедневное оповещение, о местонахождении груза, контейнера, заблаговременное устранение и решение возможных нюансов при перевозке. <br />В стоимость морской перевозки учитывается подача порожнего контейнера, страхование груза, погрузка на судно, внутрипортовое экспедирование и сборы и доставка груза в контейнере, получателю. <br />Своевременная подача контейнеровоза для доставки контейнера из порта под погрузку и выгрузку, для дальнейшей доставки грузополучателю. Оперативные действия со стороны наших брокеров в порту. Все процессы транспортировки груза отработанны для успешной морской и контейнерной перевозки, и доставки товара заказчику, вовремя и без лишних хлопот.<br /><strong> </strong></p>\r\n<p> </p>\r\n<p><strong>Данная заявка ускорит процесс заказа морской перевозки</strong>.</p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2013-09-16 15:21:15', 62, '', '2013-11-27 18:15:15', 62, 0, '0000-00-00 00:00:00', '2013-09-16 15:21:15', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 23, 0, 11, 'перевозки контейнеров, доставка грузов морскими контейнерами, доставить контейнер из Китая, привезти груз из Турции в контейнере, доставить груз морским путём', 'морские перевозки из Китая, морские перевозки контейнеров из Америки, Арабских эмират, доставка грузов из Китая, заказать морскую перевозку', 0, 13943, 'robots=\nauthor='),
(173, 'Перевозки из Черногории в Россию, Черногория-Россия.Грузоперевозки из Черногории в Россию, Молдову, Беларусь, Украину, Казахстан.', 'perevozki-chernogorija', '', '<p><strong>Перевозки из Черногории в Россию, Черногория-Россия. </strong>Грузоперевозки из Черногории в Украину, Беларусь, Молдову, перевозка груза из Черногории в Казахстан, страны Прибалтики.</p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость перевозки из Черногории.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Черногорию.</strong><br />Страна перевозки груза Черногория, наиболее развитые индустриальные города Черногории это: Подгорица, Никшич, Плевля, Биело-Поле, Херцег-Нови, Беране, Цетине, Будва. <br /><strong>Основной импорт грузов в Черногорию это</strong>: топливо, минеральные масла, химические удобрения, автомобили, транспортные средства, реакторы, котлы, электромашины, оборудование, изделия из металла, пластмассы, лекарства, мебель. <br /><strong>Основной экспорт грузов из Черногории в Россию, Беларусь, Молдову, Литву, Латвию, Эстонию, Казахстан </strong>это: сырье, полуфабрикаты, древесина, металлы, топливо, табачные изделия, фрукты, напитки, шерстяные ткани, мясные изделия. <br />Торговые отношения  у Черногории с Россией, Германией, Италией, Грецией, Сербией, Хорватией, Словенией, Боснией и Герцеговиной, Венгрией, Китаем. <br /><strong>Грузоперевозки из Черногории в Россию,</strong> Казахстан, Беларусь, Молдову, Украину можно осуществить любым видом транспорта: автомобильным, водным, железнодорожным, авиа транспортом. По территории Черногории проходит ряд трансевропейских магистралей, таким образом через страну проезжает довольное большое количество грузового транзитного автотранспорта. Железнодорожный транспорт Черногории не является достаточно развитым, однако функционируют несколько грузовых веток с соседними странами. Морское грузовое сообщение составляет основу транспортных перевозок Черногории. Грузооборот крупнейшего порта Бар - 5 млн тонн грузов в год. На территории Черногории имеется два международных аэропорта: в Подгорице и в Тивате.<br /><strong>Таможенное оформление грузов при перевозках из/в Черногорию</strong> происходит в соответствии с <br />Законом «О таможне» и «О таможенном тарифе». Процентная ставка таможенной пошлины составляет от 0 до 30 %, средний процент 6,17 %. Для быстрого прохождения процедуры таможенного оформления в Черногории, от перевозчика требуется предоставить все необходимые товаротранспортные документы, удостоверяющие происхождение груза, маршрут перевозки, название транспортных средств и тд. <br />Транспорт, предоставляемый для перевозки грузов из Черногории, к примеру, Черногория-Россия, Черногория-Казахстан, Черногория-Молдова, Черногория-Беларусь, может быть попутным  транспортных компаний из других стран. Стоимость попутной перевозки груза из Черногории будет ниже, чем оплата за заказ перевозки из Черногории у местной транспортной компании.<br /><strong>Заказать перевозку груза в/из Черногории в страны СНГ.</strong><br />Осуществить быстрый заказ транспорта в нужной вам категории международных грузоперевозок вы можете на нашем транспортной сайте. Чаще всего доставка грузов из Черногории автотранспортом: тентованными прицепами, рефрижераторами, изотермическими фургонами. В зависимости от типа груза – это может быть опасный, негабаритный, тяжеловесный груз. Вам предложат подходящий, технически оснащенный грузовик. Услуги транспорта по организации железнодорожных и морских контейнерных перевозок в Черногорию, а также мультимодальные перевозки с применением авиатранспорта. Автомобильный транспорт для доставки сборных и попутных грузов из Черногории.<br /><strong>Выполнить быстрый поиск транспорта для перевозки груза из Черногории в Россию, Украину, Молдову.</strong><br />Для того, чтобы быстро заказать транспорт для перевозки груза из Черногории, заполните форму заявки: внесите ваши контактные данные, направление перевозки, описание груза, дату погрузки. <br />Как только ваша заявка будет обработана, с Вами свяжется менеджер компании и сообщит <strong>цену за доставку груза и другие детали грузоперевозки в направлении Черногория.</strong><br /><br /><br /></p>', '', 1, 1, 0, 1, '2013-09-04 17:25:50', 62, '', '2013-09-04 17:46:43', 62, 0, '0000-00-00 00:00:00', '2013-09-04 17:25:50', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 12, 0, 2, 'перевозки Черногория, автотранспорт из Черногории, транспорт из Черногории, грузоперевозки фруктов из Черногории в Россию, Беларусию, Польшу', 'перевозка груза из Черногории грузов из Черногории в Казахстан, Узбекистан.Черногория-Россия, автоперевозки из Черногории, доставка грузов из Черногории в Литву, Латвию, Эстонию, доставить груз из Черногории в Молдову', 0, 9144, 'robots=\nauthor='),
