(175, 'Ваш заказ успешно размещён', 'vash-zakaz-uspeshno-razmeshhjon', '', '<p> </p>\r\n<p>Ваш заказ успешно размещён в <span style=\"text-decoration: underline;\"><strong><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/dostavka-posylok-banderolej/zakazy-na-dostavku-posylok-pisem-banderolej\" target=\"_blank\">раздел заказов</a></strong></span>.</p>', '', 1, 0, 0, 0, '2013-09-05 19:58:57', 62, '', '2013-09-05 20:03:39', 62, 0, '0000-00-00 00:00:00', '2013-09-05 19:58:57', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 15, '', '', 0, 747, 'robots=\nauthor='),
(176, 'Грузы для автовладельцев. Грузы для транспортных компаний. Разместить транспорт, предложения грузов, грузы для перевозок,грузы для транспорта, поиск грузов, информация о грузах.', 'dlja-avtovladelcev', '', '<p><strong>Грузы для автовладельцев, перевозчиков и транспортных компаний. </strong><br />Для транспортных компаний, и  авто перевозчиков<strong>,</strong> компаний предоставляющих морские перевозки, контейнерные перевозки, курьерские услуги, услуги по экспресс доставкам, транспортникам специализирующихся на перевозках сборных грузов, привлечение вашего транспорта, и ваших транспортных услуг, для совместных международных перевозок.<br /><br />Не секрет что поиск груза занимает много времени у транспортных компаний и частных перевозчиков. Наша компания постоянно привлекает транспорт для перевозки грузов из разных стран. Наша компания как экспедитор международных перевозок, сотрудничая со многими грузовладельцами-заказчиками перевозок из разных стран Европы, Прибалтики, России, Казахстана, Молдовы, Румынии, имеет возможность размещать заказы на перевозку среди привлечённых перевозчиков и транспортных компаний.<br /><br />Транспортной компании необходимо за пару минут,  прямо на сайте,<strong> разместить заявку о свободном или попутном транспорте, и получить заказ на перевозку груза.</strong> К примеру, у нас есть грузы: из Европы в Россию, из России в Казахстан и Таджикистан. Грузы из Эстонии в Россию, из Германии в Россию, из Румынии в Россию, из Литвы, Латвии в Узбекистан, грузы из Польши в Россию, из Украины в Европу или другую страну, куда вы как транспортная компания может осуществить грузоперевозку. Если у вас рефрижераторы? предложим вам грузы для рефрижераторных перевозок, если у вас тенты разных объёмов, или мини грузовики с небольшой грузоподъёмностью, вам будут предложены грузы соответствующие вашему транспорту. Если у вас негабаритный транспорт, трейлера: значит, найдём вам груз для вашего трейлера. Без загрузки вы долго не простоите.<br /><br />Ваши машины простаивают в Турции, Греции, Румынии, Молдове, Казахстане или в Беларуси, вы в поиске грузов? <strong>Заполните заявку, предложите ваш транспорт</strong>, вероятность получить выгодное предложение по грузам увеличится.<br /><br /><strong>Наши клиенты грузовладельцы</strong> из Европы, из России, Беларусии, Казахстана, Турции, Польши, Греции и других стран. Это производственные компании продуктов питания, торговые компании стройматериалов, запчастей и автошин, фармацевтические компании, компании по производству удобрений, и пищевых добавок, сталелитейные заводы, машиностроительные комбинаты. <br /><br /><strong>Наши привлекаемые транспортные компании</strong> из России, Молдовы, Румынии, Грузии, Турции, Греции, Польши. При необходимости предоставим рекомендации от транспортных компаний, которые получают от нас информацию о грузах и без остановки перевозят грузы от Турции до Норвегии, от Эстонии до Узбекистана. Грузы из Молдовы, Румынии, Словении, Сербии. Грузы для всех типов транспорта из Болгарии, Чехии, Австрии, Польши и других стран.<br /><strong>Станьте нашим партнёром по доставке груза, заявите о вашем транспорте</strong> заранее, и наши менеджеры помогут вам с загрузками для вашего авто.</p>\r\n<p> </p>\r\n<p><strong>Что бы найти груз для вашего транспорта необходимо..</strong></p>\r\n<p><strong><br /></strong></p>\r\n<h2><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/predlozhit-transport\" target=\"_blank\">Предложить автотранспорт</a></span></span></h2>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"> </span></span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<h2><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/morskie-kontejnernie-perevozki/predlozhit-transport\" target=\"_blank\">Предложить морской и контейнерный транспорт</a></span></span></h2>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"> </span></span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<h2><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/zheleznodorozhnye-gruzoperevozki/dobavit-razmestit-zheleznodorozhnye-vagony\" target=\"_blank\">Предложить грузовые Ж. Д. вагоны</a></span></span></h2>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"> </span></span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<h2><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/predlozhit-transport\" target=\"_blank\">Предложить услуги  авиа транспорта</a></span></span></h2>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"> </span></span></p>\r\n<p><span style=\"font-family: verdana,geneva;\"> </span></p>\r\n<h2><span style=\"font-family: verdana,geneva;\"><span style=\"font-size: small;\"><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/dostavka-posylok-banderolej/predlozhit-transport\" target=\"_blank\">Предложить курьерские услуги, доставка посылок</a></span></span></h2>', '', 1, 0, 0, 0, '2013-09-10 06:22:55', 62, '', '2013-12-26 07:06:59', 62, 0, '0000-00-00 00:00:00', '2013-09-10 06:22:55', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_