(177, 'Поиск грузов для перевозки, грузы для перевозок,поиск груза Европа,Россия,грузы во все страны, привлекаем транспорт для перевозки грузов.', 'razmestit-transport', '', '<p><strong>Грузы для авто транспортных компаний</strong>, всех категорий авто транспорта.<strong> </strong>Разместите ваш автотранспорт, получайте заказы на перевозку.</p>\r\n<p><strong>Авто владельцы и руководители транспортных компаний, частные перевозчики и экспедиторы. </strong></p>\r\n<p>Размещая ваш  грузовой автотранспорт,  вы увеличиваете возможность получать необходимые заказы на перевозку грузов автотранспортом. Грузовладельцы, заказчики перевозок, из разных стран, увидят ваш размещённый транспорт, на наших информационных сайтах. Получение заказов на автоперевозки вам, гарантированно. Предложите ваш автотранспорт получите заказ!<strong> </strong></p>\r\n<p><strong>Отправьте заявку на размещение автотранспорта и получение заказов для автоперевозок.</strong></p>\r\n<p><strong><br /></strong></p>\r\n<h2><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/predlozhit-transport\" target=\"_blank\">Предложить, разместить автотранспорт</a></h2>', '', 1, 0, 0, 0, '2013-09-10 06:23:38', 62, '', '2013-12-25 17:39:00', 62, 0, '0000-00-00 00:00:00', '2013-09-10 06:23:38', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 34, 0, 13, 'грузы, груз, грузов, грузовладельцы, поисковой сайт по грузам, сайт по грузам, транспортный сайт по поиску грузов', 'Груз для перевозки,найти груз для перевозок, грузы из России, груз из Европы, найти груз, как найти грузовладельца, страна грузов все грузы можно найти если разместить транспорт', 0, 5322, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(178, 'Перевозки Македония-Россия,грузоперевозки из Македонии в Россию, Украину, Беларусию, Молдову, Казахстан', 'makedonija', '', '<p><strong>Перевозки из Македонии в Россию, грузоперевозки Македония-Россия, доставка грузов из Македонии в Молдову, Украину, Беларусь, Казахстан, Таджикистан</strong>. Македония, города: Скопье, Битола, Прилеп, Куманово, Тетово, Штип<br /><br /><strong>Заказать транспорт для перевозки в направлении Македония.</strong><br /><br />{mtpform}<strong></strong></p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Македонию.</strong><br />Страна перевозки груза Македония, наиболее развитые индустриальные города Македонии это: Скопье, Битола, Прилеп, Куманово, Тетово, Штип.<br /><strong>Основной импорт грузов в Македонию</strong> это: машины и оборудование, химические продукты, топливо, продукты питания, сырье, животные масла, готовые изделия. <br /><strong>Основной экспорт грузов из Македонии в Россию, Украину, Казахстан, Молдавию. Узбекистан, Беларусь</strong> это: текстиль, промышленные товары, железо, сталь, продукты питания, табачные изделия, овощи и фрукты. <br />Торговые отношения у Македонии с Германией, Италией, Болгарией, Хорватией, Грецией, Словенией, Турцией, Венгрией, Сербией, Черногорией, США, Россией. <br />Грузоперевозки из Македонии в Россию, Казахстан, Беларусь, Молдову осуществляются автомобильным, железнодорожным, воздушным транспортом. В целом, транспортная инфраструктура Македонии находится на слабом уровне развития. Выходя к морю нет. Действуют для международных аэропорта. <br /><strong>Таможенное оформление грузов при перевозках из/в Македонии </strong>регулируется Законом о внешнеторговой деятельности, Законом о таможенном тарифе. Таможенный тариф включает номенклатуру товаров и ставки таможенных пошлин, которыми облагаются товары при импорте грузов их третьих стран. Импорт и экспорт грузов в/из Македонии в страны ЕС – свободный и не облагается пошлинами. Для того, чтобы получить разрешение на осуществление экспортно-импортных операций в Македонии требуется предоставить данные о фирме, личный номер; тарифный номер на десятизначном уровне; наименование продукции по таможенной<br />номенклатуре; торговое название товара, количество продукции, компания и полное название иностранного импортера или экспортера; период, в котором будет осуществлена перевозка груза.<br /><strong>Транспорт для перевозок грузов из Македонии,</strong> например, Македония -Россия, Македония -Казахстан, Македония -Молдова, Македония -Беларусь, может следовать из других стран, выполняя попутную перевозку. Воспользовавшись услугой попутных перевозок, можно значительно сэкономить на доставке груза, чем при заказе грузоперевозки из Македонии у местной транспортной компании.<br /><strong>Сделать заказ перевозки грузов в/из Македонии в страны СНГ</strong>.<br />Выбрав нужную категорию международных грузоперевозок на нашем сайте, можно быстро найти и заказать транспорт для доставки любого груза. Самая востребованная услуга – это автоперевозки из Македонии тентованными прицепами, рефрижераторами и изотермическими фургонами. Перевозки грузовиками и железнодорожным составом других типов грузов: опасных, негабаритных, тяжеловесных. Услуги спец.транспорта по организации контейнерных и мультимодальных перевозок из Македонии. Сборные и попутные перевозки, перевозки негабаритных грузов, доставка опасных грузов ADR класса, из Македонии по оптимальным условиям для грузовладельцев.  <br /><strong>Поиск транспорта для перевозки грузов из Македонии в Россию, Беларусь, Украину, Молдову, Казахстан</strong>. <br />Для того, чтобы заказать транспорт для перевозки груза из/в Македонии выполните следующие действия: внесите свои контактные данные, описание груза, направление доставки, время погрузки. <br />В ближайшее время вы получите ответ от наших сотрудников, которые предоставят полную информацию о <strong>стоимости и условиях перевозки в направлении Македония. </strong><br /><br /><br /><br /></p>', '', 1, 1, 0, 1, '2013-09-10 18:14:47', 62, '', '2013-09-10 18:32:20', 62, 0, '0000-00-00 00:00:00', '2013-09-10 18:14:47', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 4, 0, 1, 'перевозки Македония, транспорт из Македонии, доставка грузов в Македонию, найти транспортную компанию для перевозки из Македонии', 'Перевозки из Македонии, в Россию, Доставить груз Македония-Беларусь, Македония-Молдова, автоперевозки из Македонии, Транспорт из Македонии', 0, 5993, 'robots=\nauthor='),
(179, 'Перевозки в Таджикистан, грузоперевозки из Европы в Таджикистан,доставка грузов из Таджикистана  в СНГ', 'tadzhikistan', '', '<p><strong>Грузоперевозки Таджикистан -Россия- Таджикистан. Перевозки из России в Таджикистан, автоперевозки в Таджикистан из стран СНГ</strong>.Таджикистан:Душанбе, Худжанд, Курган-Тюбе, Куляб, Хорог, Истаравшан.</p>\r\n<p> </p>\r\n<p><strong>Заказать перевозку в направлении Таджикистана.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Таджикистан. </strong>Страна перевозки груза Таджикистан, наиболее развитые индустриальные города Таджикистана это: Душанбе, Худжанд, Курган-Тюбе, Куляб, Хорог, Истаравшан.<br /><strong>Основной импорт грузов из Европы, России в Таджикистан</strong> это: нефтепродукты, чёрные металлы, продукция лёгкой промышленности, автомобили, сельскохозяйственная техника, продовольствие, фармацевтическая продукция, медицинское оборудование, древесина. <br /><strong>Основной экспорт грузов из Таджикистана в Россию, Украину, Беларусь, Молдову</strong> это: металлы, хлопковые и шёлковые ткани, сельскохозяйственная продукция, овощи и фрукты, жиры и масла растительного и животного происхождения, сахар, злаковые культуры. <br />Торговые отношения у Таджикистана с Россией, Китаем, Казахстаном, Узбекистаном, Нидерландами, Турцией, Ираном, Туркменистаном, Киргизией. <br /><strong>Грузоперевозки в Таджикистан из Европы, Россию, Казахстана, Беларуси, Молдовы </strong>осуществляются автомобильным, железнодорожным, воздушным транспортом. В 2012 году автотранспортом было перевезено 59,9 млн тонн грузов, железнодорожным – 8,4млн тонн, воздушным – 68,3млн тонн грузов. Авиаперевозки обслуживаются пятью аэропортами. <br /><strong>Таможенное оформление грузов при перевозках из/в Таджикистан</strong> осуществляется в соответствии с Законом Республики Таджикистан «О внешнеторговой деятельности». Согласно нему «иностранным лицам, занимающимся импортом или экспортом товаров, предоставляется такой же режим, который предоставляется отечественным лицам». В отношении товаров, происходящих из государств-участников СНГ, действует специальное Соглашение о Правилах определения страны происхождения товаров. Являясь членом ЕврАзЭС, Таджикистан установил режим свободной торговли и применяет нулевую ставку ввозной таможенной пошлины при импорте товаров, происходящих из государств-членов ЕврАзЭС.<br /><strong>Предоставляемый транспорт для перевозки грузов из Таджикистана,</strong> к примеру, Таджикистан-Россия, Таджикистан-Казахстан, Таджикистан -Молдова, Таджикистан-Беларусь, часто бывает попутным, доставляющим грузы из других стран. Заказать попутные грузоперевозки будет дешевле и удобнее, чем оплачивать полную стоимость за перевозку груза из Таджикистана местной транспортной компании.<br /><strong>Заказать перевозку грузов в/из Таджикистан в страны СНГ.</strong> Заказать нужный транспорт для перевозки грузов из или в Таджикистан вы можете прямо на нашем сайте. Обычно это автомобильные перевозки: тентованными прицепами, рефрижераторами и изотермическими фургонами. Железнодорожный транспорт для перевозки любых типов грузов в Таджикистан, включая: перевозку опасных грузов, негабаритные перевозки, длинномерные, объемные, тяжеловесные грузы грузов. Услуги транспорта по организации воздушных и мультимодальных перевозок в Таджикистан.  Контейнерные, сборные, попутные грузоперевозки из Таджикистана в нужном вам объеме и в короткие сроки. <br /><strong>Осуществить поиск транспорта для перевозки груза в Таджикистан</strong> из Россию, Беларусии, Молдовы, Казахстана. <br />Для заказа транспорта заполните форму онлайн заявки: укажите ваши контакты, данные по грузу, направление перевозки, дату погрузки. <br />Как только наши сотрудники свяжутся с вами и сообщат стоимость перевозки, вы получите возможность <strong>доставить груз по направлению Таджикистан. </strong><br /><br /></p>', '', 1, 1, 0, 4, '2013-09-11 12:06:44', 62, '', '2013-09-11 15:40:23', 62, 0, '0000-00-00 00:00:00', '2013-09-11 12:06:44', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 3, 'перевозки Таджикистан, перевозка грузов Таджикистан-Россия, Таджикистан-Беларусь, Таджикистан-Украина, грузоперевозки из и в Таджикистан', 'перевозки в Таджикистан, автоперевозка Россия-Таджикистан, перевезти груз в Таджикистан, найти транспорт для перевозки грузов в Таджикистан', 0, 15297, 'robots=\nauthor='),
(180, 'Перевозки Туркменистан Россия Туркменистан, грузоперевозки из Турменистана в Россию, Украину, Беларусь, Молдову, автоперевозки в Туркменистан', 'turkmenistan', '', '<p><strong>Грузоперевозки в Туркменистан</strong>, перевозки из России в Туркменистан, доставить груз из Туркменистана в СНГ, перевозки Европа-Туркменистан,Россия-Туркменистан.Туркменистан: Ашхабад, Туркменабад, Дашогуз, Туркменбаши, Мары.</p>\r\n<p> </p>\r\n<p><strong>Заказ  перевозок в Туркменистан и из Туркменистана.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Как найти транспортную компанию для доставки груза из/в Туркменистан.</strong> Страна перевозки груза Туркменистан(Туркмения), наиболее развитые индустриальные города Туркменистана это: Ашхабад, Туркменабад, Дашогуз, Туркменбаши, Мары. <br /><strong>Основной импорт грузов в Туркменистан </strong>это: промышленная продукция, продовольствие, химические препараты, лекарства, металлоконструкции, лесоматериалы, транспортные средства, шины, запчасти. <br /><strong>Основной экспорт грузов из Туркменистана в Россию, </strong>Украину, Молдову, Румынию, Беларусию это: нефтепродукты, товары хлопковой группы, хлопчатобумажные ткани, ковры и ковровые изделия, постельное белье, костюмы, шерсть, трикотаж. <br /><strong>Торговые отношения  у Туркменистана</strong> с Украиной, Польшей, Венгрией, Россией, Китаем, Турцией, Германией, Италией, Ираном, ОАЭ.  <br /><strong>Для грузоперевозок из Туркменистана </strong>в Россию, Казахстан, Беларусь, Молдову, Украину используется автомобильный, водный, железнодорожный, воздушный транспорт. Автомобильный транспорт играет ведущую роль при перевозках в/из Туркменистана. Железнодорожным транспортом перевозится 80 % всех экспортно-импортных и транзитных грузов. Развиваются морские перевозки: на начало 2012 года морской торговый флот Туркмении насчитывал 10 судов. Действуют 3 аэропорта с международным авиа сообщением.<br /><strong>Таможенное оформление грузов при перевозках из/в Туркменистан</strong> осуществляется согласно национальному таможенному законодательству. Им определены понятия и виды таможенных пошлин, сборов, порядок их формирования и применения, установлены ставки таможенных платежей. Значительное количество товаров импортируется в Туркменистан беспошлинно, однако почти вся импортируемая продукция подлежит сертификации. При экспортных операциях некоторые товарные группы подлежат обложению пошлинами; но также действуют внутренние льготные транспортные тарифы. <br /><strong>Транспорт для перевозки грузов из/в Туркменистан</strong>, например, Туркменистан-Россия, Туркменистан-Казахстан, Туркменистан -Молдова, Туркменистан-Беларусь, может быть попутным из других стран. В большинстве случаев для грузовладельца выгодней воспользоваться услугами именно попутного транспорта, нежели платить полную стоимость за перевозку груза из Туркменистана местной компании. <br /><strong>Выполнить заказ перевозки груза в/из Туркменистана в страны СНГ.</strong> На нашем транспортном сайте представлены все востребованные категории международных грузоперевозок: автомобильные перевозки тентами, рефрижераторами или изотермическими фургонами; перевозка в Туркменистан опасных, негабаритных, объемных, тяжеловесных грузов, также доставка грузов из  Туркменистана. Доставка сборных и попутных грузов в Туркменистан по схеме «от двери к двери». Услуги морских и железнодорожных контейнерных перевозок из/в Туркменистан.<br /><strong>Поиск транспорта для перевозки груза из Туркменистана в Россию, Украину, Беларусь, Молдову, Казахстан.</strong> Через форму он-лайн заявки на нашем сайте можно быстро найти и заказать транспорт для перевозки грузов из Туркменистана: введите ваши контактные данные, характеристики груза, направление перевозки, дату и время погрузки. <br />Как только ваша заявка будет обработана, с вами свяжутся наши сотрудники и <strong>сообщат цену за грузоперевозку по направлению Туркменистан.</strong><br /><br /><br /><br /><br /></p>', '', 1, 1, 0, 4, '2013-09-11 12:07:02', 62, '', '2013-09-11 16:31:08', 62, 0, '0000-00-00 00:00:00', '2013-09-11 12:07:02', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 10, 0, 2, 'Туркменистан, как доставить груз в Туркменистан, где найти машину из Туркменистана в Россию, автоперевозки из России в Туркменистан', 'перевозки в Туркменистан, грузоперевозка Туркменистан-Россия, Туркменистан-Литва, Туркменистан-Латвия, Перевозка грузов из Туркменистана в Европу, доставить груз из Туркменистана в Молдову', 0, 18138, 'robots=\nauthor='),
(181, 'Ваш транспорт успешно размещён', 'vash-transport-uspeshno-razmeshhjon', '', '<p><span id=\":3rc\" dir=\"ltr\">Ваш транспорт успешно размещён и добавлен в раздел транспорта. Предложения по грузам  вам поступят в ближайшее время.</span></p>\r\n<p><span dir=\"ltr\"><br /></span></p>\r\n<p><span dir=\"ltr\"><strong>Посмотреть свой транспорт вы можете в разделах.</strong></span></p>\r\n<p><span dir=\"ltr\"><strong><br /></strong></span></p>\r\n<p><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/transport-na-saite\" target=\"_blank\"><span dir=\"ltr\">Раздел \"Международные автоперевозки\"</span></a></p>\r\n<p><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/morskie-kontejnernie-perevozki/transport-na-sajte\" target=\"_blank\"><span dir=\"ltr\">Раздел \"Морские контейнерные грузоперевозки\"</span></a></p>', '', 1, 0, 0, 0, '2013-09-12 20:07:23', 62, '', '2013-10-13 18:01:38', 62, 0, '0000-00-00 00:00:00', '2013-09-12 20:07:23', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 12, 0, 12, '', '', 0, 65, 'robots=\nauthor='),
(183, 'Автоперевозки международные, грузоперевозки из Европы,России, Румынии, Молдовы, Перевозки из Турции,Греции.Транспорт для автоперевозок. ', '-avtotransportnye-perevozki-mezhdunarodnye-avto-gruzoperevozki-transport-dlja-perevozok-vseh-gruzov', '', '<p><strong>Автоперевозки международные и межрегиональные.</strong><br />При выполнении международных автоперевозок, главное это качество доставки груза. Основа международной автоперевозки для нас, это быстрое реагирование на выполнение всех поставленных грузовладельцем задач: своевременная подача авто транспорта под погрузку, нужного размера, в нужном месте (страна, город). Своевременная, согласно срокам, доставка груза на склад грузополучателя.<br /><strong><br />При необходимости помощь в оформление сопроводительных документов</strong> <strong>TIR. CMR. ГТД.</strong> Сопровождение клиента  по всем этапам перевозки, информация о передвижении его груза, срок прибытия транспорта под разгрузку.<br />В стоимость грузоперевозки входит подача авто транспорта, прохождение транзитных таможен, CMR  страхование ответственности перевозчика. При необходимости страхование перевозимого груза. Все перевозки происходят согласно конвенции TIR и CMR .<br />В том случае, когда груз относится к негабаритным грузам или необходимо перевезти опасный груз ADR , привлекается именно тот тип транспорта, который соответствует данному типу груза.</p>\r\n<p><strong>Направление перевозок особого значения не имеет</strong>, наш опыт в международных перевозках позволяет нам организовать доставку груза из всех стран Европы, Азии, Востока, Прибалтики, Скандинавии, Балканских стран, стран таможенного союза и других стран СНГ.<strong> </strong></p>\r\n<p> </p>\r\n<p><strong>Данная заявка для заказа грузоперевозки автотранспортом</strong>.</p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2013-09-16 15:22:09', 62, '', '2015-03-21 13:27:57', 62, 0, '0000-00-00 00:00:00', '2013-09-16 15:22:09', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 33, 0, 10, 'транспортировка грузов из Литвы, транспортная компания по перевозки грузов авто транспортом', 'автоперевозки из Европы, грузовые автоперевозки из Турции, Греции, России, доставка грузов авто транспортом из Болгарии, Сербии , Румынии, Молдовы', 0, 22864, 'robots=\nauthor='),
(184, 'Перевозка грузов ж.д вагонами.Железнодорожные грузоперевозки, доставка грузов в ж.д.вагонах.', '-zheleznodorozhnye-perevozki-perevozka-gruzov-zhd-vagonamizheleznodorozhnye-gruzoperevozki-vagonami-i-kontejnerami-', '', '<p><strong>Грузоперевозки железнодорожным транспортом, ж. д. грузоперевозки</strong></p>\r\n<p>Грузоперевозки железнодорожным транспортом осуществляются с четким соблюдением всех международных норм и стандартов международных  ж.д.грузоперевозок, при тесном взаимодействии с заказчиком перевозки. <br />Железнодорожным транспортом можно доставить грузы всех категорий, разных объёмов, в любом направлении Европы, СНГ, Россия, Прибалтика, Китай, Азия. Наша компания готова предоставить полный комплекс услуг по железнодорожным и сопутствующим услугам: брокерским, складским, консолидационным, экспедиторским услугам, полное сопровождение груза и контроль над качеством перевозки в пути.</p>\r\n<p> </p>\r\n<p><strong>Cвоевременная  подача железнодорожного вагона </strong> нужного типа под конкретный груз: для опасного груза ADR, объемные негабаритные грузы, вагоны для сыпучих и наливных грузов, рефрижераторные вагоны, платформы для контейнеров. Стоимость доставки груза железнодорожным транспортом будет зависеть от характера груза, количества груза, направления ж.д перевозки, задействованной техники при погрузочно-разгрузочных работах<br />Также в стоимость входит страховка груза, брокерское обслуживание, прохождение таможенного контроля, дополнительные услуги. <br />Организация железнодорожных грузоперевозок происходит максимально быстро и качественно по всем направлениям, с исполнением всех требований грузовладельца. <br /><br /></p>\r\n<p><strong>Данная форма для заказа перевозки вашего груза Ж.Д. вагонами.</strong></p>\r\n<p>{mtpform}</p>', '', 1, 0, 0, 0, '2013-09-16 15:22:36', 62, '', '2014-03-06 20:52:58', 62, 0, '0000-00-00 00:00:00', '2013-09-16 15:22:36', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 24, 0, 9, '', '', 0, 23034, 'robots=\nauthor='),
(185, 'Грузовые авиаперевозки. Международная авиа доставка грузов.Грузовой авиатранспорт.', 'aviaperevozki-gruzovye-aviaperevozki-avia-transport-dlja-dostavki-srochnyh-gruzov-avia-jekspress-dostavka', '', '<p><strong>Грузовые Авиа перевозки, доставка грузов авиа транспортом. </strong></p>\r\n<p>Международные грузовые авиа перевозки выполняется посредством привлечения  авиа транспорта разной грузоподъёмностью, в зависимости от партий груза, с соблюдением всех правил и требований к перевозке различных грузов авиа транспортом. Главная задача при авиа доставке грузов  это оперативность выполнения заказа. При поддержке авиа диспетчеров, наших партнёров по всеми миру, нам удаётся организовать авиа перевозки грузов в самые кратчайшие сроки из любой точки земного шара, с возможностью отслеживания процесса авиа доставки лично клиентом.</p>\r\n<p><br /><strong>В стоимость авиаперевозки</strong> входит погрузочно-разгрузочные работы (в случае негабаритного груза – привлечение дополнительной техники), обслуживание и сопровождение груза в перевалочных пунктах, страхование груза, услуги консолидационных складов, доставка груза непосредственно в руки получателю по схеме «от двери к двери». Оформление всех необходимых документов на груз, предоставляем брокерские услуги, гарантируем быстрое прохождение всех обязательных таможенных процедур.<br /> <br />Процесс грузовых авиаперевозок в нашей компании отработан с годами, многолетний опыт международных авиаперевозок и профессионализм сотрудников позволяет решать задачи любой сложности. Организовать доставку груза авиа транспортом в любую страну миру, с учетом всех требований клиента  это в нашей компетенции.  <br /><br /></p>\r\n<p><strong>Данная  заявка  для заказа авиа перевозки вашего груза.</strong><br />{mtpform}</p>', '', 1, 0, 0, 0, '2013-09-16 15:23:09', 62, '', '2013-09-16 19:57:28', 62, 0, '0000-00-00 00:00:00', '2013-09-16 15:23:09', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_