(186, 'Перевозки из России в Казахстан, Узбекистан, Украину, грузоперевозки Россия-Беларусь,Россия-Молдова, Россия-Турция, транспорт из России в Европу и  на Балканы', 'perevozki-iz-rossii', '', '<p><strong>Как найти транспорт для доставки груза из России. Перевозки груза из России,</strong> наиболее развитые индустриальные города России это: Москва, Санкт-Петербург, Новосибирск, Екатеринбург, Нижний Новгород, Казань, Самара, Омск, Челябинск, Ростов-на-Дону, Уфа, Волгоград, Красноярск, Пермь, Воронеж.</p>\r\n<p> </p>\r\n<p><strong>Рассчитать стоимость перевозки груза из России.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Все типы грузоперевозок из России. <br /></strong></p>\r\n<p><strong>Основной импорт грузов в Россию:</strong> техника, транспортные средства, пластмассы, металлические изделия, железо, сталь, мясо, фрукты, орехи, оптические и медицинские инструменты, фармацевтическая продукция.<br /><strong>Основной экспорт грузов из России в Европу, страны СНГ, Азии, Турцию, Грецию это</strong>: нефтепродукты, уголь, каучук, металлы, древесина и изделия из древесины, химические вещества, машиностроительная продукция, продовольственные товары и сельхоз-сырьё, зерновые.<br />Торговые отношения у России с Украиной, Беларусью, Молдовой, Казахстаном, Германией, Нидерландами, Европейскими странами, Китаем, Италией, Турцией, Японией, США, Польшей, Великобританией, Финляндией. <br /><strong>Грузоперевозки из России</strong> в Украину, Казахстан, Беларусь, Молдову, из России в страны Европы, Румынию, Балканские страны осуществляются всеми распространенными типами транспорта: автомобильным, морским, железнодорожным и авиа транспортом. <br /><strong>Ведущая роль в грузоперевозках из России </strong>принадлежит железнодорожному транспорту – грузооборот в 2012 году составил 2,222 трлн. Тон.-км. Автомобильным транспортом было перевезено 247,9 млрд. тон.-км, водным (морским и речным) - 125,9 млрд. тон.-км, воздушным - 5,1 млрд. тон.-км. Полный грузооборот всеми видами транспорта в 2012 году составил 4,998 триллиона тонно-километров<br />Грузооборот морских портов России в 2012 году составил 79,5 млрд. тон-км. На территории России действует 71 международный аэропорт – грузооборот авиатранспорта в 2012 году составил 4,99 млрд. тон-км. В России по состоянию на 1 января 2013 года на регистрационном учёте состоит свыше 5,7 миллионов грузовых автомобилей, из них более 2 млн. класса Евро-1, Евро-5.<br /><strong>Таможенное оформление грузов при перевозках из России </strong>осуществляется на основе Таможенного кодекса Таможенного союза между Россией, Белоруссией и Казахстаном, а также обязательств, взятых Россией при вступлении в ВТО. Для упрощения процедуры таможенного оформления Россия снижает таможенные пошлины на многие ввозимые товары, вводит электронное декларирование товаров. Полный список документов, необходимых для таможенного оформления, зависит от направления перевозки (экспорт, импорт, транзит), назначения груза, условий перевозки, выбранного таможенного режима, конкретного кода товара по Товарной номенклатуре внешнеэкономической деятельности СНГ. Стоимость таможенного оформления варьируется от характера груза, кода ТНВЭД, количества необходимых разрешений и сертификатов, количества позиций в одной транспортной партии. <br /><strong>Грузовой авто транспорт для доставки грузов из России</strong>, к примеру, Россия-Украина, Россия-Казахстан, Россия-Молдова. Из России в Беларусь, Россия-Германия, Россия-Румыния, может быть попутным, следующим обратно из России, в экспортируемые страны. Стоимость попутной  перевозки будет дешевле, чем заказывать транспорт для данных перевозок у российской транспортной компании.<br /><strong>Как заказать перевозку грузов из России в страны СНГ и  Европы.</strong><br />На нашем транспортном сайте вы можете быстро заказать транспорт для перевозки грузов из России в нужной вам категории международных грузоперевозок. Наиболее востребован автотранспорт тентованный, рефрижераторы и изотермические фургоны. Грузовой транспорт для перевозки опасных, негабаритных, тяжеловесных длинномерных, объемных грузов. Услуги транспорта по контейнерным, железнодорожным, морским перевозкам грузов из России. Мультимодальные и воздушные перевозки грузов из России по схеме «от двери к двери» в кратчайшие сроки. Контейнерные, сборные, и попутные перевозки грузов в Россию в нужном вам количестве и объеме. <br /><strong>Как найти транспорт для перевозки груза из России</strong> в Европу, Украину, Беларусь, Молдову, Казахстан, Узбекистан, Румынию.<br />Для  того, чтобы получить возможность перевезти груз из России, заполните данные в форме заявки: ваши контакты, характеристика груза, пункт доставки груза, дата погрузки. <br />В кратчайшие сроки наш сотрудник свяжется с вами, и сообщит <strong>стоимость перевозки, и другие детали доставки груза из России. </strong><br /><br /></p>', '', 1, 1, 0, 4, '2013-10-01 16:32:38', 62, '', '2013-10-01 19:22:13', 62, 0, '0000-00-00 00:00:00', '2013-10-01 16:32:38', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 25, 0, 1, 'перевозки из России, Доставка груза из России, транспорт из России, авто перевозки из России, найти машину из России, транспортная компания из России', 'перевозки из России, грузоперевозки Россия-Украина, Россия-Беларусь, Россия, Молдова.Доставка грузов из России в Европу, Казахстан, Узбекистан, автоперевозки из России в Туркменистан, Азербайджан, из России в Армению', 0, 3781, 'robots=\nauthor='),
(188, 'Тенты авто фуры, перевозка грузов в тентованных грузовиках', 'tenty-avto-fury', '', '<p><strong>Перевозки грузов фурами тентованными грузовиками.</strong><br />Тип транспорта: тентованный полуприцеп с возможностью погрузки с трёх сторон, с таможенной пломбировкой.<br />Вес перевозимого груза  до 22тонн. 33 евро паллет, объем от 86м3 до 92м3. <br />Размеры полуприцепа: 13.65 Х 2.45 Х 2.72м.</p>\r\n<p><br /><strong>Грузовики тенты фуры, тентованные  полуприцепы </strong>(Евростандарт) используются в большинстве международных грузоперевозок на различные расстояния, вне зависимости от направления: в ЕС или СНГ и Россию.<br />Характеризуется тентованный грузовик очень удобными погрузочно-разгрузочными работами (сбоку, сверху, с задней стороны ). Используется тенты в перевозках самых разных грузов: бытового, промышленного, строительного характера, а также легковые автомобили и опасные грузы ADR.<br /><strong>Перевозки грузов тентами</strong> осуществляются по всем странам СНГ - Украина, Казахстан, Россия, Молдова, а также Европа с акцентом на страны ближнего зарубежья: Турция, Болгария, Румыния, Польша, Венгрия.</p>\r\n<p><strong>Для заказа тентованного грузовика отправьте заявку.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:15:33', 62, '', '2013-11-27 16:10:57', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:15:33', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 13, 'перевозки тентованным полуприцепом, тенты, заказ тентованного грузовика', 'грузоперевозки в тентованных грузовиках , перевозки тентами, заказать тентованную фуру', 0, 7667, 'robots=\nauthor='),
(189, 'Фуры (паровоз) до 120 куб,перевозки грузов объёмными грузовиками.', 'fury-parovoz-do-120-kub', '', '<p><strong>Перевозки в объёмных грузовиках, легких и объемных грузов.</strong><br /><strong>Тип транспорта: тентованный,  автопоезд c прицепом.</strong><br />Вес перевозимого груза от 200кг. до 22,5тонн. 34  евро паллет. Объем – до 110-120м3.<br />Размеры грузовика 110м3: 7.5 Х 2.43 Х 3м. Размеры прицепа: 7.50 Х 4,3 Х 3м<br />Размеры грузовика 120м3: 10 Х 2.43 Х 3.05м. Размеры прицепа: 8.10 Х 2.43 Х 3.05м.</p>\r\n<p><strong>Характеризуется стодвадцати кубовый автопоезд</strong> паравоз удобством и мобильностью погрузки и разгрузки: сверху, сзади и сбоку. Используется, как для перевозки одного груза, так и для доставки сборных и попутных грузов разным получателям. Перевозка осуществляется под двумя пломбами, выгрузка и загрузка может производиться в разных городах и странах.<br /><strong>Чаще всего такой транспорт заказывают для перевозки разнообразных лёгких и объёмных грузов</strong>: текстильных изделий, поролона, ваты, мягкой мебели, пенопласта, сэндвич панелей, изоляционных материалов и др., грузов. <br /><strong>Доставка легких и объемных грузов</strong> осуществляется из России и Молдовы в Италию, Турцию, Румынию, Венгрию. Перевозки хлопка из Узбекистана в Молдову, Россию и другие страны СНГ.</p>\r\n<p><strong>Заявка для заказа грузовика повышенного объёма до 120 куб.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:15:48', 62, '', '2013-11-27 16:17:33', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:15:48', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 12, 'доставка грузов, перевозки грузовиками больших размеров', 'грузовики повышенной вместимости и объёма перевозки 120 куб. Грузоперевозки объёмных грузов', 0, 15753, 'robots=\nauthor='),
(190, 'Грузовые машины до 5 тонн, грузоперевозки малотоннажными грузовиками', 'gruzovye-mashiny-do-5-tonn', '', '<p><strong>Малотоннажные перевозки грузовиками до 5 тонн. </strong><br />Тип транспорта: грузовики и автофургоны с тентовым кузовом, изотермическим, и с холодильной установкой, марки: Mercedes, Man, Iveco, Scania, Volvo.  <br />Вес перевозимого груза: до 5 тонн, объем - от 28 до 50м3.<br />Размеры грузовика: 5 Х 2.30 Х 2.1-2.6м.</p>\r\n<p><strong>Применяется пятитонники для перевозки сборных, малотоннажных, ценных грузов</strong> на малые и средние расстояния в национальном и международном следовании. Грузы надежно защищены от непогоды и других внешних факторов. Это экономное и быстрое решение для доставки легковесного груза. По желанию грузовладельца организуется сопровождение груза экспедитором.</p>\r\n<p><strong>Перевозки всех грузов до 5 тонн в фургона</strong>х осуществляются по востребованным направлениям из Италии, Германии, Чехии, Польши в Россию, Молдову, Украину и другие страны СНГ. Доставка грузов по схеме «от двери к двери» в Москву, Киев, Санкт Петербург, другие крупные города России и Украины, Беларуси, Польши, Прибалтики, Молдавии.<br /><strong></strong></p>\r\n<p><strong>Заказать малотоннажный пятитонник можно через заявку</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:16:06', 62, '', '2013-11-27 16:23:31', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:16:06', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 11, 'малотоннажные грузовые машины для развоза и доставки грузов', 'грузоперевозки небольшими грузовиками, грузовые машины для перевозки грузов до пяти тон', 0, 8245, 'robots=\nauthor='),
(191, 'Автопоезд с прицепом, транспорт для перевозки сборных грузов,консолидация грузов.', 'avtopoezd-s-pricepom', '', '<p><strong>Перевозки стандартных и сборных грузов. Автопоезда, тентованные грузовые .</strong><br />Тип транспорта:  крупнотоннажные объёмные грузовики бортовые с прицепами.<br />Вес перевозимого груза от 200кг. до 22тонн. Объём - от 15-20м3, до 120м3.</p>\r\n<p><strong>Для перевозок сборных грузов</strong> может применяться как микроавтобусы, так и большие вместительные фуры автопоезда, в зависимости от типа и количества грузов. Подготовка сборного  рейса происходит на консолидированном складе в стране отправки.<strong> Сборные грузоперевозки</strong> объёмными грузовиками, характеризуются небольшими временными затратами, необходимыми для полной комплектации площади и объема кузова различными грузами, но зато являются более выгодными по сравнению с заказом отдельного транспорта под грузоперевозку. Погрузку груза можно осуществлять в разных складах, для разных грузовладельцев, с выгрузкой в разных странах и городах.<br /><strong>Наша компания организует перевозки сборных грузов</strong> малыми партиями (от1евро-поддон, 2-3 евро-паллета) из Европы и Прибалтики в Россию, Молдову, Украину, Беларусь. Быстро и надежно доставим грузы из городов Польши, России и Украины в Турцию, Грецию, Испанию, Италию и другие страны ЕС и СНГ. <br /><strong>Заказать перевозку сборного груза можно, отправив заявку.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:16:20', 62, '', '2013-11-27 20:44:37', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:16:20', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 10, 'транспорт для сборных грузов, перевозка сборных грузов с консалидационных складов', 'перевозки сборных грузов, доставка сборного груза, перевезти сборный груз, найти транспорт для сборных грузов', 0, 3809, 'robots=\nauthor='),
(192, 'Грузовики до 10 тонн,перевозка грузов фургонами десятитонниками, доставка маленьки грузов до 10т.', 'gruzoviki-do-10-tonn', '', '<p><strong>Перевозки грузовиками, фургонами до 10 тонн.</strong><br />Тип транспорта: Skania, Mercedes, Volvo, Man, Iveco, Renault.<br />Грузоподъёмность - до 10 тонн, объем - 34-60 м3. Размеры грузовиков: 6,0 Х 2,45 Х 2,45м.</p>\r\n<p><strong>Преимуществом перевозок в грузовиках до 10тонн,</strong> является эксплуатация среднетоннажных грузовиков с различными вариантами кузова (бортовые, фургон изотерма, с полуприцепом). Для перевозки негабаритных грузов лучше всего подходит грузовик с бортом. При перевозке стройматериалов – кирпича, металла, досок идеальный вариант - тент. Перевозка дорогостоящих грузов изотермический фургон, грузы скоропорты – фургон с холодильной установкой .</p>\r\n<p><strong>Перевозки такими десятитонниками, грузовиками</strong> характеризуются удобной и мобильной погрузкой и выгрузкой: сбоку, сверху с помощью крана. Мы применяем грузовики 10 тонники, для перевозки любых промышленных грузов, бытовой техники и мебели, сборных и попутных  грузов весом до 10 тонн по городам России, Молдовы, Украины, СНГ.<strong> Доставляем грузы до 10 тонн</strong> из Румынии, Польши, Германии, Турции, Греции в Россию и Молдову и в обратном направлении.</p>\r\n<p><strong>Заказать 10тонник можно по заявке.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:16:34', 62, '', '2013-11-27 16:35:12', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:16:34', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 9, 'доставка, развоз груза, доставка маленьких грузов небольшими грузовиками', 'перевозки грузов небольшими грузовиками до 10 тон, развоз грузов грузовиками малой тоннажности', 0, 5919, 'robots=\nauthor='),
(193, 'Полуприцеп для перевозки негабаритных грузов типа Юмбо', 'polupricep-tipa-jumbo', '', '<p><strong>Перевозки объемных и негабаритных грузов в полуприцепах типа Юмбо.</strong><br />Тип транспорта: тентованный объёмный полуприцеп платформа – Юмбо.</p>\r\n<p><strong>Грузоподъемность полуприцепа</strong>- до 22тонн.  34  евро паллет,  объем  кузова прицепа – 105м3. <br />Размеры прицепа: верхняя площадка для груза - 4,4 Х 2,45 Х 2.7м; нижняя площадка для погрузки: 9,2 Х 2,45 Х 3,15м.<br /><br /><strong>Предназначаются для перевозки крупногабаритных, нестандартных грузов</strong>, тяжеловесных грузов, и объёмных грузов высотой до 3-х метров: металлических конструкций, промышленного оборудования, спецтехники, других нестандартных грузов. Направление перевозок этим типом транспорта – страны Западной и Восточной Европы, Россия, Молдова, Польша, СНГ, Румыния. Мы организуем быструю и качественную <strong>доставку негабаритных грузов</strong> из Турции, Сербии, Болгарии в Россию и Молдову. <br /><strong>Заказать перевозку в Юмбо можно заполнив заявку.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:16:48', 62, '', '2013-11-27 16:43:28', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:16:48', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 8, 'доставка грузов, перевозка грузов, транспорт для автоперевозок', 'перевозки полуприцепом Юмбо, доставка нестандартных габаритных грузов,перевозка техники, спецтехники , промышленных грузов, оборудования ', 0, 4097, 'robots=\nauthor='),
(194, 'Контейнеровозы автомобильные, перевозка контейнеров, доставка грузов контейнерами , автоконтейнеровозы.', 'kontejnerovozy-avtomobilnye', '', '<p><strong>Контейнерные перевозки. Автотранспорт для перевозки морских контейнеров: </strong><br /><strong>Тип транспорта: контейнеровоз с креплением для перевозки стандартных 20 и 40-футовых контейнеров,</strong> 3 и 5-тонных контейнеров, 20-футовых рефконтейнеров, 20-ти футовых Open Top. Вес перевозимого груза в контейнере - до 22тонн.<br />Как правило, доставка контейнеров осуществляется по мультимодальной схеме перевозки, где сочетаются автомобильный, железнодорожный, морской, и авиа транспорт, или только морской и авто транспорт.</p>\r\n<p>Груз в контейнере надежно защищен от внешнего воздействия, его невозможно повредить при погрузочно-разгрузочных работах. Использование контейнеров очень удобно при смене транспорта.<strong> Контейнеровозы</strong> – идеальный вариант для последнего этапа перевозки – доставки груза в руки получателю. Универсальность морских контейнеров позволяет перевозить в них грузы различных характеристик: стройматериалы, сыпучие грузы и жидкие грузы, скоропортящиеся грузы в рефконтейнерах, и даже опасные грузы.<br /><strong>Наша компания организует перевозки  морских контейнеров</strong> автотранспортом из крупнейших портов Европы, России, Украины, Румынии, Польши, в Молдову и Приднестровье, страны СНГ и ЕС</p>\r\n<p><strong>Заявка для заказа контейнеровозов</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:17:02', 62, '', '2013-11-27 16:50:33', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:17:02', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 7, 'грузоперевозки контейнеров, автомобильный контейнеровоз', 'контейнеровоз для перевозки грузов в морских контейнерах, контейнеровоз для перевозки контейнера, заказ контейнеровозов, авто контейнеровоз для перевозки грузов в контейнере.', 0, 8788, 'robots=\nauthor='),
(195, 'Автоцистерны  термоса, перевозка жидких грузов цистернами.', 'avtocisterny-termosa', '', '<p><strong>Доставка наливных опасных и неопасных грузов в автоцистернах термосах.</strong><br />Тип транспорта: многосекционные автоцистерны для перевозки жидких грузов (от 2х до 6 секций). Грузоподъемность -  до  25 тонн, объем - от 20 до 46м3.</p>\r\n<p><strong>Предназначены автоцистерны для перевозки </strong> жидких опасных, химических грузов ADR, и наливных пищевых грузов, таких как пиво, вино, коньяки, спирты, соки , концентраты. Наличие секций позволяет перевозить в одном рейсе наливные грузы разного характера. Цистерны работаю по принципу термоса, сохраняя нужную для груза температуру.<br />Наша транспортно-экспедиционная компания организует перевозки жидких наливных грузов любого происхождения, согласно международным требованиям и правилам перевозки, данной категорий грузов. Мы успешно осуществляем <strong>перевозки жидких грузов наливом в автоцистернах</strong> из Молдовы в Россию, Украину, Беларусь, а также из стран ЕС, Румынии, Болгарии в Россию и СНГ.</p>\r\n<p><strong>Для заказа автоцистерны заполните и отправьте заявку</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:17:14', 62, '', '2013-11-27 16:54:56', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:17:14', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 6, 'перевозка в цистернах, доставка грузов цистернами, перевозка жидких грузов, автоперевозка грузов наливом в цистернах', 'перевозка автоцистернами, перевозка жидких грузов, доставка жидких грузов цистернами, автопоезд цистерны.', 0, 8837, 'robots=\nauthor='),
(196, 'Самосвалы для грузовых перевозок сыпучих грузов насыпью.Перевозки сыпучих и насыпных грузов.', 'samosvaly', '', '<p><strong>Грузоперевозки насыпных сыпучих грузов.</strong><br />Тип транспорта: полуприцеп самосвал.<br />Грузоподъемность - от 30 до 40т. Объем - от 24  до 45м³.<br />Внутренняя  длина кузова-  8-10м, ширина – 2,3м, высота – 1,5-1,9м.</p>\r\n<p><strong>Строительные грузовые самосвалы</strong> применяются для перевозки сыпучих и насыпных грузов в строительных, земляных, ремонтных и других работах. Чаще всего это щебень, песок, бут, шлаки, уголь. Для сохранности грузов кузов сверху накрывается тентом и пломбируется. <strong>Перевозки грузов самосвалами</strong> осуществляются на средние и дальние расстояния как внутри стран, так и в международном сообщении из Румынии в Молдову, Украину, Россию, по странам СНГ.</p>\r\n<p><strong>Заказать самосвал можно через заявку на сайте.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:17:28', 62, '', '2013-11-27 16:58:35', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:17:28', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 5, '', '', 0, 4338, 'robots=\nauthor='),
(197, 'Морские перевозки, доставка грузов морским путём', 'morskie-perevozki', '', '<p><strong>Морские перевозки стандартных и сборных грузов в контейнерах и навалом.</strong><br />Тип транспорта: морской, автомобильный-контейнерный.<br />Мы предоставляем полный комплекс услуг по организации мультимодальных и морских перевозок в страны ЕС, СНГ, Молдову, Приднестровье, Румынию, Украину, Россию.</p>\r\n<p><strong>Обычно, морские перевозки входят в мультимодальную доставку груза</strong> с сочетанием разных типов транспорта. Перевозка грузов в контейнерах может осуществляться морским, наземным и воздушным транспортом на самые дальние расстояния. Морской транспорт выгодно отличается своей доступностью и низкими затратами. А чтобы доставить груз из морского порта, непосредственно в пункт назначения мы предоставляем железнодорожный или автотранспорт – контейнеровоз 20 и 40 футов.</p>\r\n<p><strong>Таким образом, морская доставка реализуется по схеме от «двери к двери»</strong> в оптимальные сроки. В зависимости от требований клиента осуществляется только морская грузоперевозка, или полностью с другими видами транспорта. Предоставляются логистические, экспедиторские, складские услуги.  <br /><strong>Морские грузоперевозки выполняются из всех крупных портов</strong> ЕС (Гамбург, Роттердам), Швеции, Германии, Дании, Польши. Из  портов России (Санкт-Петербург, Мурманск, Новороссийск), Украины, Румынии, Турции. В Молдову, Беларусь, Казахстан, и по России.</p>\r\n<p> </p>\r\n<p><strong>Заказ морской перевозки осуществляется по заявке или в разделе контакты</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:17:40', 62, '', '2013-11-27 18:13:39', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:17:40', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 4, 'морская перевозка, морские перевозки, морские контейнерные перевозки', 'морские перевозки, перевозка грузов морским путём, организация морских перевозок, перевозка по морю контейнеров и грузов навалом,заказать морскую перевозку', 0, 8724, 'robots=\nauthor='),
(198, 'Зерновозы,перевозка зерновозами цистернамии, перевозки зерновозами самосвалами.', 'zernovozy', '', '<p><strong>Перевозки зерновых, самосвалами зерновозами, и цистернами зерновозами</strong><br />Тип транспорта: бортовые, самосвальные, цистерны автопоезда зерновозы. Грузоподъемность - от 20 до 35 тонн, объем 40-50м3. (шасси + прицеп). Длина зерновоза автотранспортной сцепки - 6+8 метров, ширина - 2,4 м, высота борта до 3 м. <br />Полуприцеп автоцистерна-зерновоз. Объем от 13 до 80м3. Длина подъемной алюминиевой цистерны - от 7,4 до 12,2м, ширина – 2,5м, высота – 3,5-3,9м.<br /><strong></strong></p>\r\n<p><strong>Перевозки зерновых самосвальными полуприцепами </strong>характеризуются 3 вариантами погрузки и разгрузки – сбоку, сзади или на 3 стороны. Выгрузка зерна и зерновых может производиться одним опрокидыванием кузова, что минимизирует человеческие трудозатраты. Все прицепы и полуприцепы зерновозы изготавливаются из высокопрочной стали, или алюминия – это наиболее подходящий вариант для перевозки зерна. Для защиты зерновых от внешнего воздействия во время перевозки используется брезент или тент, с пломбировочным тросом. <strong>При международных перевозках зерна</strong> на большие расстояния эффективнее использовать самосвальные автопоезда и алюминиевые зерновозы-цистерны, позволяющие сохранить груз в прекрасном качестве. <strong>Мы организуем перевозки зерновых в нужных объемах</strong>, как в пределах одной страны, так в международном масштабе – в страны ближнего и дальнего зарубежья.</p>\r\n<p><strong>Заявка для заказа зерновозов.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:17:52', 62, '', '2013-11-27 17:13:04', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:17:52', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 3, 'зерновоз для перевозки зерновых', 'перевозки зерновозами,заказ зерновоза, перевозка зерна', 0, 6916, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(199, 'Низкорамные тралы для перевозки спец.техники. Перевозка тяжёлых и негабаритных грузов.', 'nizkoramnye-traly', '', '<p><strong>Перевозки траллами спец. техники.</strong><br /><strong>Тип транспорта: низкорамные тралы или низкорамники с погрузочной платформой</strong>, на которую техника заезжает и съезжает сзади по аппарелям.</p>\r\n<p><strong>Низкорамник</strong> типа «корыто» с возможностью заезда техники спереди: погрузочная площадка отцепляется и техника заезжает на платформу под минимальным углом.<br />Модули-тяжеловозы применяются, когда необходимо перевезти особо сложные грузы массой до 600 тонн.<br /><strong>Высокорамные платформы автопоезда </strong>для перевозки контейнеров и грузов массой до 110 тонн.<br />Наличие современного автопарка автоплощадок траллов, для перевозки крупногабаритной тяжеловесной техники позволяет нашей компании успешно перевозить, сельскохозяйственную и строительную технику, такую как: трактора, комбайны, бульдозеры, экскаваторы, башенные краны любых типов, а также катера, яхты, цистерны, контейнеры, строительные бытовки, металлоконструкции и другие длинномерные и тяжеловесные грузы.</p>\r\n<p><strong>Для заказа тралла, низкорамного прицепа отправьте заявку.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:18:14', 62, '', '2013-11-27 17:20:08', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:18:14', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 2, 'трал для перевозки техники, заказ техники на траллах с аппарелями.', 'перевозки спец техники,перевозка грузовой техники', 0, 5021, 'robots=\nauthor='),
(200, 'Мегатрейлер, перевозка негабаритных лёгких грузов грузовиками типа МЕГА', 'megatrejler', '', '<p><strong>Перевозки грузов тентованным Мега трейлером.</strong><br />Тип транспорта: тентованный мегатрейлер, грузоподъемность - до 22тонн. 34 евро паллет, объем – до 105м3. Размеры транспорта: 13.65 Х 2.45 Х 3,10м. <br /><strong>Перевозки мегатрейлером, с внутренней высотой погрузки 3.05 метра,</strong> выгодно отличаются универсальностью, погрузкой и разгрузкой со всех сторон, возможностью перевозить грузы различных объемов и габаритов, включая сборные и негабаритные грузы. <br /><strong>Чаще всего мегатрейлеры применяются для перевозки негабаритного лёгкого груза с высотой более 3 метра</strong>, грузов различного происхождения, на средние и дальние расстояния. Обычно это такие легковесные грузы, как текстиль, хлопок, изделия, мебель, бытовая техника, пластиковые трубы, легкие стройматериалы. Негабаритное оборудование, металлические профиля, комплектующие для сборки легковых автомобилей, перевозки металлоконструкций.<br /><strong>Заказать перевозку мегатрейлером,</strong> ввиду их вместительности, будет удобно при переезде в другую страну или перевозки личных вещей. Наша компания предоставляет услуги перевозки грузов мегатрейлером из Польши, Румынии, Молдовы в Россию, Украину, Беларусь, СНГ и страны ЕС. Из России в  Румынию, Болгарию, Сербию, Турцию, Казахстан.</p>\r\n<p><strong>Заказать перевозку груза мегатрейлером можно отправив заявку.</strong></p>', '', 1, 1, 0, 5, '2013-11-27 15:18:33', 62, '', '2013-11-27 17:27:24', 62, 0, '0000-00-00 00:00:00', '2013-11-27 15:18:33', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 4, 0, 1, 'грузоперевозки мегатрейлерами, требуется транспорт для негабаритного груза.Транспорт для лёгкого но объёмного груза', 'транспортный полуприцеп мега для перевозки негабаритных лёгких грузов.Заказ перевозки груза в мегатрейлере', 0, 7599, 'robots=\nauthor='),
(202, 'Грузы для ж.д. вагонов.Предложить Ж.Д. вагоны. Разместить вагоны для получение заказов на аренду и заказ ж.д. вагонов', 'predlozhit-zhd-vagony', '', '<p><strong>Организаторам железнодорожных грузоперевозок, владельцам ж.д. вагонов и ж. д. составов.</strong><br />Размещая ваш  железнодорожный транспорт, свободные ж. д. вагоны, вы увеличиваете возможность получать необходимые заказы на перевозку грузов по железной дороге. Грузовладельцы, заказчики перевозок, из разных стран, увидят ваш размещённый ж.д.транспорт на наших информационных сайтах. Получение заказов на железнодорожные грузоперевозки вам, гарантированно. Разместите ваш ж. д. транспорт, ж.д. вагоны, для железнодорожных грузоперевозок. Для получения заказов на аренду ж. д. вагонов, необходимо пройти по ссылке, Предложить грузовые Ж.Д. вагоны.<br /><br /></p>\r\n<p><strong>Заявка на размещение железнодорожного транспорта и получение заказов для ж.д. вагонов</strong><br /><br /></p>\r\n<h2><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/zheleznodorozhnye-gruzoperevozki/dobavit-razmestit-zheleznodorozhnye-vagony\" target=\"_blank\">Предложить грузовые Ж. Д. вагоны</a></h2>', '', 1, 0, 0, 0, '2013-12-25 07:39:50', 62, '', '2013-12-25 17:17:10', 62, 0, '0000-00-00 00:00:00', '2013-12-25 07:39:50', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 6, 'грузы для вагонов, грузовые  ж.д. перевозки, аренда вагонов, сдать вагоны в аренду для перевозки грузов', 'Поиск грузов для железнодорожных грузоперевозок, заказы для аренды грузовых ж.д. вагонов', 0, 2791, 'robots=\nauthor='),
(203, 'Разместить услуги грузоперевозок авиа транспортом, грузы для авиаперевозок.', 'avia-transport', '', '<p><strong>Экспедиторы и организаторы грузовых авиа перевозок, курьерские компании экспресс доставки.</strong><br />Размещая ваш авиатранспорт для грузоперевозок воздушным путём,  вы увеличиваете возможность получать необходимые заказы на авиа доставку грузов. Грузовладельцы, заказчики перевозок, из разных стран, увидят ваш размещённый авиа транспорт, на наших информационных сайтах. Получение заказов на авиа грузоперевозку, вам, гарантированно. Разместите ваш авиа транспорт для  доставки грузов авиа путём.<br /><strong>Для размещения услуг авиа транспорта, отправьте заявку</strong> на авиа перевозку грузов.</p>\r\n<p> </p>\r\n<p><strong>Предложить услуги Авиа доставки грузов</strong><br /><br /></p>\r\n<h2><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/predlozhit-transport\" target=\"_blank\">Предложить услуги авиа грузоперевозок, разместить авиа транспорт</a></h2>', '', 1, 0, 0, 0, '2013-12-25 07:41:14', 62, '', '2013-12-25 17:26:57', 62, 0, '0000-00-00 00:00:00', '2013-12-25 07:41:14', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 5, 'грузы для авиа перевозок, экспедиторы авиа перевозок, заказ авиа доставки, грузовые авиа перевозки', 'авиа доставка грузов, заказать доставку самолётом, авиа перевозки грузов, грузовые авиа перевозки, авиа доставка, сайт по грузам для самолётов  ', 0, 3669, 'robots=\nauthor='),
(204, 'Размещение курьерских услуг и транспорта для доставки посылок. Заказы для курьерских компаний.', 'dlja-dostavki-posylok', '', '<p><strong>Владельцы курьерских компаний по доставкам посылок, и бандеролей, организаторы экспресс доставки,</strong> размещая ваш  автотранспорт для доставки посылок и бандеролей, вы увеличиваете возможность получать необходимые заказы на доставку посылок, и других мелких и сборных грузов. Грузовладельцы, заказчики, и частные лица, из разных стран, увидят ваш размещённый транспорт для  доставки посылок, на наших информационных сайтах. Получение заказов на доставку посылок, пакетов, бандеролей вам, гарантированно. Разместите ваш транспорт, получите заказ на доставку посылки, пройдя по ссылке  размещение транспорта для перевозки посылок и бандеролей.</p>\r\n<p><strong>Предложить транспорт для доставки посылок бандеролей.</strong><br /><br /></p>\r\n<p> </p>\r\n<h2><a href=\"http://com-stil.com/ru/mezhdunarodnye-gruzoperevozki/dostavka-posylok-banderolej/predlozhit-transport\" target=\"_blank\">Предложить курьерские услуги, разместить транспорт для доставки посылок</a></h2>', '', 1, 0, 0, 0, '2013-12-25 07:41:50', 62, '', '2013-12-25 17:36:10', 62, 0, '0000-00-00 00:00:00', '2013-12-25 07:41:50', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 4, 'экспресс доставка грузов, курьерские службы России, курьерская доставка, экспресс доставка, отправка посылок, доставка посылок из Америки', 'заказ на доставку посылки, курьерская служба, найти курьера для передачи посылок и пакетов, компании экспресс доставки, товар для экспресс доставки', 0, 2865, 'robots=\nauthor='),
(205, 'Условия оплаты перевозок, как оплатить за доставку грузов. Перевозки за Российские рубли, гривны, леи, рубли ПМР', '2014-03-06-19-57-01', '', '<p><strong>Условия  оплаты за международные грузоперевозки и транспортные услуги.</strong><br />При заказе грузоперевозки в любом направлении каждого грузовладельца интересует не только стоимость доставки, но и другой не менее важный вопрос: в какой валюте можно оплатить за перевозку,  какие условия  оплаты (наличный/безналичный расчет), а также, в какие сроки можно произвести расчет за предоставленные транспортные услуги. <br />Поэтому наша транспортно-экспедиторская компания готова предложить и рассмотреть лучшие и удобные варианты оплаты для грузовладельцев из стран СНГ и ЕС.<br />Многие грузовладельцы и логистические компании, выступающие посредниками при доставке грузов из России, Украины, Беларуси, Молдовы и Приднестровья в Турцию, Грецию, Румынию, другие страны Восточной Европы, Балкан и Азии, ищут перевозчиков именно в Молдове, как географически наиболее удобно расположенной стране. При этом и те и другие сталкиваются с тем, что оплатить за перевозку груза молдавской транспортной компании можно только безналичным расчетом в евро или долларах. <br />Мы же предоставляем нашим заказчикам-грузовладельцам из Европы, России, Украины, Беларуси, Молдавии, Приднестровья, Беларуси и других стран, уникальную возможность расплатиться за грузоперевозку и другие транспортные услуги в их национальной местной  валюте! <br /><strong><br />Варианты оплат за международные транспортные услуги</strong>.<br />Грузовладельцы из России, которым требуется доставить груз из Москвы, Санкт-Петербурга, Мурманска, Воронежа, Калининграда, и других городов в направлении Балкан, Турции, Румынии, Молдовы, могут произвести как наличный, так и безналичный расчет в российских рублях, евро или долларах. <br />Владельцы грузов и компании из Украины могут рассчитаться в украинских гривнах, евро или долларах за перевозку грузов из Украинских городов: Киева, Львова, Донецка, Днепропетровска, Харькова, Луганска, Одессы,  в нужном им направлении.<br />Молдавским компаниям и заказчикам при осуществлении оплаты за грузоперевозки в страны СНГ и ЕС будет удобнее всего расплатиться в молдавских леях в наличной или безналичной форме. <br />От резидентов ПМР - Приднестровья, которым необходимо доставить груз из Приднестровского региона: Тирасполя, Бендер, Рыбницы, Дубоссар, Каменки в города: Украины, России, Беларуси, все страны СНГ и ЕС, мы принимаем оплату в приднестровских рублях, или в другой удобной для клиента валюте.<br />Таким образом, нашим потенциальным клиентам нет необходимости открывать в банке валютный счет, если до этого они не работали с ним. Также они не теряют денег при конвертации своей национальной валюты для оплаты непосредственно в евро или долларах. Грузовладельцы могут оплатить грузоперевозку именно в той валюте, в которой им удобнее работать – в российских рублях, украинских гривнах, приднестровских рублях, молдавских леях и т.д., в зависимости от страны, резидентами которой они являются.</p>\r\n<p><br /><strong>Условия оплаты за перевозку грузов.</strong><br />Для постоянных клиентов, грузовладельцев, регулярно заказывающих грузоперевозки у нашей транспортной компании, мы предоставляем дополнительные возможности и преференции при осуществлении оплаты. Речь идет об отсрочке платежей до 10 дней с момента выгрузки груза, о других формах уступок и взаимовыгодного сотрудничества. <br />От заказчиков, обращающихся к нам впервые, мы принимаем аванс или предоплату, а также оплату транспортных услуг по факту загрузки/выгрузки транспортного средства.    <br />При перевозке личных вещей, при переездах на ПМЖ, для частных лиц, также предусмотрена удобная и быстрая форма оплаты за транспортные услуги в любой национальной валюте.<br />Предоставляя возможность грузовладельцам из России, Украины, Беларуси, Приднестровья производить оплату в национальной валюте, наша транспортно-экспедиторская компания из Молдовы переходит на качественно новый уровень сотрудничества на региональном и международном рынке грузоперевозок всеми видами транспорта. Помимо непосредственно оплаты за доставку грузов, наши клиенты могут рассчитаться в национальной валюте за все логистические, складские и экспедиторские услуги.        <br /><br /><strong>Узнать стоимость перевозки, можно заполнив форму заявки.</strong><br /><strong><a href=\"ru/cform.html\" title=\"Заявка on-line\">Заявка для заказа транспорта  on-line</a></strong></p>\r\n<p> </p>\r\n<p><strong><br /></strong></p>', '', 1, 0, 0, 0, '2014-03-06 19:56:47', 62, '', '2014-03-06 20:59:10', 62, 62, '2015-03-21 12:55:54', '2014-03-06 19:56:47', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 10, 0, 3, '', '', 0, 7236, 'robots=\nauthor='),
(206, 'Перевозки грузов из Индии, доставка груза Индия', 'perevozki-gruzov-iz-indii-', '', '<p><strong>Перевозки грузов из Индии в Россию, Молдову, Украину, Румынию, перевозки из ЕС, СНГ, России, Украины, Молдовы в Индию.</strong><br />Доставка грузов в/из Индии. Полный комплекс транспортно-экспедиторских услуг, связанных с доставкой грузов по направлению Россия – Индия, Индия – Молдова, Индия – Украина, Румыния – Индия и другие страны, вы можете заказать на нашем транспортном сайте. Здесь вы найдете разделы по автомобильным грузоперевозкам, железнодорожным и морским контейнерным перевозкам, авиа доставке любых типов грузов из Индии в страны СНГ и Евросоюза. Оформить заказ на доставку груза в/из Индии необходимым вам транспортом можно через форму онлайн заявки на сайте, или по телефону, связавшись с нашим менеджером.</p>\r\n<p> </p>\r\n<p><strong>Заказ транспортировки грузов в или из Индии.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка сборных грузов, перевозки в/из Индии.</strong> Если вам требуется доставить небольшую партию товара в/из Индии (ценный груз мелких или средних размеров), такой заказ относится к категории сборных грузоперевозок. Особенность сборных перевозок грузов заключается в том, что ваш груз доставляется в нужном вам направлении не отдельным транспортом, а совместно с грузами других владельцев. Происходит это следующим образом: ежедневно мы принимаем десятки заказов на доставку сборных грузов из Индии в разных направлениях: Россия, Украина, Казахстан, страны СНГ и ЕС. Как только на консолидационном складе собирается достаточное количество грузов, которые необходимо доставить в одном или схожем направлении, мы отправляем грузовик в путь. Вы, в свою очередь, оплачиваете только ту площадь, которую занимает в прицепе или фургоне ваш груз, экономя значительные денежные средства, которые пришлось бы потратить на заказ отдельного транспорта.</p>\r\n<p><strong>Грузоперевозки из Индии по низким ценам.  Итоговая стоимость доставки любого груза из Индии</strong> определяется исходя из ответов на следующие вопросы: куда и какой груз вам необходимо доставить, какой тип транспорта наиболее предпочтителен, каковы сроки доставки. К примеру, доставка стандартного груза в контейнере железнодорожным или морским транспортом всегда будет стоить дешевле, чем доставка скоропортящегося или опасного груза автомобильным или авиационным транспортом. Также цена грузоперевозки прямо пропорциональна срочности выполнения заказа: доставка груза в кратчайшие сроки (до одного рабочего дня) обойдется дороже, нежели перевозка в стандартные сроки (до одной рабочей недели). В некоторых случаях комбинирование нескольких видов транспорта (мультимодальные перевозки) при правильной организации процесса доставки груза, позволяет уменьшить транспортные издержки, и в результате грузовладелец получает оптимальный вариант, как по стоимости, так и по качеству и срокам доставки. Дополнительные логистические, экспедиторские и складские услуги: охрана и сопровождение груза в пути, хранение на складе, другие требования и пожелания клиента – указываются в договоре на перевозку груза отдельно. <br /><strong> </strong></p>\r\n<p><strong>Срочная доставка груза в/из Индии. </strong>Для оперативной доставки грузов из/в Индию, вплоть до 1-2 рабочих дней, в нашем распоряжении готовые решения для всех типов грузов. Организовать срочную доставку возможно авиа транспортом – мы давно и успешно сотрудничаем с крупнейшими авиакомпаниями России, Азии и Европы, или за счет комбинирования нескольких типов транспорта: авиа транспорт + автомобильный или железнодорожный транспорт. Обработав вашу заявку и изучив ваши требования, наши менеджеры оперативно подберут наиболее быстрый и оптимальный вариант доставки любого груза в/из Индии. <br />Транспорт.  Автомобильные грузоперевозки из/в Индию мы осуществляем исключительно на высокотехнологичных магистральных грузовиках Евро-3, Евро-4 и Евро-5. Доставка грузов морским и железнодорожным транспортом осуществляется в 20 и 40 футовых контейнерах, а также других типах контейнеров: с открытым верхом, танк-контейнер, и тд. <br /><strong> </strong></p>\r\n<p><strong>Заказать доставку груза из Индии</strong>.  Для того, чтобы заказать грузоперевозку в/из Индии в нужном вам направлении, оформите онлайн заявку на нашем транспортном сайте или свяжитесь с менеджером по телефону или Skype. Вы также можете запросить оказание других сопутсвующих транспортных, логистических и складских услуг по направлению Индия, а мы, в свою очередь, предложим лучшие решения по выполнению ваших требований.</p>', '', 1, 1, 0, 6, '2015-03-21 11:22:14', 62, '', '2015-03-21 14:09:09', 62, 0, '0000-00-00 00:00:00', '2015-03-21 11:22:14', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 6, 'доставка товаров из Индии, грузы из Индии, товары из Индии, как доставить Индийские товары в Россию.', 'Доставка товаров из Индии, как перевезти груз из Индии в Россию, перевозка грузов Индия-Россия, ', 0, 5385, 'robots=\nauthor='),
(207, 'Грузоперевозки из Ирана, доставка груза Иран', 'gruzoperevozki-iz-irana', '', '<p><strong>Перевозки грузов из Ирана в Россию, Молдову, Украину, Румынию, перевозки из ЕС, СНГ, России, Украины, Молдовы в Иран.</strong><br />Доставка грузов в/из Ирана. Полный комплекс транспортно-экспедиторских услуг по направлению Иран – Россия, Иран – Украина, Иран – СНГ, Иран – ЕС, предоставляет наша транспортная компания из Молдовы. Многолетний опыт работы на рынке международных грузоперевозок, команда профессиональных сотрудников (диспетчеров, логистов, водителей), проверенные временем связи с компаниями по всему миру позволяют нам организовать доставку любого груза в короткие сроки на самые дальние расстояния. Для всех типов грузов: стандартных, объемных, тяжеловесных, опасных, мы предложим подходящий транспорт и самые оптимальные маршруты доставки.</p>\r\n<p> </p>\r\n<p><strong>Узнать  стоимость доставки груза  в/из  Иран</strong>а.</p>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка сборных грузов, перевозки в/из Ирана</strong>. Одной из наиболее востребованных услуг, к которой прибегают клиенты нашей транспортной компании, является доставка сборных грузов из/в Иран. Как правило, сборный груз – это мелкий или средний ценный груз небольших габаритов, заказывать под который отдельный транспорт – не каждому по карману. В этом и нет необходимости, если можно доставить ваш ценный груз в одном грузовике или контейнере (если доставка осуществляется железнодорожным транспортом), с грузами от других владельцев, следующих в одном направлении. Уникальность услуги в том, что каждый грузовладелец оплачивает только ту часть площади, которую занимает в прицепе, фургоне, контейнере его груз, а качество доставки при этом сохраняется на высоком уровне. Если вы хотите отправить какой-либо товар в составе сборного груза, заполните форму онлайн заявки на сайте или свяжитесь с нашими менеджерами – комплектация сборных грузов по направлению в/из Ирана осуществляется заблаговременно.    <br /><strong> </strong></p>\r\n<p><strong>Грузоперевозки из Ирана по низким ценам.</strong> При расчете итоговой стоимости грузоперевозки из Ирана в страны ЕС и СНГ учитываются следующие факторы: страна назначения доставки груза и расстояние перевозки. К примеру, стоимость доставки груза в разные города России – в Москву или Хабаровск, будет отличаться, поскольку разница в расстоянии между этими городами – в несколько тысяч километров. Важную роль в ценообразовании перевозки играет тип груза – от этого зависит, какой вид транспорта будет использован. Стандартные грузы дешевле всего доставлять в контейнерах автомобильным или железнодорожным транспортом. Доставка скоропортящихся грузов в рефрижераторах и изотермических вагонах будет дороже – здесь соблюдаются особенные условия перевозки. Тоже самое касается негабаритных, объемных, длинномерных, тяжеловесных, опасных грузов, к перевозкам которых применяются дополнительные человеческие и технические ресурсы, как при погрузочно-разгрузочных работах, так и в процессе доставки. Срочность доставки также влияет на конечную стоимость грузоперевозки – доставка груза в стандартные сроки – до одной рабочей недели будет дешевле, чем оперативная доставка в течение одного рабочего дня. Другие логистические, экспедиционные и складские услуги оговариваются отдельно при заключении договора на доставку груза. Итоговая стоимость доставки грузов из/в Иран всегда формируется с учетом интересов грузовладельца. Мы же, со своей стороны, предложим самые экономные и оптимальные варианты доставки груза, устраивающие клиентов по соотношению цена-качество. <br /><strong> </strong></p>\r\n<p><strong>Срочная доставка груза в/из Ирана.</strong> Оперативная доставка грузов из Ирана возможна в течение одного-двух рабочих дней. Для этого вам необходимо связаться с нашими менеджерами по телефону или Skype, или заполнить форму онлайн заявки на сайте с указанием направления доставки и описанием груза. Для срочной доставки мы используем авиатранспорт в комбинации с автомобильным или железнодорожным транспортом (мультимодальные перевозки). Как только наш менеджер обработает вашу заявку, вы уже будете знать, во сколько и на какое транспорте средство будет погружен ваш груз. В зависимости от страны направления перевозки, ваш груз может быть доставлен по назначению прямо в руки грузополучателю в течение суток.</p>\r\n<p><strong>Транспорт.  Перевозки грузов из/в Иран осуществляются автомобильным, железнодорожным, и авиатранспортом</strong>. В отдельных случаях может быть задействован и морской транспорт, если маршрут доставки пролегает через Черное или Средиземное море, к примеру, при перевозке груза из Ирана в страны Западной или Восточной Европы.  Весь  авто или авиа транспорт, предоставляемый под погрузку соответствует экологическим стандартам Евро-3, Евро-4 и Евро-5, имеет действительный техосмотр. Перевозки грузов железнодорожным, морским, и авиа транспортом осуществляются в контейнерах всех размеров.</p>\r\n<p><strong>Заказать доставку груза из Ирана. </strong> Каждый год мы открываем новые направления в географии наших грузоперевозок. Центральная Азия и конкретно Иран являются одним из наиболее интенсивно развивающихся направлений, пользуется большим спросом у грузовладельцев, как из Европы, так и из России и стран СНГ. Для доставки груза любого типа из Ирана оформите онлайн заявку на нашем транспортном сайте, и наш менеджер свяжется с вами.  <br /><br /><strong></strong></p>\r\n<p> </p>', '', 1, 1, 0, 6, '2015-03-21 11:22:29', 62, '', '2015-03-21 14:07:33', 62, 0, '0000-00-00 00:00:00', '2015-03-21 11:22:29', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 7, 0, 5, 'Перевозки Иран-Россия, перевозки грузов в Иран, доставка товаров из Ирана', 'Перевозка грузов из Ирана, международные грузовые перевозки из Ирана в Россию', 0, 10512, 'robots=\nauthor='),
(208, 'Перевозки грузов из Арабских Эмират', 'perevozki-iz-arabskih-jemirat', '', '<p><strong>Перевозки грузов из ОАЭ в Россию, Молдову, Украину, Румынию, перевозки из ЕС, СНГ, России, Украины, Молдовы в ОАЭ.</strong><br />Доставка грузов в/из ОАЭ. Наша транспортная компания специализируется на организации грузоперевозок всеми видами транспорта по направлению СНГ – ОАЭ, ЕС – ОАЭ, ОАЭ – Россия, Молдова, Украина, Казахстан, Беларусь, Румыния. В нашем распоряжении: современный автопарк магистральных грузовиков, доступ к крупнейшим морским портам Европы и Азии, выходы на ведущие авиакомпании мира. Благодаря широким возможностям нам по силам организовать перевозки любых типов грузов из ОАЭ  в Россию, Молдову, другие страны СНГ и ЕС, и предоставить полный комплекс сопутствующих транспортных, экспедиторских, логистических, складских услуг.</p>\r\n<p> </p>\r\n<p><strong>Заявка для заказа перевозки в направлении Арабские Эмираты</strong>-<strong>ОАЭ</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка сборных грузов, перевозки в/из ОАЭ.</strong> При необходимости перевозки мелких и средних ценных грузов из ОАЭ в ЕС или СНГ, предлагаем воспользоваться услугой доставки сборных грузов. Это удобно и экономно для каждого грузовладельца, которому нет нужды заказывать отдельный транспорт и переплачивать за порожний пробег и прочие транспортные издержки. Под грузы малых габаритов мы предоставляем скоростные микроавтобусы и грузовики средней вместимости. В результате, грузовледелец оплачивает только ту площадь, которую занимает в прицепе или фургоне его груз, и получает качественную доставку груза из ОАЭ в нужную ему страну, как если бы он заказал отдельный транспорт.</p>\r\n<p><strong>Грузоперевозки из ОАЭ по низким ценам</strong>. Заключая контракт на доставку груза из/в ОАЭ с нашей транспортной компанией, вы получаете аргументированную стоимость по каждому виду произведенных в процессе доставки груза работ: погрузка и разгрузка груза, применение дополнительной техники, если это негабаритный или опасный груз, соблюдение мер предосторожности по пути следования груза, подготовка маршрута. Другие факторы, влияющие на стоимость доставки - расстояние перевозки, вид транспорта (автомобильный, железнодорожный, воздушный, морской, или сочетание нескольких из них). Играет роль оперативность доставки и другие пожелания грузовладельца. В договоре на доставку груза мы отдельно расписываем каждый пункт, определяющий итоговую стоимость доставки, включая экспедиторские и логистические услуги. Ориентируясь на запросы клиентов, и зная, где можно сэкономить, мы предлагаем оптимальные варианты доставки груза в соотношении цена-качество, так, чтобы удовлетворить все заинтересованные стороны. Для постоянных клиентов мы предоставляем скидки, возможность отсрочки по платежам за выполненную перевозку груза из/в ОАЭ.</p>\r\n<p><strong>Срочная доставка груза в/из ОАЭ</strong>. Часто в нашу компанию поступают заявки на срочную доставку груза из ОАЭ в ЕС или СНГ, когда грузовладельцу необходимо доставить груз в течение одного рабочего дня. Применение современных транспортных и экспедиторских решений, сочетание воздушного и автомобильного транспорта (мультимодальные перевозки) позволяют решить любую поставленную задачу в кратчайшие сроки. Просто свяжитесь с нашими операторами, укажите направление доставки и характеристики груза, и свободный транспорт для перевозки груза из/в ОАЭ будет предоставлен вам в течении нескольких часов.  <br /><strong> </strong></p>\r\n<p><strong>Транспорт из и в Эмираты. </strong> Для перевозки грузов из/в ОАЭ мы используем автомобильный, железнодорожный, морской и авиа транспорт. В зависимости от требований клиента и срочности доставки мы организуем мультимодальные перевозки. Все магистральные грузовики в нашем автопарке соответствуют экологическим стандартам Евро-3, Евро-4 и Евро-5. При перевозках с помощью железнодорожного и морского транспорта используются контейнеры всех размеров. Авиадоставка грузов осуществляется в сотрудничестве с авиакомпаниями Дубая, России, стран ЕС. <br /><strong>Заказать доставку груза из ОАЭ</strong>.  Для оформления заказа на доставку груза из/в ОАЭ – оставьте заявку на нашем транспортном сайте, или свяжитесь с менеджером по телефону или Skype. Грузоперевозки в/из ОАЭ в страны СНГ и ЕС являются одними из наиболее востребованных, поэтому мы быстро предоставим вам нужный транспорт под конкретный груз.</p>', '', 1, 1, 0, 6, '2015-03-21 11:22:54', 62, '', '2015-03-21 14:06:41', 62, 0, '0000-00-00 00:00:00', '2015-03-21 11:22:54', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 8, 0, 4, 'перевозки из арабских стран, доставка грузов в Эмираты, транспортировка грузов из Эмират, авиа доставка из Арабских Эмират', 'Доставка грузов из Арабских Эмират, заказать доставку Эмираты-Россия, Перевозка грузов из ОАЭ, грузоперевозки из Арабских Эмират в Россию, Арабские эмираты-Молдова', 0, 4673, 'robots=\nauthor='),
(209, 'Доставка грузов из Израиля', 'dostavka-gruzov-iz-izrailja', '', '<p><strong>Перевозки грузов из Израиля в Россию, Молдову, Украину, Румынию, перевозки из ЕС, СНГ, России, Украины, Молдовы в Израиль.</strong><br />Доставка грузов в/из Израиля. Наша компания предоставляет услуги по перевозкам грузов по направлению СНГ – Израиль, ЕС – Израиль, Израиль – Россия, Молдова, Украина, Румыния. Доставляем грузы всех типов автомобильным, железнодорожным и воздушным транспортом из крупнейших городов Израиля (Иерусалим, Тель-Авив, Хайфа, Бейрут) в Россию, Казахстан, Беларусь, Молдову, другие страны СНГ и ЕС. Оказываем полный комплекс транспортных, экспедиторских, логистических и других сопроводительных услуг. Перевозка грузов из/в Израиль осуществляется в самые краткие сроки и по наиболее востребованным маршрутам.</p>\r\n<p><strong>Заявка для заказа перевозки груза из Израиля</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка сборных грузов, перевозки в/из Израиля.</strong> Доставка сборных грузов из/в Израиль – это удобная услуга для грузовладельцев, которым необходимо доставить мелкий или средний ценный груз. Заказывать отдельный транспорт под груз малых габаритов выходит неоправданно дорого, тогда как доставка в составе сборного груза обойдется в разы дешевле. Грузовладелец, оплачивая только ту площадь, которую занимает в прицепе или фургоне его груз, получает не только качественную доставку груза из Израиля, но и значительную экономию средств.</p>\r\n<p><br /><strong>Грузоперевозки из Израиля по низким ценам.</strong> В вопросе ценообразования грузоперевозок в/из Израиля наша компания придерживается гибкой политики, направленной на выстраивание долгосрочных деловых отношений с каждым клиентом. Основные факторы, определяющие итоговую стоимость доставки груза из/в Израиль – это расстояние и страна доставки, тип груза, тип транспорта, срочность доставки, дополнительные требования грузовладельца. В конечную стоимость перевозки также входят другие экспедиционные и логистические услуги. Каждый пункт оговаривается отдельно в договоре на перевозку, в котором указывается итоговая цена за предоставленные транспортные услуги. Ориентируясь на запросы клиентов, мы предлагаем самые оптимальные варианты доставки грузов с минимальными транспортными издержками. Это позволяет оказывать услуги по перевозке грузов из/в Израиль по самым низким ценам.     <br /><strong> </strong></p>\r\n<p><strong>Срочная доставка груза в/из Израиля.</strong> Если вам необходимо срочно доставить груз в/из Израиля, вам достаточно оставить заявку на нашем транспортном сайте с указанием направления доставки и характеристик груза. В кратчайшие сроки наши менеджеры найдут свободный транспорт и свяжутся с вами. Современные технологии, логистические и экспедиторские решения позволяют принять, обработать и даже выполнить доставку груза из/в Израиль в течение суток.   <br /><strong></strong></p>\r\n<p><strong>Транспорт из\\в Израиль.  Мы осуществляем перевозку грузов из/в Израиль всеми существующими видами транспортных средств</strong>: автомобильным, железнодорожным, морским и авиа транспортом. При необходимости организуем мультимодальные перевозки. Весь автотранспорт, предоставляемый нами для доставки грузов, соответствует экологическим стандартам Евро-3, Евро-4 и Евро-5. После каждой выполненной перевозки все грузовики проходят технический контроль. На железнодорожном и морском транспорте доставка грузов осуществляется  контейнерами всех размеров.<br /><strong></strong></p>\r\n<p><strong>Заказать доставку груза из Израиля. </strong> Грузоперевозки в/из Израиля в страны СНГ и ЕС являются одними из наиболее востребованных в нашей компании. Если Вам необходимо доставить из Израиля груз любого типа: мелкий, средний, стандартный, или же опасный или негабаритный груз – вы можете оформить заявку на нашем транспортном сайте, или связавшись с оператором по телефону или Skype.</p>', '', 1, 1, 0, 6, '2015-03-21 11:23:13', 62, '', '2015-03-21 14:05:39', 62, 0, '0000-00-00 00:00:00', '2015-03-21 11:23:13', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 3, 'перевозки Израиль, товары из  Израиля, грузы из Израиля, доставка грузов  Израиль', 'Доставка товаров из Израиля в Россию, перевозка грузов из Израиля в Украину, доставка грузов из Израиля в Казахстан, перевозки Израиль-Молдова, перевозки из Израиля в Прибалтику', 0, 6196, 'robots=\nauthor='),
(210, 'Перевозки грузов из Малайзии.', 'perevozki-iz-malajzii', '', '<p><strong>Перевозки грузов из Малайзии в Россию, Молдову, Румынию, перевозки из России, Украины, Молдовы в Малайзию.</strong></p>\r\n<p><br /><strong>Доставка грузов в/из Малайзии.</strong> Выполняем перевозки всех типов грузов в/из Малайзии морским и авиа транспортом в Россию, Украину, Молдову, страны СНГ и ЕС. Срочная доставка грузов из/в Малайзию возможна в течение одного рабочего дня. Доставляем грузы и предоставляем полный комплекс экспедиторских, логистических, складских услуг по направлению Малайзия – Молдова, Россия, Украина, Казахстан. Наши специалисты предложат лучшие решения для оперативной доставки из крупнейших городов Малайзии в нужном Вам направлении. Оставить заявку на перевозку груза из Малайзии можно на нашем транспортном сайте.</p>\r\n<p> </p>\r\n<p><strong>Расчёт стоимости перевозки в Малайзию.</strong></p>\r\n<p>{mtpform}</p>\r\n<p><strong>Доставка сборных грузов, перевозки в/из Малайзии.</strong> Чаще всего грузовладельцев интересуют вопрос экономичности перевозки, при сохранении качества. В случае, если Вам необходимо доставить мелкий ценный груз, то сборные перевозки – самое лучшее решение задачи. Доставка сборных грузов из Малайзии морским и автомобильным транспортом нашей компании осуществляется максимально быстро и надежно в нужном Вам направлении. Оплачивая доставку только своей части сборного груза, владелец экономит на заказе отдельного транспорта.</p>\r\n<p><br /><strong>Грузоперевозки из Малайзии по низким ценам.</strong> Работая на рынке международных грузоперевозок длительное время, мы знаем насколько важно учитывать мнение клиента при заключении договора на перевозку. Поэтому формирование итоговой стоимости в каждом заказе на доставку груза из/в Малайзию происходит исходя из запросов клиента и поставленных задач. Предлагая различные решения по доставке груза, мы ищем самые оптимальные способы минимизировать затраты грузовладельца. Ориентируемся на выстраивание долгосрочного сотрудничества с каждым клиентом. Для постоянных клиентов компании предоставляется возможность отсрочки по платежам за перевозку груза из/в Малайзии. <br /><strong> </strong></p>\r\n<p><strong>Срочная доставка груза в/из Малайзии. Поиск транспорта для перевозки грузов в/из Малайзии</strong> осуществляется нашими операторами круглосуточно. Вы можете оставить заявку на доставку груза в/из Малайзии в нужном Вам направлении на нашем транспортном сайте в режиме онлайн в любое время. Спустя несколько часов после поступления и обработки Вашей заявки мы предоставим свободный транспорт для перевозки конкретного типа груза: стандартного, опасного, негабаритного груза. В зависимости от расстояния грузоперевозки и типа используемого транспорта, доставка груза может быть выполнена в срок от одного рабочего дня.  <br /><strong> </strong></p>\r\n<p><strong>Транспорт в Малайзию. Для перевозок из/в Малайзию</strong> мы используем в первую очередь морской и авиатранспорт. Обычно доставка грузов из Малайзии осуществляется посредством мультимодальных перевозок: доставляя груз на азиатский или европейский континент воздушным или морским транспортом, в дальнейшем мы используем автомобильный и железнодорожный транспорт. Весь автопарк нашей компании соответствует экологическому стандарту Евро-3, а также Евро 4 и Евро 5. На таких грузовиках можно доставить грузы во все страны ЕС и СНГ из Малайзии. Авиаперевозки осуществляются в партнерстве с крупнейшими авиакомпаниями мира, среди которых «Аэрофлот», Lufthansa, Turkish Airlines, Fly Dubai. На железнодорожном и морском транспорте перевозка грузов осуществляется  контейнерами всех существующих размеров.</p>\r\n<p><strong><br />Заказать доставку груза из Малайзии.</strong> Оставить заявку на перевозку груза из Малайзии в нужном направлении вы можете с помощью нашего сайта, или связавшись с менеджером нашей компании по Skype или телефону. Мы выбираем лучшие маршруты доставки грузов всех категорий из Малайзии в страны СНГ и ЕС, работаем с проверенными партнерами по всему миру, чтобы максимально сократить сроки доставки. Консультируем по поводу страхования груза.</p>', '', 1, 1, 0, 6, '2015-03-21 11:23:24', 62, '', '2015-03-21 14:05:06', 62, 0, '0000-00-00 00:00:00', '2015-03-21 11:23:24', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 13, 0, 2, 'перевозки Малайзия, доставка груза в Малайзию, доставить товар из Малайзии, перевозка мебели из Малайзии в Москву.', 'Международная доставка груза из Малайзии в Россию.Перевозка грузов из России в Малайзию. Перевезти груз из Малайзии в Россию, перевозки Малайзия-Европа', 0, 2694, 'robots=\nauthor='),
(211, 'Грузоперевозки в Монголию,доставка в Монголию', 'gruzoperevozki-v-mongoliju', '', '<p><strong>Перевозки грузов из Монголии в Россию, Молдову, Румынию, перевозки из России, Украины, Молдовы в Монголию.</strong><br />Доставка грузов в/из Монголии. Наша транспортно-экспедиторская компания осуществляет перевозки всех типов грузов в/из Монголии в страны СНГ и Европы. Для перевозки грузов из крупнейших городов Монголии (Улан-Батор, Эрдэнэт, Дархан) в Россию, Украину, Беларусь, Молдову, мы используем автомобильный и железнодорожный грузовой транспорт. Современные логистические и экспедиторские решения позволяют выполнить доставку как стандартных, так и более сложных грузов, из Монголии максимально быстро и качественно по наиболее удобным маршрутам. Если вам требуется перевозка грузов в Монголию – вы можете оставить соответствующую заявку на нашем транспортном сайте.</p>\r\n<p><strong>Рассчитать стоимость перевозки в направлении Монголия</strong><br />{mtpform}</p>\r\n<p><strong>Доставка сборных грузов, перевозки в/из Монголии.</strong>Учитывая большой процент заказов на доставку мелких грузов из Монголии, наша транспортная компания предлагает грузовладельцам услугу по перевозке сборных грузов из/в Монголию. Доставка вашего груза из Монголии в составе сборных грузов будет наиболее экономным из существующих предложений на рынке грузоперевозок. Заказывать и оплачивать перевозку груза отдельно – достаточно дорого, тем более, если груз маленький по габаритам, а расстояние перевозки из Монголии в Россию или Европу – довольно большое. Доставку сборных грузов из Европы и России в Монголию, и из Монголии в страны СНГ и ЕС, мы предлагаем всем клиентам по приемлемым тарифам.</p>\r\n<p><strong>Грузоперевозки из Монголии по низким ценам.</strong> Принимая заявку на доставку груза в/из Монголии, специалисты нашей транспортной компании уже могут сообщить грузовладельцу приблизительную стоимость перевозки. Она  формируется из следующих факторов: удаленность пункта погрузки от места выгрузки груза (на какое расстояние надо доставить груз в/из Монголии); какой тип груза подлежит перевозке: стандартный, скоропортящийся, мелкий ценный груз, сборный груз, опасный или крупногабаритный груз.  В зависимости от характеристик груза и типа транспорта (автомобильный, железнодорожный, авиационный), конечная стоимость перевозки может быть выше или ниже. Другие транспортные, логистические, экспедиционные, складские услуги также влияют на цену доставки. Для постоянных клиентов действуют скидки и возможность отсрочки по платежу за перевозку груза из/в Монголию. <br /><strong> </strong></p>\r\n<p><strong>Срочная доставка груза в/из Монголии.</strong> Прием заявок на доставку грузов из/в Монголию осуществляется на нашем транспортном сайте в режиме онлайн, без выходных. Если вам понадобилась срочная перевозка грузов в направлении Монголии из России, Украины, и других стран СНГ – заполняйте всю информацию в форму заявки на сайте, и наши операторы моментально примут и обработают ее. Уже спустя несколько часов вам будет предоставлен свободный транспорт, готовый принять погрузку груза в нужной стране и доставить его в Монголию или наоборот – из Монголии в страны Европы и СНГ.</p>\r\n<p><br /><strong>Транспорт для перевозки грузов в Монголию. </strong>Весь автотранспорт, на котором наши водители осуществляют перевозки грузов из/в Монголию соответствует экологическому стандарту Евро-3 (если груз надо доставить в Россию или страны СНГ), а также Евро 4 и 5, в случае доставки груза из Монголии в страны ЕС. На железнодорожном транспорте перевозка грузов осуществляется  контейнерами всех размеров.<br />Заказать доставку груза из Монголии. Монголия является интенсивно развивающейся азиатской страной с большим перспективным рынком сбыта. В последнее время грузоперевозки в Монголию особенно востребованы среди грузовладельцев из ЕС, СНГ, и России. Заказать доставку любого груза из/в Монголию можно на нашем транспортном сайте, воспользовавшись формой он-лайн заявки, или связавшись с оператором по телефону или Skype.</p>\r\n<p> </p>\r\n<p><strong> </strong></p>', '', 1, 1, 0, 6, '2015-03-21 11:23:47', 62, '', '2015-03-21 14:03:54', 62, 0, '0000-00-00 00:00:00', '2015-03-21 11:23:47', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 10, 0, 1, 'Монголия. перевозки, доставка из Монголии, товары из Монголии, перевозка монгольских товаров', 'Перевозка грузовым автотранспортом из Монголии в Россию, Китай.Доставка грузов Монголия-Россия, Монголия -Европа.Перевозки из Европы в Монголию, перевозки из Молдовы в Монголию', 0, 10067, 'robots=\nauthor='),
(212, 'Написать отзыв, оставить отзыв. Отзывы грузовладельцев,отзывы транспортных компаний. ', 'napisat-otzyv', '', '<p><strong>Отзывы могут быть положительными или отрицательными, но писать их надо.</strong><br />В наше время никто не застрахован от недобропорядочного заказчика, перевозчика  либо экспедитора. Несмотря на то, что грузоперевозки являются достаточно распространенным направлением в XXI веке, все равно существует множество компаний, которые не выполняют свои обязательства и являются мошенниками, в сфере перевозок.</p>\r\n<p><br />Как с этим бороться? Самый важный фактор, не бездействовать. Помимо разбирательств с мошенниками постарайтесь максимально распространить информацию о том, что фирма нарушила свои обязательства.<br />Конечно в интернете масса отзывов о той или иной компании, скажем честно, что в основном они все выполнены под заказ. Это касается положительных рекомендаций. Практически каждый клиент находит время и решается написать отзыв лишь в тот момент, когда с ним случилось ЧП. Хотя, бесспорно есть люди, которые настолько удовлетворены услугами экспедитора или транспортной компанией, что хотят этим также поделиться с другими клиентами.</p>\r\n<p><br /><strong>Если продолжать тему того, как бороться с нарушителями и мошенниками в области международных грузоперевозок,</strong> то самым лучшим решением будет оставлять отзыв о работе экспедитора или другого исполнителя, или о грузовладельце. Сделать это следует на сайте поставщика услуг, но скорее всего там он будет удален работниками. Поэтому лучше размещайте свои отзывы на нашем специализированном транспортном сайте в интернете. Чем больше людей будут видеть ваш отзыв, и будут знать о нарушителе, тем лучше.</p>\r\n<p><br />Пропал груз, произошла его порча из-за неправильной транспортировки, грузополучатель не выполнил условия договора, был использован не тот транспорт при доставке – это все весомый повод для того, чтобы люди знали о недобросовестном исполнителе. <strong>Поделившись своим опытом, написав об этом отзыв, вы помогаете другим клиентам не пострадать от мошенника</strong>, или от безответственной транспортной компании. <br />Но важно отметить, что случаются и противоположные ситуации, когда наоборот, грузовладелец, клиент, не рассчитался с экспедитором, или с транспортной компанией, либо выплатил лишь часть денег. В таком случае транспортные компании или экспедиторские компании могут сделать предостережение от сотрудничества с данным грузовладельцем написать о нём отрицательный отзыв, написать комментарии.</p>\r\n<p><strong><br />Оставляя отзывы, вы не только предостерегаете остальных клиентов от беды, но также заставляете более качественно выполнять свои услуги  транспортным компаниям</strong>. Так как имидж и достойная репутация являются важным определяющим фактором при выборе партнера. Экспедиторы международных перевозок очень ценят своих клиентов.</p>\r\n<p> </p>\r\n<p>На нашем сайте вы можете оставлять отзывы и свое мнение о работе компаний, как положительные, так и отрицательные. Любой опыт сотрудничества с заказчиком либо экспедитором будет полезен. Поэтому, убедительно просим вас, делитесь своими ситуациями и обязательно оставляйте отзывы о сотрудничестве с транспортными компаниями, грузовладельцами или экспедиторскими компаниями.</p>\r\n<p><strong>Ваш отзыв нужен, он поможет избежать неприятностей, или найти партнёра по бизнесу<span style=\"text-decoration: underline;\">.</span></strong></p>\r\n<p>Отправить отзыв о любой компании, с которой вы работали, можно тут mtperevozki@gmail.com</p>', '', 1, 0, 0, 0, '2015-04-16 15:46:49', 62, '', '2016-05-16 18:25:16', 62, 0, '0000-00-00 00:00:00', '2015-04-16 15:46:49', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 14, 0, 2, 'отзывы положительные, как написать отрицательный отзыв, где найти отзыв, поиск отзывов . Транспортная компания с отзывами.', 'Отзывы грузовладельцев о транспортных компаниях. Написать отзыв об экспедиторской компании. Где написать отзыв, как правильно писать отзывы.Доска отзывов', 0, 3155, 'robots=\nauthor=');
INSERT INTO `jos_content` (`id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`) VALUES
(213, 'Объявления о международных грузоперевозках. Объявление о транспортных и логистических услугах.', '2015-04-30-19-03-24', '', '<p><strong>Объявления о транспортных, логистических услугах – наиболее эффективный способ бесплатной рекламы в интернете. </strong><br />В категории «Объявления» все посетители транспортного сайта, предоставляющие какие-либо транспортные или сопутствующие услуги, могут бесплатно разрекламировать свою компанию и получить новых клиентов. <br /><strong>Для этого достаточно разместить объявление с подробным описанием услуги, </strong>информацией о компании и контактными данными. Переходы в раздел «Объявления» осуществляются с крупнейших транспортных сайтов Юго-Восточного региона Европы и СНГ, ежедневно – это более тысячи посетителей, нуждающихся в предоставлении качественных транспортных услуг – ваши потенциальные клиенты.</p>\r\n<p><br /><strong>Разместив ваше объявление совершенно бесплатно</strong>, вы упростите поиск клиентам и продвинете свою компанию в интернете за счет транспортного сайта, который имеет приоритет в поисковых системах Google, Yandex и т.д.<br />Если ваша компания занимается непосредственно грузоперевозками или другим видом транспортировки грузов (автомобильными, авиа, железнодорожными, морскими международными грузоперевозками) – размещайте объявления с описанием своих преимуществ перед конкурентами.</p>\r\n<p><strong><br />Компании, предоставляющие сборные, морские, контейнерные, мультимодальные , железнодорожные перевозки грузов активно публикуют объявления на нашем транспортном сайте</strong> – многие из них уже оценили эффективность данного способа продвижения транспортных услуг. Объявления о пассажирских перевозках, перевозках личных вещей, доставке посылок – то, на чем конкретно специализируется ваша компания, ваши услуги могут быть опубликованы на сайте.</p>\r\n<p><br />Более того, транспортная отрасль, как никакая другая тесно связана с другими сферами деятельности. В первую очередь это экспедиторские, складские, логистические, брокерские, юридические, консалтинговые услуги. Как правило, грузовладельцы заказчики перевозок ищут не только перевозчика, но часто транспортную компанию, которая сможет предоставить все необходимые услуги в комплексе, в том числе таможенные и брокерские.</p>\r\n<p><br /><strong>Привлечь новых клиентов можно не только рекламой основных, но и дополнительных услуг</strong> – обратите на это внимание. Такие направления, как страхование грузов, услуги юристов для взыскания долгов также очень востребованы на рынке международных перевозок, и также могут быть эффективно разрекламированы на транспортном сайте.<br />Причем, к разделу «Объявления» для поиска транспортных услуг, обращаются не только грузовладельцы, но и сами перевозчики и транспортные компании. Дело в том, что на сайте активно размещают объявления компании, оказывающие услуги ремонта автотранспорта, сервисные и дилерские центры, осуществляющие продажу и замену шин и запчастей для магистральных грузовиков.</p>\r\n<p><br />Логика здесь проста: Грузовладельцы в поиске перевозчиков,  транспортники ищут клиентов себе, а поставщики автозапчастей на грузовую технику – себе. В результате все увеличивают клиентскую базу на транспортном сайте, привлекая внимание к себе размещёнными объявлениями.<strong><br />Предлагаем вам воспользоваться услугой размещения объявлений о транспортных и других услугах на нашем сайте совершенно бесплатно</strong>. Попробуйте разместить объявление, и результат не заставит вас долго ждать, вы приобретёте новых клиентов и партнёров. Вместе мы работаем во благо транспортной отрасли,  создаем новые инструменты для поиска клиентов и развития бизнеса. <br /><br /></p>\r\n<p><strong><span style=\"font-size: medium;\"><a href=\"http://www.com-stil.com/ru/component/adsmanager/%D0%B2%D1%81%D0%B5%20%D0%BE%D0%B1%D1%8A%D1%8F%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F\" target=\"_blank\">Перейти к размещению объявления.</a></span></strong></p>', '', 1, 0, 0, 0, '2015-04-30 18:57:52', 62, '', '2015-05-03 10:28:49', 62, 0, '0000-00-00 00:00:00', '2015-04-30 18:57:52', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 10, 0, 1, 'Объявление, доска объявлений, транспортные объявления, объявление по таможенным и брокерским процедурам', 'Объявление по перевозкам , Разместить объявление о транспортных услугах, доска объявлений по перевозкам и таможенным услугам, объявление о консалтинге в международных грузоперевозках', 0, 4055, 'robots=\nauthor='),
(214, 'Особенности транзитных перевозок из Китая через Казахстан, доставка грузов Азия-Россия-Европа.', 'tranzit-gruzov-iz-kitaja', '', '<p>Сегодня Китай является одной из ведущих мировых экономик, обеспечивающей многие страны товарами разного рода. В этой связи не удивительно, что все большее количество фирм стремятся заключить деловые контракты с китайскими производителями. Однако многие компании сталкиваются в дальнейшем с проблемой организации грузовых перевозок из Китая. Нужно отметить, что доставка грузов из Поднебесной имеет свои особенности. Как правило, китайские производители заинтересованы в больших объемах, что усложняет процесс перевозки. Большие габариты грузов часто делают невозможной авиа перевозку в связи с высокой стоимостью. <br />За годы своей работы наша компания создала широкую логистическую сеть, позволяющую доставить груз из Китая быстро и по минимальной цене. <strong>Сегодня мы осуществляем доставку грузов из Китая транзитом через Казахстан</strong>, используя мощности наших партнеров. Мы готовы предложить своим клиентам наиболее выгодный и удобный способ доставки товаров из Китая. Уже много лет мы эффективно работаем со странами Европы, Россией, СНГ (Молдова, Беларусь), выстраивая «мост» между нашими клиентами и китайскими производителями.    <span style=\"text-decoration: underline;\"><a href=\"ru/cform.html\">Заказать транспорт.</a></span></p>\r\n<p><br /><strong>Железнодорожные перевозки из Китая через Казахстан.</strong><br />Перевозка грузов из Китая в железнодорожных вагонах и контейнерах осуществляется транзитом через Казахстан. Здесь происходит перемещение грузов из китайских вагонов в стандартные вагоны, использующиеся на территории стран СНГ, что обусловлено разницей в размере колеи. В дальнейшем грузы беспрепятственно отправляются в Россию, Молдову и Беларусь, а также страны Европы. <br />В последние годы в Казахстане построено 1250 км железнодорожных путей, что намного улучшило сообщение с Западным Китаем.  Для осуществления перевозок используется магистраль «Жетыген – Хоргос», длина которой составляет 293 км, кроме того на границе с Китаем введен в эксплуатацию железнодорожный переход «Алтынколь– Хоргос» с высокой пропускной способностью, около 20 млн. тонн. Эти маршруты позволяют связать страны Европы и СНГ со странами Азии, обеспечивая постоянный и стабильный грузопоток в данных направлениях. На территорию Казахстана из Китая грузы попадают через пограничный переход Алашанкоу — Достык.</p>\r\n<p><br />Для временного хранения товаров на ж./д. станции приспособлены специальные ангары, что гарантирует сохранность груза при транзите и консолидации грузов. Преимущество железнодорожных перевозок из Китая в том, что они обходятся намного дешевле авиаперевозок, а кроме того, позволяют работать с Китаем даже тем компаниям, склады которых расположены далеко от морских портов. Прямое железнодорожное сообщение исключает задержки, часто возникающие в переполненных морских портах, и позволяет быстро получить товар от поставщика.  Для сравнения, срок доставки грузов морем из Китая в Россию или Европу, в среднем составляет 40-45 дней, в то время как ж/д сообщение позволяет сократить этот срок в два раза.  При этом нет ограничений на объем поставляемого груза.    <a href=\"ru/cform.html\"><span style=\"text-decoration: underline;\">Заказ транспорта on-line</span></a></p>\r\n<p><br /><strong>Морские перевозки + ж/д и автоперевозки из Китая.</strong><br />Для доставки грузов из Китая многие клиенты предпочитают воспользоваться морскими перевозками. Одним из основных преимуществ такого рода перевозок является возможность транспортировки грузов большого объема и веса. Погрузка осуществляется в портах Китая, а доставляется товар в ближайший порт, откуда его может забрать клиент. Китай может похвастаться разветвленной сетью крупных портов, поэтому забрать груз можно из любой части страны. Наиболее известные порты: Чивань, Далянь, Гуанчжоу, Гонг-Конг, Нинбо, Циндао,  Шэньчжэнь, Шанхай.  Всего в стране 20 крупных и более сотни мелких портов. <br />Порт назначения выбирается в зависимости от страны. Для России это Владивосток,  Новороссийск, Крым. В Молдову товар из Китая чаще всего прибывает в порт Одесса, Ильичёвск в Украине,  и Констанца в Румынии,  европейские партнеры получают товар из портов Гамбург, Роттердам, Рига. Оформление товаров осуществляется на момент прибытия их по месту назначения. В портах для хранения грузов на период их оформления предусмотрены большие ангары и контейнерные площадки.</p>\r\n<p><br />Доставка морем обходится дешевле других способов доставки, что привлекает клиентов, однако у нее есть один существенный недостаток: ее длительность. Поэтому такой способ доставки не подойдет для сезонных товаров или в том случае, если требуется срочная доставка.  Часто используется комбинированная доставка морем и ж/д или авто транспортом. В этом случае часть пути товар проходит морем, а далее переправляется по суше. При таком способе доставки груз из Китая прибывает в порт Владивосток и следует далее по железной дороге или автомагистрали.  <a href=\"ru/cform.html\"><strong><span style=\"text-decoration: underline;\">Рассчитать стоимость перевозки.</span></strong></a></p>\r\n<p> </p>\r\n<p><strong>Автоперевозки из Китая через территорию Казахстана<br /></strong>Автоперевозки самый быстрый и надежный способ доставки грузов из Китая.  Перевозка грузов таким способом экономически целесообразна, а кроме того, она оптимальна с точки зрения затрат времени. Автоперевозки занимают второе место по скорости после авиаперевозок, но при этом стоимость такой доставки несравнимо ниже. <br />Одной из наиболее используемых автомагистралей является магистраль Западная Европа-Западный Китай, проходящая через Урумчи (Китай),  Алма-Аты, Шымкент, Актобе (Казахстан), Москва, Санкт-Петербург (Россия).</p>\r\n<p><strong>Наша компания давно и успешно использует этот вид транспортировки товаров из Китая в Россию, Молдову, Беларусь и Европу</strong> как наиболее эффективный и недорогой. Срок ее составляет 12 -20 дней, в зависимости от пункта назначения.В страны Западной Европы, а также страны СНГ автомобильный транспорт попадает с территории России через пограничные автомобильные переходы Россия – Норвегия (Борисоглебск-Стурскуг), Россия – Эстония (Ивангород-Нарва), Россия – Латвия (Убылинка-Гребнева), Россия – Литва (Советск-Панемуне), Россия – Польша (Мамоново 1 – Громово), Россия – Украина(Троебортное-Бачевск и др). Это лишь некоторые автомобильные пункты переходов, позволяющие осуществить сообщение между территорией России и странами Европы и СНГ.</p>\r\n<p>Какой бы вид перевозки грузов вы не выбрали, мы гарантируем своевременную доставку и индивидуальный подход к каждому клиенту.  Грамотная транспортная логистика – наше основное преимущество, позволяющее гарантировать отличный результат. Особое внимание наша компания уделяет минимизации расходов клиентов на доставку грузов.  <strong><br /></strong>{mtpform}</p>', '', 1, 2, 0, 7, '2015-07-24 01:44:31', 62, '', '2015-07-28 16:33:29', 62, 0, '0000-00-00 00:00:00', '2015-07-24 01:44:31', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 27, 0, 1, 'транзит грузов. транзитные перевозки из Китая через Казахстан в Россию, перевозки из Китая в Европу', 'Транспортировка грузов транзитом из Китая через Казахстан, по морю, по автодорогам, железнодорожным транспортом в Россию, и страны Европы', 0, 12274, 'robots=\nauthor=');
