(79, 1, 1, 'content', 'introtext', '<p>The international transport company started 15 years ago and since that time it’s working sucessfully in the market of logistical services. We started with the organization of a cargo transportation across Russia, then we entered the market of international logistics carrying out the international cargo transportations from Europe to Russia and from Russia to Europe by means of auto, rail, sea and air transport. After a while we were engaged into airline, sea and railway logistics. Now we transport cargoes from and to almost every part of the world.  Our services include door to door tranportation in Russia and abroad including customs clearance, cargo insurance, cargo escort, documental support etc. The organization of international cargo transportation - is a complicated logistical chain of the goods delivery to various cities and the countries including the many participants: the sender company, the addressee, the transport company besides it needs necessary human units such as: drivers and forwarding agents, machinists, pilots, port workers, loaders, and others. Thus, the major aim of the International transport company is the organization of cargo transportations across Russia and through all over the world under carefully adapted logistical schemes with the organization of harmonious work and rigid control of all links of a chain and taking timely measures force - major situations. All international and Russian road transportations are carried out on highly reliable vehicles manufactured by Kamaz, Maz, Iveco, Scania, Renault, Volvo, Man.</p>', '5b89f993b3d1ff75f6f2c70829e8d769', '', '2012-03-13 08:58:07', 62, 1),
(80, 1, 1, 'content', 'fulltext', '', 'd41d8cd98f00b204e9800998ecf8427e', '', '2012-03-13 08:58:07', 62, 1),
