(89, 1, 4, 'content', 'fulltext', '\r\n<p>Our company is being in the market of international airline cargo transportations for many years, our experience of forwarding the cargoes has allowed us to become the worthy and professional participant of the market of the international air service. We cooperate with the largest airlines of the different countries and we deliver cargoes in Russia and worldwide. Our clients work with us on a long-term basis because we render qualitative services in avia delivery of the goods quickly and in time.</p>\r\n<p>The international air logistic service is the fastest way of cargo delivery therefore it’s very popular wordwide. Besides air cargo transportation has extensive geography of delivery and has high reliability and safety of the goods transportation. Despite the fact that air costs are a little above other ways of cargo delivery air services are absolutely irreplaceable in transportation of urgent and valuable cargoes, perishable food. Cargo is transported by air through the oceans, transportation of cargoes by plane may occupy 1 day while cargo transportation by means of sea transport may occupy the whole week.</p>\r\n<p>The air logistics market grows year from a year and in terms of a rigid competition companies offering services in full complex of air logistics survive. Therefore our company offers not only services in the international air delivery, but also we offer such services as air freight insurance,  the VIP cargoes escorting etc. Air service tariffs depend on the cargo type, weight and the goods quantity, distance between sending adress and destination point and other factors, therefore the air service rates are calculated individually for each kind of transported cargo. To calculate the cost of air delivery please contact us by telephone or fill in the inquiry form.</p>\r\n<p>{mtpform}</p>', 'd373340204da9bab8735107bca461b4f', '', '2012-03-13 09:05:38', 62, 1),
