(97, 1, 6, 'content', 'introtext', '<p>Export and import cargo deliveries are mostly carried out by means of the international automobile...</p>\r\n', '8da036aa612852716feeda06bffe9f2d', '', '2012-03-13 09:29:59', 62, 1),
(98, 1, 6, 'content', 'fulltext', '\r\n<p>Export and import cargo deliveries are mostly carried out by means of the international automobile transport. One of the basic services of our transport company is international auto transportation, which is considered to be the most convenient and economic way of the good\'s delivery. The advantages are the following: short terms of delivery, mobility and manoeuvrability of an automobile vehicle: the international vehicle moves practically at any convenient time, at the best and the shortest route. The international automobile cargo transportations allow to deliver the goods from to foreign countries \"on a turn-key basis\", «door to a door», cargoes are transported from the manufacturer to the buyer\'s warehouse.</p>\r\n<p>We are in the international market of autotransport delivery for more than 12 years. You can entrust us your cargo. All our drivers – forwarding agents have extensive experience of cargo transportation. All deliveries are carried out on highly reliable vehicles such as Iveco, Scania, Renault, Volvo, with various load-carrying capacity and volume for the international transport delivery of all kinds of cargoes. Our managers carefully trace the way of cargoes by the mode of real time. Tariffs for the international automobile transportations depend on the type, weight and volume of transported cargo, distance, etc. Therefore the rates are calculated individually for each type of transported cargo. To know more about the rates please contact us by telephone or fill in the inquiry form and our managers will contact you immediately</p>\r\n<p>{mtpform}</p>', 'e4ee4ee8c42a89730e67b335f27be89e', '', '2012-03-13 09:29:59', 62, 1),
