(106, 1, 32, 'content', 'introtext', '<p>Our company also renders services in cargoes convoy. Cargo convoy and protection are recommended first of all during transportation of valuable cargoes: material assets, art objects, jewelry, fur, etc. Cargo transportation and escort are considered to be difficult logistical process including planning and detailed study of a route, choice of professional cadres with a proper experience,  availability of all necessary licenses and many other things. Our company renders service in cargo protection and convoy during the rail and automobile transportations. Valuable cargo escort and protection are carried out under supervision of professionals. To get the full information about the services please call us by phone ***</p>\r\n<p>{mtpform}</p>', 'a3a7a2ca39731d6d19e9867f7e343d1b', '', '2012-03-13 09:09:21', 62, 1),
