(113, 1, 30, 'content', 'title', 'Customs clearance', 'ec430852fdff5444c5358f3aaacf103b', '', '2012-03-13 09:11:37', 62, 1),
(114, 1, 30, 'content', 'alias', 'customs', 'ad846cd10b74d0d11443fcf0be2de2eb', '', '2012-03-13 09:11:37', 62, 1),
(115, 1, 30, 'content', 'introtext', '<p>Our company is transnational logistical transporter, therefore we render all kinds of logistical services delivering goods \"on a turn-key basis\", including customs services. Customs clearance is a difficult procedure of the goods registration  during the export and import goods through the border with observance of all rules and instructions. During the independent customs clearing of cargoes the cargo owner often faces huge problems such as wrong registration of documents, discrepancy of shipping documents with the given data about the arrived goods at customs, etc. These problems may bring to the additional expenses like paying the idle time of cargo in the custom\'s warehouse of temporary storage. There are companies (brokers, agents) specialized on elimination of all formalities, doing fast cargo clearance at customs.</p>\r\n<p>Our company do the export and import customs clearance in Moscow as a part of rendered services in delivery «the goods on a turn-key basis» Our aim is the maximum decrease in expenses and terms. Our experts have extensive experience of customs clearance of the goods, excellent knowledge of legislative base and foreign trade activities rules. Your cargo will be delivered precisely in time and without superfluous expenses. Call us and our experts will immediately contact you.</p>\r\n<p>{mtpform}</p>', 'b28fb99fe4943503a7674f2c9567d239', '', '2012-03-13 09:11:37', 62, 1),
(116, 1, 30, 'content', 'fulltext', '', 'd41d8cd98f00b204e9800998ecf8427e', '', '2012-03-13 09:11:37', 62, 1),
(117, 1, 30, 'content', 'metakey', 'Russian transport company, customs clearance, customs services.', '0fde5167f4954cce170df7bd6c0b689a', '', '2012-03-13 09:11:37', 62, 1),
(118, 1, 30, 'content', 'metadesc', 'Our company is transnational logistical transporter, therefore we render all kinds of logistical services delivering goods \"on a turn-key basis\", including customs services. Customs clearance is a difficult procedure of the goods registration  during the export and import goods through the border with observance of all rules and instructions. During the independent customs clearing of cargoes the cargo owner often faces huge problems such as wrong registration of documents, discrepancy of shipping documents with the given data about the arrived goods at customs, etc. These problems may bring to the additional expenses like paying the idle time of cargo in the custom\'s warehouse of temporary storage. There are companies (brokers, agents) specialized on elimination of all formalities, doing fast cargo clearance at customs. \r\nOur company do the export and import customs clearance in Moscow as a part of rendered services in delivery «the goods on a turn-key basis» Our aim is the maximum decrease in expenses and terms. Our experts have extensive experience of customs clearance of the goods, excellent knowledge of legislative base and foreign trade activities rules. Your cargo will be delivered precisely in time and without superfluous expenses. Call us and our experts will immediately contact you.', 'a342ee8a4109eb0901cfab5ffdd039f5', '', '2012-03-13 09:11:37', 62, 1),
