(122, 1, 31, 'content', 'title', 'Cargo Insurance', '29959649ce919012ad3f80456225fe47', '', '2012-03-13 09:13:19', 62, 1),
(123, 1, 31, 'content', 'alias', 'insurance', 'b4628fe4f5f38e5b293be2024ce95239', '', '2012-03-13 09:13:19', 62, 1),
(124, 1, 31, 'content', 'introtext', '<p>In spite of the fact that we do minimization of risks during transportation, and that probability of the cargo loss, even partial – is insignificantly small, we render service of transport insurance and we recommend our clients to insure the cargo from a force majeure circumstances. Insurance of cargoes by a carrier (forwarding agent) allows to secure the cargo against such risks as theft, damage, a partial or full loss of cargo, vessel floodings (sea cargo insurance of cargoes), as a result of a fire, etc. Thus, cargo insurance isn\'t obligatory, but is recommended. Tariffs and costs of cargo insurance depend on many factors, such as a choice of the insurance company, way of transportation, costs of cargo, etc. Our experts will give you more detailed information about all variants of insurance at international transportation and at transportation across Russia</p>\r\n<p>{mtpform}</p>', '153f22e23c6ffa29fc45fe59072e97f5', '', '2012-03-13 09:13:19', 62, 1),
(125, 1, 31, 'content', 'fulltext', '', 'd41d8cd98f00b204e9800998ecf8427e', '', '2012-03-13 09:13:19', 62, 1),
