(127, 1, 31, 'content', 'metadesc', 'The Russian transport company render service of transport insurance.  Insurance of cargoes by a carrier (forwarding agent) allows to secure the cargo against such risks as theft, damage, a partial or full loss of cargo, vessel floodings (sea cargo insurance of cargoes), as a result of a fire, etc', '7864e411864fa842f70717c89310a05c', '', '2012-03-13 09:13:19', 62, 1),
