(131, 1, 24, 'content', 'title', 'Multimodal / intermodal transport', '557b91d3485457ac2cd40b286566b85d', '', '2012-03-13 09:14:30', 62, 1),
(132, 1, 24, 'content', 'alias', 'multi', 'ea8f243d9885cf8ce9876a580224fd3c', '', '2012-03-13 09:14:30', 62, 1),
(133, 1, 24, 'content', 'introtext', '<p>Multimodal cargo transportations is one of the most widespread way of the goods delivery by several types of transport. For multimodal transportations of cargoes cars, trains, vessels and airplanes are used in various combinations: sea+rail, auto+ airplane, rail+auto etc. Cargo - handling work and changing the transport are being made without participation of the goods owner. Intermodal cargo transportation is the cargo\'s delivery by means of one transport unit (the container, the car, etc.) without the goods reloading from one transport to another. Multimodal and intermodal transportations are widespread on the big distances.The mixed cargo transportations allow to pick up the most appropriate route and time of cargo delivery and are very popular in the international message. The good organization of the mixed transportations demands good experience of the forwarding company. Our company has extensive experience of international intermodal and multimodal transportations, we deliver cargo in time and safely for this reason our clients work many years with our company on principles of long-term cooperation.</p>\r\n<p>{mtpform}</p>', '08953e34888c2069a4534e0989b628ff', '', '2012-03-13 09:14:30', 62, 1),
(134, 1, 24, 'content', 'fulltext', '', 'd41d8cd98f00b204e9800998ecf8427e', '', '2012-03-13 09:14:30', 62, 1),
