(136, 1, 24, 'content', 'metadesc', 'The Russian transport company render service of multimodal and intermodal cargo transportations.  The mixed cargo transportations allow to pick up the most appropriate route and time of cargo delivery and are very popular in the international message.', 'e2b425645bbb151f3c724815f32eb033', '', '2012-03-13 09:14:30', 62, 1),
