(139, 1, 24, 'content', 'attribs', 'created_by=62\ncreated_by_alias=\naccess=0\ncreated=\npublish_up=\npublish_down=\nshow_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=\n\n', '56405df14c2814f631f9f82fcbfc75a2', '', '2012-03-13 09:14:30', 62, 1),
(140, 1, 7, 'content', 'title', 'Rail transport', '3b1e2bcddb92bbfbdeb686ad34165508', '', '2012-03-13 09:31:24', 62, 1),
(141, 1, 7, 'content', 'alias', 'rail', '70036b7bb753dee338a8a6baa67e2103', '', '2012-03-13 09:31:24', 62, 1),
(142, 1, 7, 'content', 'introtext', '<p>The railway system covers huge territories on all continents. Freight trains travel from the most...</p>\r\n', '76a7d5139e222649cf0547b684e6bc9a', '', '2012-03-13 09:31:24', 62, 1),
(143, 1, 7, 'content', 'fulltext', '\r\n<p>The railway system covers huge territories on all continents. Freight trains travel from the most remote points of continents, transporting various railway cargoes.  The international rail cargo transportation is a difficult process which includes booking of wagons, transportation of cargoes by the railway, freight train rearrangement at transit stations, change of wheel pairs, etc.</p>\r\n<p>Different unforeseen circumstances or any external factors, such as absence of any document or the permission, the necessary unloading equipment may occur, all these factors may affect delivery terms, therefore it is necessary to trust the cargo to professionals, such as our company which thanks to extensive experience of international rail cargo transportation, can expect and prevent problems with delivery of the goods by the railway.</p>\r\n<p>Our clients work on a long term basis with us making the order for the railway containers or transportation of cargoes by train again and again. International rail cargo transportation are in demand, thanks to high degree of safety railway transportat and  low costs. It\'s also a popular way to transport high volumes of the goods, in this case it is even possible to order the whole train. Transportation of cargoes by train allows to transport the most various kinds of cargoes from bulk goods to heavy oversized machinery which is transported on special platforms. Railway containers are also often used.</p>\r\n<p>Tariffs on international railway transportations depend on the type, weight and volume of transported cargo, distance between point of send adress and destination point, etc. therefore the rates are calculated individually for each kind of transported cargo. To get more detailed information please contact our managers.</p>\r\n<p>{mtpform}</p>', '73699b2be8bfc41039308573374ec987', '', '2012-03-13 09:31:24', 62, 1),
(144, 1, 7, 'content', 'metakey', 'Russian transport company, rail freight, logistical services, rail container, rail cargo transportation, freight trains, transportation by sea, cargo delivery in Russia and Europe, all over the world', 'd41d8cd98f00b204e9800998ecf8427e', '', '2012-03-13 09:31:24', 62, 1),
(145, 1, 7, 'content', 'metadesc', 'The Russian transport company organizes international cargo transportations by rail way. Freight trains travel from the most remote points of continents, transporting various railway cargoes.  The international rail cargo transportation is a difficult process which includes booking of wagons, transportation of cargoes by the railway etc. Transportation of cargoes by train allows to transport the most various kinds of cargoes from bulk goods to heavy oversized machinery which is transported on special platforms. Railway containers are also often used', 'd41d8cd98f00b204e9800998ecf8427e', '', '2012-03-13 09:31:24', 62, 1),
