INSERT INTO `jos_jf_content` (`id`, `language_id`, `reference_id`, `reference_table`, `reference_field`, `value`, `original_value`, `original_text`, `modified`, `modified_by`, `published`) VALUES
(151, 1, 25, 'content', 'introtext', '<p>Sometimes it’s necessary to send small-sized goods, but the order of a container or vehicle is impractical, because of it’s expensiveness. There is a service of assembled cargo transportation rendered for such cases. Transportation companies consolidate cargoes with maximum benefit to the cargo. Thus, the cost of transportation paid by several shippers is being dramatically reduced. The main disadvantage of such transportation is the increase of the delivery time and the carriers dependence from the schedule of shipment from the consolidation place.</p>\r\n<p>International shipping of assembled cargoes - is a complex process of collecting the goods at the consolidation place and its delivery to the owner that requires a lot of attention and transport company experience. Such delivery costs depend on the nature, weight and volume of cargo, the distances between the sending and destination points and other factors, so the rate for the cargo transportation is calculated individually for each type of cargo. It’s easy to get the cost of transportation – you are just to select the options proposed in the calculation form and send it to us. Our managers will calculate the cost of transportation and will contact you within the shortest period of time.</p>\r\n<p>{mtpform}</p>', 'c576472ea088b15532c8e83bcc0fb2fd', '', '2012-03-13 09:18:21', 62, 1),
(152, 1, 25, 'content', 'fulltext', '', 'd41d8cd98f00b204e9800998ecf8427e', '', '2012-03-13 09:18:21', 62, 1),
(153, 1, 25, 'content', 'metakey', 'Russian transport company, assembled cargo transportation, assembled cargo, delivery in Russia and Europe, all over the world, the goods consolidation. ', 'b6f2d319e0e14b2946889e8f38a1d226', '', '2012-03-13 09:18:21', 62, 1),
(154, 1, 25, 'content', 'metadesc', 'The Russian transport company organizes render service of assembled cargo transportation. International shipping of assembled cargoes - is a complex process of collecting the goods at the consolidation place and its delivery to the owner that requires a lot of attention and transport company experience.', '9c2278c154dbf711df486f06873fb1e0', '', '2012-03-13 09:18:21', 62, 1),
