(160, 1, 5, 'content', 'introtext', '<p>Sea freight is the most economical way of the goods transportation and the hundreds tons of cargo...</p>\r\n', '70c1e5387c0c2fccab6cd7730e965dc9', '', '2012-03-13 09:28:33', 62, 1),
(161, 1, 5, 'content', 'fulltext', '\r\n<p>Sea freight is the most economical way of the goods transportation and the hundreds tons of cargo can be transported over the long distances (thousands of kilometers). Thus, the main advantage of the goods shipping by sea is the competitive cost of shipping compared to road or air transportations, a large capacity of vessels, and the disadvantages include the presence of ports, terminals, and low-speed delivery. However, international shipments by sea - is one of the most stable ways of freight transportation, ships will be delivered on schedule, the system of cargo transportation by sea is well debugged. There are no transit customs posts, as the sea cargo clearance is usually made on arrival at the port.<br /> Carriage of goods by sea transport is divided into the following types:</p>\r\n<p>Container shipping  (the most popular way)</p>\r\n<p>Bulk cargo shipping<br /> Ro-ro shipping (transportation of heavy loads, self-propelled equipment by horizontal loading)<br /> It should be noted that the national goods transportations include not only the delivery of cargo by sea, but also the river transportation, usual on the territories covered by a network of water canals and waterways. Thanks to the rivers, many cities are connected directly with the seas and oceans, making possible the cargo shipping directly to the destination by water transport means.<br /> Tariffs for international sea transport (sea freight) depend on the type, weight and volume of cargo carried, the distance between the point of dispatch and destination and other factors, so the rate for the international goods transportation will be calculated individually for each type of delivery.</p>\r\n<p>Our company has been in the Logistics market for many years, and we’ got wide experience of international shipping and have established ourselves as a reliable and responsible partner. We cooperate with major container shipping lines, ocean and feeder carriers, such as MAERSK, Hapag Lloyd, CMA CGM, China Shipping, Canada Maritime Ltd. (Canmar), Ocean World Lines, Pacific International Lines, Containerships OY Ltd, Delta Shipping Lines, and many others. Please contact us by telephone or e-mail and our managers will calculate the cost of transportation and will contact you within the shortest period of time.<br /> <br /></p>\r\n<p>{mtpform}</p>', '833b75de8e4b946a0057125f12e39883', '', '2012-03-13 09:28:33', 62, 1),
(162, 1, 5, 'content', 'metakey', 'Russian transport company, sea freight, logistical services, container shipping, ro-ro, bulk cargo shipping, cargo shippment, transportation by sea, cargo delivery in Russia and Europe, all over the world', '171a2d19d7dc44bb9310bb4f91eb6201', '', '2012-03-13 09:28:33', 62, 1),
(163, 1, 5, 'content', 'metadesc', 'The Russian transport company organizes international cargo transportations by sea. Our sea freight services include container shipping, bulk cargo shipping, ro-ro shipping. International shipments by sea - is one of the most stable ways of freight transportation, ships will be delivered on schedule, the system of cargo transportation by sea is well debugged.', '7d2604ee82c6be85c8ff05527dd889fb', '', '2012-03-13 09:28:33', 62, 1),
