(249, 1, 35, 'content', 'introtext', '<p align=\"justify\">Cargo  shipment Austria - Russia - Austria Vienna, Graz, Linz, Salzburg, Innsbruck</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> For the tariffs info please call *** or fill in the form below </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p>Cargo may be shipped from Austria through all over the world by all modes of transport(air, sea, containerized freight, road and rail transport). Most often, trucking Austria - Russia - Austria (Vienna, Graz, Linz, Salzburg, Innsbruck) by road is the most convenient mode of transportation of goods, it’s also often carried by rail, plane. Our managers plan the optimal route of the goods delivery from Austria, thus shipping is carried out on individual transportation scheme.</p>', '8b5970c7871f862e1e1d406269403d12', '', '2012-03-20 14:36:01', 62, 1),
