(258, 1, 36, 'content', 'introtext', '<p align=\"justify\">Cargo  shipping Belgium - Russia - Belgium Brussels, Antwerp, Ghent, Charleroi, Liege, Brugge, Namur</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> For the tariffs info please call *** or fill in the form below </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p>Cargo may be shipped from Belgium through all over the world by all modes of transport(air, sea, containerized freight, road and rail transport). Most often, Belgium - Russia - Belgium (Brussels, Antwerp, Ghent, Charleroi, Liege, Brugge, Namur) by road is the most convenient mode of transportation of goods, it’s also often carried by rail, plane. Our managers plan the optimal route of the goods delivery, thus shipping is carried out on individual transportation scheme.</p>', 'b1f4308c3b15848efbc8351c6cb8e12a', '', '2012-03-20 14:37:51', 62, 1),
