(411, 1, 53, 'content', 'introtext', '<p align=\"justify\">Cargo  shipping Sweden - Russia - Sweden Stockholm, Gothenburg, Malmo, Uppsala, Västerås</p>\r\n<div>\r\n<p><strong> </strong></p>\r\n<h1><strong><br /> For the tariffs info please call *** or fill in the form below </strong></h1>\r\n<strong> </strong></div>\r\n<p>{mtpform}</p>\r\n<p>Cargo may be shipped from Sweden  through all over the world by all modes of transport(air, sea, containerized freight, road and rail transport). Most often, shipping Sweden - Russia - Sweden Stockholm, Gothenburg, Malmo, Uppsala, Västerås by road is the most convenient mode of transportation of goods, it’s also often carried by rail, plane. Our managers plan the optimal route of the goods delivery, thus shipping is carried out on individual transportation scheme.</p>', '1f1de126eec81777f273ca811dcb1c77', '', '2012-03-20 15:06:25', 62, 1),
